(21, 'Черный список клиентов', 'Обсуждаем геморройных клиентов, и все что с ними связано Субботники, менты, дрочеры, бандиты. Здесь составляется черный список клиентов и лиц с которыми не стоит иметь дело .', NULL, NULL, 0, 0, NULL, NULL, NULL, 0, 0, 5, NULL),
(23, 'Черный список девушек', 'Информация о мошенничестве со стороны девушек. Чтобы не попасться на развод со стороны жриц любви, ознакомьтесь с отзывами о кидалове в различных формах от проституток из Украины.', NULL, NULL, 0, 0, NULL, NULL, NULL, 0, 0, 5, NULL),
(33, 'Общий раздел', 'В этом разделе можно вести разговоры на любые темы, прямо или косвенно связанные с проститутками Украины.', NULL, NULL, 3, 29, 1372529917, 599, 'kba.53', 0, 0, 1, 'Приветствуем новичков!'),
(29, 'Обсуждение сайта и форума', 'Обсуждаем и улучшаем сайт с форумом. Отзывы и предложения.', NULL, NULL, 1, 3, 1347089642, 377, 'sig', 0, 5, 1, 'Пожелания и предложения о работе форума'),
(30, 'Пикап', 'Как правильно познакомиться с целью съёма? Теория по психологии и технике влияния, и т.д. Практические примеры самых успешных раскруток.', NULL, NULL, 2, 18, 1366614540, 542, 'Egor', 0, 3, 8, 'Как соблазнить иностранку?'),
(25, 'Выбор партнера, проблемы в сексе, и т.д..', 'Как правильно выбрать партнера? Решение различных проблем в сексе, решаем вместе.', NULL, NULL, 3, 37, 1347100984, 399, 'brabuss', 0, 0, 8, 'Переспала с парнем подруги... как быть?'),
(34, 'Рецензии на отчеты или недоотчеты', 'Ответные реакции на положительные и отрицательные отзывы клиентов и девушек.', NULL, NULL, 0, 0, NULL, NULL, NULL, 0, 4, 5, NULL),
(35, 'Проститутки Харькова и области', NULL, NULL, NULL, 16, 18, 1370350911, 583, 'harek', 0, 7, 2, 'Пушкинский съезд (контора) 8(093)157-36-96'),
