INSERT INTO `newforumposts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`, `forum_news`) VALUES
(30, 'Kortes', 163, '194.126.180.121', NULL, 'Всем приветы! Во время занятия сексом девушкой, стал замечать, что я постепенно дохожу до состояния так называемого "невозврата", проще говоря, чувствую что скоро буду кончать, но не очень-то хочется чтобы это произошло... Не помогает даже то, что полежу пару минут, немного остыну и все равно потом после новых телодвижений чувствую, что скоро "хеппи энд" придет... Становится обидно, что не выходит чуть дольше продержаться....\nХотя однажды я так же уже решил заканчивать, но подумал немного остыть. Полежал минуту-две и в итоге потом долго не хотелось заканчивать, т.е. намного дольше чем в обычные разы. \nПоэтому жду Ваших советов, может кто стыкался с подобным опытом и знает отчего так получилось? И как добиться, чтобы так было постоянно?', 0, 1346181128, NULL, NULL, 23, NULL),
(31, 'Kortes', 163, '194.126.180.121', NULL, 'Слышал истории, что будто бы бывали случаи, когда с путаной у клиента возникали отношения, и она как в прекрасной сказке превращалась из "чудовища" :) в прекрасную фею... и была век ему верна... да что там истории, даже в фильмах такие сюжеты не раз видел...А как в реальности такое возможно? Хочу узнать может кто из форумчан знает подобные случаи?', 0, 1346181495, NULL, NULL, 24, NULL),
(32, 'dennton', 164, '194.126.180.121', NULL, 'Форум грамотно разделен на тематические разделы, легко найти подходящие темы и раздел в котором хочется поговорить на интересующую тебя тему. Хорошо бы логотип форума сделать... В общем эта тема для предложений и пожеланий к работе форума. Я свою мысль выразил, продолжаем тему ;)', 0, 1346182490, NULL, NULL, 25, NULL),
(33, 'dennton', 164, '194.126.180.121', NULL, '[quote=Kortes]\nХотя однажды я так же уже решил заканчивать, но подумал немного остыть. Полежал минуту-две и в итоге потом долго не хотелось заканчивать, т.е. намного дольше чем в обычные разы. \nПоэтому жду Ваших советов, может кто стыкался с подобным опытом и знает отчего так получилось? И как добиться, чтобы так было постоянно?[/quote]\n\nПодобный эффект возможен при том, если ты уже немного кончил, но при этом остановился в момент оргазма, не довел его до самого конца.', 0, 1346182662, NULL, NULL, 23, NULL),
(34, 'dennton', 164, '194.126.180.121', NULL, 'Интересует, насколько пипл продвинут в этой теме, кто что знает, какие мнения на этот счет, какие у вас возникают ассоциации да и вообще, как вы относитесь к сему проявлению?', 0, 1346183393, NULL, NULL, 26, NULL),
(35, 'dennton', 164, '194.126.180.121', NULL, 'В этой теме предлагаю делится своими самыми яркими впечатлениями и создавать отчеты о лучших проститутках Киева.\nСобственно, хочу поделится свежими впечатлениями с этих выходных, решили отпраздновать день Независимости на всю котушку и заказать самую симпотную(из тех, что просмотрели на сайте [url]http://natashaescort.com/)[/url] фею, Выбрали Юлю, позвонили(063-233-12-11), говорят приезжайте - 500. Очень все понравилось, девчонка просто супер, даже лучше чем на фото.\nТеперь более подробный отчет:\nмолоденькая -21 стройненькая,\nножки супер.,\nрост-170,\nгрудь-3 упругая, просто класс!!!\nпопка круглая,\nдырочка узкая,\nкожа гладкая,ухоженная,\nбрюнетка,\nМиня-5 хоть в скафандре, все равно улет!\nЗкп,миссионерка 4+старалась,наездница 5+ было оч.приятно.\nОтношение 5+\nС радостью бы еще раз ее заказали на какой нить праздник...\nОзвучка была  слабая ,но вроде от души.Мокрела.', 0, 1346184417, NULL, NULL, 27, NULL),
(36, 'dennton', 164, '194.126.180.121', NULL, 'Привет. Проблема в том, что у моей партнерши толи после родов, либо еще какая то причина.. но дело в том, что для меня ее влагалище широковато, у меня пенис нормальных размеров, в результате выходит так, что я не могу очень долго кончить. А у нее как раз  все в поряде, оргазм случается, я же как-то остаюсь в стороне О_о, думал, что такая проблема может случатся только у женщин.... а тут вот как вышло....\nможет посоветуете какие нибуть средства, или методы, чтоб избавиться от этой проблемы? подскажите плиз!\nЗаранее благодарен.', 0, 1346184916, NULL, NULL, 28, NULL),
(29, 'Kortes', 163, '194.126.180.121', NULL, 'Предлагаю в этой теме размещать анекдоты о проститутках и анеки на тему секса тоже думаю пойдут ;)\n\nИтак начну:\n\nПятеро волков поймали красную шапочку и пустили по кругу. Сидят, отдыхают и спрашивают:\n- Ну, шапка, что дома расскажешь?\n- Так и скажу. Поймали десять волков и пустили по кругу.\n- Как десять? - волки переглянулись, - Нас же пятеро.\n- А что, второго круга не будет?!\n\nМужик подходит к женщине на улице и говорит:\n- Ты со мной переспишь за 50000 долларов?\n- Да.\n- А за 100 рублей?\n- За кого ты меня принимаешь?!\n- За кого я тебя принимаю, мы уже разобрались, вопрос только в цене.', 0, 1346180536, NULL, NULL, 22, NULL),
(37, 'dennton', 164, '194.126.180.121', NULL, 'Интересуюсь литературой по пикапу, технике съема да и вообще обольщению, если кто знает стоящие книги, которые реально помогают и дают быстрый результат, прошу выкладывать их в этой теме.\nСпасибо.', 0, 1346185175, 1346185195, 'dennton', 29, NULL),
(38, 'dennton', 164, '194.126.180.121', NULL, 'Одна из моих партнерш очень любит, когда ей во время секса затыкают рот. \nДля этого я для неё приобрел стандартный кляп шариком, но каждый раз его использовать скучно. \nМы уже столько всего перепробовали, лень перечислять, чем я ей только ротик не затыкал... :) И вот я подумал, что неплохо бы попробавть и кляп-расширитель, который колечком. Рабынька опасается, что будет больно челюсти сводить. Кто-нибудь применял такие кляпы? Расскажиет про них, если не сложно. Больше приветствуются комментарии девушек, на которых этот кляп одевали', 0, 1346185466, NULL, NULL, 30, NULL),
(41, 'Zalina', 167, '194.126.180.121', NULL, 'Всем приветики! \nНа днях задалась вопросом о том, способствует ли миньет увеличению члена? \nМожет кто поделится личными наблюдениями или познаниями в этом вопросе?\n\nЗ.Ы. Почему наблюдениями? Все дело в том, что у меня отношения с партнером довольно продолжительные и миньет у нас регулярный... звучит наверно глупо, но мне кажется что в размерах он стал больше. На данный момент я иной причины этому не могу найти.', 0, 1346241324, NULL, NULL, 32, NULL),
(42, 'Zalina', 167, '194.126.180.121', NULL, '[b]Kortes[/b], что это вообще за выкрутасы, как ты относишься к партнерше? разве так можно отлеживаться во время секса ради каких то там пару минут продолжения акта?', 0, 1346241636, NULL, NULL, 23, NULL),
(43, 'Zalina', 167, '194.126.180.121', NULL, 'Считаю всякие садо-мазохитсткие штуки проявлением насилия мужчины над женщиной, или наоборот... но никакого отношения это к ласкам не имеет...', 0, 1346241804, NULL, NULL, 26, NULL),
(44, 'dennton', 164, '194.126.180.121', NULL, 'Kortes, еще один совет: если все же доведешь до конца, и захочется второго раза, то второй раз тоже получится долгим, даже более продолжительным, попробуй поэкспериментировать!', 0, 1346242035, NULL, NULL, 23, NULL),
(45, 'dennton', 164, '194.126.180.121', NULL, '[quote=Zalina][b]Kortes[/b], что это вообще за выкрутасы, как ты относишься к партнерше? разве так можно отлеживаться во время секса ради каких то там пару минут продолжения акта?[/quote]\n\nНе стоит быть такой категоричной! У каждого человека свои предпочтения, человек хочет разобраться в проблеме, а Вы его критикуете рассматривая все со своей колокольни.', 0, 1346242149, NULL, NULL, 23, NULL),
(46, 'dennton', 164, '194.126.180.121', NULL, 'А как же, 100% миньет очень способствует увеличению.. вот у меня лично член в три раза увеличивается "после" по сравнению с "до":D', 0, 1346242354, NULL, NULL, 32, NULL),
(47, 'Zalina', 167, '194.126.180.121', NULL, 'Ха-ха, как смешно, но я не говорю об эрекции, я имею ввиду увеличение общей длины члена, знаю же что он был 18см, а теперь стал 19... вот я и подумываю, это реально работает или моя теория может быть опровержена?', 0, 1346242640, NULL, NULL, 32, NULL),
(48, 'sig', 169, '194.126.180.121', NULL, 'Надо просто уметь расслабляться, чем больше Вы напряжены, чем больше у вас кружится мыслей, тем короче половой акт! Имейте это ввиду!', 0, 1346245540, NULL, NULL, 23, NULL),
(49, 'sig', 169, '194.126.180.121', NULL, 'И так ясно, что без предохранения никак, и что презерватив нужен это бесспорно. Но согласитесь, что с любимой девушкой, то бишь с постоянной партнершей с презервативом не те ощущения, а иногда он даже бесит, в результате создаются не только физический, но и психологический барьеры...\nЧто думаете на этот счет?', 0, 1346245867, NULL, NULL, 33, NULL),
(50, 'sig', 169, '194.126.180.121', NULL, 'Может стоит попробовать другие позы, почитайте камасутру в конце концов, там, как по мне, есть позы для подходящие для гармоничного секса любых сочетаний размеров влагалищ и членов', 0, 1346246024, NULL, NULL, 28, NULL),
(51, 'sig', 169, '194.126.180.121', NULL, 'Надеюсь на то, что в этом году еще успею махнуть в крым на бархатный сезон, поэтому как в воздухе нуждаюсь отзывов о нормальных проститутках крыма, еще не знаю куда поеду, но инфа о шлюхах, думаю пригодитсо в дороге :)', 0, 1346266480, NULL, NULL, 34, NULL),
(52, 'sig', 169, '194.126.180.121', NULL, 'Бедбой хорошо и доступно пишет про основы пикапа, могу посоветовать его книгу : Руководство по рутинам - Routines manual', 0, 1346266702, NULL, NULL, 29, NULL),
(53, 'sig', 169, '194.126.180.121', NULL, 'Что касается историй об романтических отношениях со шлюхами - по мне так это сказки, сам бы я не пошел на такое, из этого следует вопрос, зачем тебе это знать? ты что ль собрался заделаться робин гудом и спасать "девочек" из лап сутенеров? :)', 0, 1346267104, NULL, NULL, 24, NULL),
(54, 'SantyaGo', 174, '194.126.180.121', NULL, 'Знаю, что член ростет до 25 лет, так что вполне возможно, что у вашего парня он вырос природным путем, а не от Вашей всасывальной силы :)))', 0, 1346267911, NULL, NULL, 32, NULL),
(55, 'SantyaGo', 174, '194.126.180.121', NULL, 'ИМХО, садо мазо или БДСМ, это совокупность правил, атрибуто и условностей, позволяющих людям удовлетворять свои сексуальные желания и потребности, хоть и немного необычным путем', 0, 1346268023, NULL, NULL, 26, NULL),
(56, 'SantyaGo', 174, '194.126.180.121', NULL, 'А можно поподробнее? Почему кляп "колечком" - расширитель? Что кольца, а что шарики, оба в основном имеют диаметр 40-45 мм., причем создается впечатление, что колечки меньше шариков. Разница в том, что колечко проще выплюнуть, да еще можно рот использовать, но это зависит от размеров колечка и того, что в рот пихаете', 0, 1346268154, NULL, NULL, 30, NULL),
(57, 'Zalina', 167, '194.126.180.121', NULL, '[quote=dennton]Привет. Проблема в том, что у моей партнерши толи после родов, либо еще какая то причина.. но дело в том, что для меня ее влагалище широковато, у меня пенис нормальных размеров, в результате выходит так, что я не могу очень долго кончить. А у нее как раз  все в поряде, оргазм случается, я же как-то остаюсь в стороне О_о, думал, что такая проблема может случатся только у женщин.... а тут вот как вышло....\nможет посоветуете какие нибуть средства, или методы, чтоб избавиться от этой проблемы? подскажите плиз!\nЗаранее благодарен.[/quote]\n\nСоветую купить вашей партнерше вагинальные шарики, пускай потренирует мышцы, это полезно во всех отношениях. У меня никогда не было там :) слабо, но когда начала тренироваться :) эффект не заставил себя ждать. Сейчас парню даже один палец могу сильно сдавить :). Так что успехов Вам.', 0, 1346268671, NULL, NULL, 28, NULL),
(58, 'Zalina', 167, '194.126.180.121', NULL, 'Спасибо за информацию, буду иметь ввиду, но все же, может кто стыкался с подобным явлением, хочу изучить этот вопрос со всех сторон...', 0, 1346268852, NULL, NULL, 32, NULL),
(59, 'dennton', 164, '194.126.180.121', NULL, 'Ася 20 лет, телефон: +38063496444\n\n[url]http://dnepropetrovsk.natashaescort.com/asia/607[/url]\n\nИз приключений в Днепропетровске вспомнилась Ася, еще по приходу в квартиру встретила в сексапильном пеньюаре..в квартире работал кондишен, что немало значит сейчас летом, приятный запах..(так как встреча была вечером вместо света были свечи) не обычное поведение для феи) вела себя очень открыто и доброжелательно, прям как будто я ее парень). В ПРОГРАММЕ ( кофе,поцелуи, душ, хлорексыдин, миник.кс, массаж,снова помывка, снова кс с миней , и пора ехать домой) жесткого контроля времени нет.звука тел не было слышно) короче говоря атмосфера супер).. встречается не как конвейер так что может и отказать во встрече.. будьте лояльные..\n\nИтого :\nТТХ  -5 с небольшим плюсиком...\nКС -5 ( умеет пользоваться своими мышцами)\nМН -5( умеет чувствовать младшего)\nОтношение к клиенту 5 с огромным+\nШГ  -есть ( по востребованию)\nЦВ -800\nПойду ли я еще? скорее всего да...но так как у меня намечается завал с работой, то думаю что не раньше чем через месяц...', 0, 1346269761, NULL, NULL, 35, NULL),
