(93, 'SantyaGo', 174, '194.126.180.121', NULL, 'В июле был в командировке во Львове. Остались приятные впечатления от одной путаны:\n[url]http://lvov.natashaescort.com/[/url]\n\nАнна (+380987777010)\nОчень советую всем любителям больших сисег, девушка знает как ими доставить максимальное удовольствие.\n\nСозвонился, пришел на хоту, получил полотенце (чистое), взял тапочки побрел в душ (в наличии шторка и гель). Помылась и Анюта после меня, застелила кроватку и мы приступили к делу. Началось все традиционно с мини(просто супер). Окресности не обрабатывает, през одела ртом.\nОстановил, перевел в ЗКП (мокреет сама) и минут через десять отстрелялся. Озвучка - аналог. Пилотка комфортная, неразношенная...\nСняла през, вытерла член салфеткой. Во время отдыха лежала у меня на груди, ласково поглаживая по интимным местам...\nВторой заход - миня, наездница, классика, отстрел (причем кончили почти одновременно). Повалялись еще минут пять, после чего опять душ и доствидос...\n\nОценки:\nХата - 5 \nТТХ - 5 (буфера кажутся намного больше заявленного 4го размера)\nМН - 5+\nКС - 4 (комфортная пилотка, аналоговая озвучка и неподдельный оргазм)\nНаездница - 5- (большие буфера заводят не по детски)\nЗКП - 4+ (попка зачетная)\nОтношение - 5 (ласковая)\nЦВ - 600 грн.', 0, 1346315873, NULL, NULL, 48, NULL),
(164, 'dennton', 164, '194.126.180.121', NULL, '[quote=vessemacina]я бы все таки советовала попрактиковать упражнения Кегеля, они помогают укреплять мышцы промежности, кстати, можете про них поискать инфу в интернете. При всем при этом эти нехитрые манипуляции можно выполнять в любую свободную минуту, главное желание ;)[/quote]\n\nБольшое спасибо за наводку на упражнения Кегеля, уже гуглим эту инфу по инету', 0, 1346784237, NULL, NULL, 28, NULL),
