(169, 'sig', 169, '194.126.180.121', NULL, '[img]http://natashaescort.com/components/com_ankets/images/original/11335604800.jpg[/img]\nНа сайте не видно лица, но по сиськам и фигурке можно сказать, что это именно та фея, которую я к счастью нашел на этой страничке: [url]http://odessa.natashaescort.com/sonia/334[/url]\nИтак мой отчет:\nСонька встретила меня очень тепло, в розовом пеньюаре и на каблуках, прям как в лучшем порно.... сразу сразила сиськами – так и хочется заснуть в них. Не ломается, ласкать дается, в пилотку пускает, пальцем в попку – без проблем. Минетик с душой с окресностями. потом классика пару поз и я кончил. Повалялись в кроватке где то минут 14, поболтали, разбежались. По ТТХ поставил 5 молоденькая, активная с стройным подкачанным абсолютно плоским животиком. В общем – охренительная фея на 5+\nИтого\nТТХ  - 5\nКС  - 5\nМН  - 4\nОтношение к клиенту - 5\n\nЦВ – 800 грн\nПойду ли я еще? Канечно ДА!!!!', 0, 1346785619, NULL, NULL, 93, NULL),
(145, 'Vladlen', 231, '194.126.180.121', NULL, 'Нет, я презик использую всегда только с новыми партнешами. Если у меня доверительные и постоянные отношения с партнершей(имеется ввиду больше месяца), то презиком в таком случае не пользуюсь', 0, 1346749707, NULL, NULL, 33, NULL),
(144, 'Vladlen', 231, '194.126.180.121', NULL, 'Вот меня уже давно интересует подобный вопрос, действительно ли у девушек с маленьким ростом - маленькие вагины?\nДаже уже было начал вести свою статистику, но как мне кажется, это заведет меня в никуда....Вот хочу узнать правда ли это? Является ли рост девушки влиятельным фактором на размер её влагалища?', 0, 1346747493, NULL, NULL, 89, NULL),
(143, 'Vladlen', 231, '194.126.180.121', NULL, 'Примерно 10-15 минут, ну еще от партнерши зависит, иногда получается продержаться до 20 минут, но это редко бывает, не знаю с чем это связано...', 0, 1346747293, NULL, NULL, 37, NULL),
(142, 'Vladlen', 231, '194.126.180.121', NULL, 'Спасибо за отчет братуха ;) буду знать на будущее, хотя если не трудно, можно фотку сей феи в теме выложить?', 0, 1346746490, NULL, NULL, 27, NULL),
(141, 'Vladlen', 231, '194.126.180.121', NULL, 'Я тоже тока презиками пользуюсь, чем пользуется партнерша меня не особо волнует, главное, чтоб я был в безопасности 8)', 0, 1346742089, 1346742113, 'Vladlen', 40, NULL),
(140, 'Vladlen', 231, '194.126.180.121', NULL, 'Не всегда в условиях, когда намечается секс, могу вспомнить о душе, все как то спонтанно происходит. Хотя идея [b]взять за правило "душ перед трахом"[/b] мне кажется довольно хорошей', 0, 1346741994, NULL, NULL, 43, NULL),
(139, 'Vladlen', 231, '194.126.180.121', NULL, ':) это уж точно, странно, меня забавляет, то что девушка задается подобными вопросами ;)', 0, 1346737338, NULL, NULL, 32, NULL),
(148, 'Vladlen', 231, '194.126.180.121', NULL, 'Мне кажется, что негативное отношении к садо-мазо возникло в результате фильмов(имею ввиду не порно, а обычное кино), в которых атрибутика бдсм приравнивается к извращениям.', 0, 1346761055, NULL, NULL, 26, NULL),
(149, 'Zulus', 181, '194.126.180.121', NULL, 'Да пожалуйста, желаю приятного времяпрепровождения, как ощущения то? если не секрет конечно ;)', 0, 1346761212, NULL, NULL, 30, NULL),
(150, 'Zulus', 181, '194.126.180.121', NULL, 'Ага, я тоже замечал подобное, кожа и плетки - сразу вуалируются в фильме как атрибуты ненормальных, маньяков и вообще больных людей.', 0, 1346761325, NULL, NULL, 26, NULL),
(151, 'Zulus', 181, '194.126.180.121', NULL, 'Хотелось бы узнать мнение девушек, вам больше нравиться если у мужчины то самое место выбрито или нет? Может кто даже какие стрижки предпочитает?', 0, 1346761521, NULL, NULL, 91, NULL);
