(154, 'Zulus', 181, '194.126.180.121', NULL, '[quote=Vladlen]Не читаю всякую литературу по пикапу, у меня с девушками и так все "Ок". Думаю эти книженции пишутся для застенчивых домоседов :D[/quote]\n\nНельзя так свысока судить, откуда а может почитав те же книженции тебе бы еще проще было бы знакомиться с девчонками.', 0, 1346763236, NULL, NULL, 29, NULL),
(155, 'Zulus', 181, '194.126.180.121', NULL, 'Кто как относится к сему прекрасному явлению в нашей жизни? Мое отношение вы думаю уже уловили в самом вопросе ;)', 0, 1346763416, NULL, NULL, 92, NULL),
(156, 'Zulus', 181, '194.126.180.121', NULL, 'ух, какие Вы изобретательные, вам палец в рот не клади, нет лучше в таком случае все таки "палец в рот клади" :)', 0, 1346763590, NULL, NULL, 28, NULL),
(157, 'Zulus', 181, '194.126.180.121', NULL, 'Лучше эту процедуру делать с аккуратным и коротким маникюром, а то в противном случае я думаю никому не понравится ;)', 0, 1346763706, NULL, NULL, 47, NULL),
(158, 'Zulus', 181, '194.126.180.121', NULL, 'Чел, спасибо за подробный отчет, у меня двоюродный брат в Днепропетровске живет, дам ему сии координаты', 0, 1346763775, NULL, NULL, 35, NULL),
(159, 'vessemacina', 182, '194.126.180.121', NULL, '[quote=Zulus]ух, какие Вы изобретательные, вам палец в рот не клади, нет лучше в таком случае все таки "палец в рот клади" :)[/quote]\nНу да, а что тут такого, в сексе фантазия и воображение играют очень важную роль. Так что учитесь ;)', 0, 1346782931, NULL, NULL, 28, NULL),
(160, 'vessemacina', 182, '194.126.180.121', NULL, 'А по теме, чтобы натренировать мускулатуру влагалища можно их просто носить на протяжении дня, при этом пытаясь работать внутренними мышцами, как бы "нащупывая" их внутри. \nВдобавок можно, или даже нужно, выполнять упражнения Кегеля', 0, 1346783133, NULL, NULL, 28, NULL),
(161, 'Zalina', 167, '194.126.180.121', NULL, 'Знаю, что оооочень приятно ездить с шариками в машине, особенно по кочкам :), так что советую покатать свою партнершу ;)', 0, 1346783287, NULL, NULL, 28, NULL),
(162, 'Zalina', 167, '194.126.180.121', NULL, '[quote=Zulus]Кстати ТС подала хорошую идею для того, о том как можно девушку развести на миньет ;)[/quote]\nМне и так нравиться делать это своему парню, а если приходится девушку уламывать, значит у Вас какие то проблеммы', 0, 1346783465, NULL, NULL, 32, NULL),
(163, 'vessemacina', 182, '194.126.180.121', NULL, 'я бы все таки советовала попрактиковать упражнения Кегеля, они помогают укреплять мышцы промежности, кстати, можете про них поискать инфу в интернете. При всем при этом эти нехитрые манипуляции можно выполнять в любую свободную минуту, главное желание ;)', 0, 1346784144, NULL, NULL, 28, NULL),
(146, 'Vladlen', 231, '194.126.180.121', NULL, 'Не читаю всякую литературу по пикапу, у меня с девушками и так все "Ок". Думаю эти книженции пишутся для застенчивых домоседов :D', 0, 1346750378, NULL, NULL, 29, NULL),
(172, 'Vladlen', 231, '194.126.180.121', NULL, 'Камрад, большое спасибо за отчет, и вправду жаль, что эта девочка личико не приоткрыла, а так я оч.заинтересован. сиськи на фото( если это её, конечно) - просто отпад!!!', 0, 1346786513, NULL, NULL, 93, NULL),
(173, 'Vladlen', 231, '194.126.180.121', NULL, '[quote=sig]по мне, так насилие и все эти садо-мазы - это развлекуха извращенцев, психически больных людей, у которых иначе и не встает![/quote]\nеще одного не в ту степь склонило, при чем тут извращенцы? знаю, абсолютно норм. людей, который иногда да прибегают к этим шалостям, и ничего паталогического в этом не вижу', 0, 1346786732, NULL, NULL, 26, NULL),
(336, 'lu4ano81', 284, '46.185.69.85', NULL, 'Поделюсь, может кому будет интересно, или кто туда собирается.\nОтдыхал в отеле, решил приверить и отметиться на китайской земле.\nНе верте , что там комунизм и пережитков буржуазных типа проституток нет! Валом и на улице после 20 за руки хватают. Цены у уличных от 300 до 600 уаней (600 юаней=100бакам) , если вы похожи на китайца, то наверное дешевле, уличная заводит сразу в салон типа цирюльни с микро комнатами для местоимения, комната оснащена кроватью для траха и лежаком для обмывания тела клиента.\nСразу скажу что уличную побрезговал так как место имения не вызвыло восторга в смысле гигиены(сильно зачуханое).\nНайти салон просто по большым красным сияющим вывескам из китайских иероглифов. В салон завез рускоязычный гид китаец и за 1200 юаней предложили королевский секас...Включает в себя омывание клиента до дыр  в процесе раза 3, миня без гандона, секас в гандоне, затем берут в рот какое-то пахучее желе и лазят по всему телу по всем ямкам как бы целуя и смазывая...и самое прикольное так неистово, с азартом и со стонами очко мне нигде не вылизывали!!!\nСразу скажу , что второй раз был без гида за 600 юаней...,тоесть попробывал двоих.\nИтог ТТХ на 3 ну ускоглазые и коротконогие, сиськи конусом с длинными чернючими сосками, письки не бреют;\nМН-5+ гут,гут...а язык в жопу ваще фишка!\nкс- 3 прутся -цифра, еще и показавает,что мол ее писька под украинский член не заточена и ей муляет в районе солнечного сплетения\nШГ - не спрашивал по китайски не знаю за и может религия им не позволяет или партия хз.\nБыл еще на шоу: лезвие типа нивы в письку вставляет, сжимает ноги-лезвие пополам а писька цела(по крайней мере снаружи); железный прут в письку вставляет...зажимает и сгибает; пробку с пива открывает всунув бутылку в письку и зажав; шарики и еще какуето хрень...Вобщем показывали какие у них мышци письки тренированые ...стоит 600 юаней, предлагали трах с ней за 300, но увидев что сделано с прутом железным...своего молодца на эксперименты я не отдал!\nВсем удачи, надеюсь кому-то будет полезно!', 0, 1347040536, 1347040566, 'lu4ano81', 150, NULL),
(175, 'Vladlen', 231, '194.126.180.121', NULL, 'Ха-ха, решил для братца подарочек оформит, ну-ну ;)', 0, 1346788473, NULL, NULL, 35, NULL),
(426, 'rafinad', 285, '46.185.69.85', NULL, 'я конечно телегу изложил пиздец.Неподумайте дурного.Хотелось с миром поделиться.Я как бывший рок поэт и музыкант и ещё нестандартный человек со смутным прошлым ,оказался один на один с Тайландом и вернулся живым.И это заебись.', 0, 1348156375, NULL, NULL, 159, NULL),
(284, 'dennton', 164, '194.126.180.121', NULL, 'Если поставить себе за цель принимать душ перед близостью - то все будет выходить, главное захотеть.', 0, 1347011197, NULL, NULL, 43, NULL),
(285, 'Zalina', 167, '194.126.180.121', NULL, 'Да, но почему то больше хочется секса, чем прерывать ласки и мчаться в душ...', 0, 1347011303, NULL, NULL, 43, NULL),
(286, 'sig', 169, '194.126.180.121', NULL, '[b]Zalina[/b], а совмещай приятное с полезным ;), переходи к сексу сначала в душе :)', 0, 1347011393, NULL, NULL, 43, NULL),
(287, 'Zalina', 167, '194.126.180.121', NULL, 'Оооо, спасибо за совет, если будет душ поблизости - обязательно попробуем :)', 0, 1347011618, NULL, NULL, 43, NULL),
(288, 'Zalina', 167, '194.126.180.121', NULL, 'А зачем Вам строить отношения с проституткой? Кругом мало девочек чтоле? Нужно разделять приоритеты:\nшлюхи - токо для траха, а девушки для отношений + трах :) конечно', 0, 1347011746, NULL, NULL, 24, NULL),
(289, 'Zalina', 167, '194.126.180.121', NULL, 'Даже и представить не могу чтобы кто то на форуме признался, что он ненавидит секс.... И так понятно что все мы нормальные люди и все положительно относимся к сексу.', 0, 1347011838, NULL, NULL, 92, NULL),
(290, 'Zalina', 167, '194.126.180.121', NULL, 'Сейчас частота моих занятий любовью составляет 2 раза вдень. Для меня это просто супер, я всем довольна :)', 0, 1347011958, NULL, NULL, 38, NULL),
(291, 'Zalina', 167, '194.126.180.121', NULL, 'Мне больше нравится, когда в партнер нежно и медленно в меня входит, хотя иногда и бывают исключения их этого правила.', 0, 1347012516, NULL, NULL, 133, NULL),
(292, 'Zalina', 167, '194.126.180.121', NULL, 'На своей "днюхе" переспала с парнем одной из своих подруг.... знаю, что у них пока нет серьезных отношений... они пока просто целуются, и тп. до секса вроде еще у них не доходило...я его до этого считала своим другом...\nА на моё день рождения пришел он, а подруги, которая с ним мутит - не было.... и ещё вторая моя подруга....\nНу мы напились... моя подруга уснула, а мы с лучшим другом (!) переспали..... \n\nпроблема в том, что я не могу смотреть в глаза подруге.... мне перед ней стыдно. \nя сначала хотела рассказать, но решила этого не делать....  в общем, я не хочу терять своего лучшего друга и свою лучшую подругу тоже. как поступить?', 0, 1347012771, NULL, NULL, 139, NULL),
(293, 'Zalina', 167, '194.126.180.121', NULL, 'Итак, есть ли у кого привычка затянуться сигареткой после секса?', 0, 1347012924, NULL, NULL, 140, NULL),
(294, 'Vladlen', 231, '194.126.180.121', NULL, 'Анастасия, +380689704088\nУлыбчивая и веселая 25 девчонка, да именно девчонка, так как в ее компании становится легко и весело, даже было забыл, что эту девочку я вызвал для себя для тех самых нужд... так как кажется что общаешься с давно знакомой, хорошей подругой. В общем ее фото на сайте(http://donetsk.natashaescort.com/anastasiia/356)\n[img]http://natashaescort.com/components/com_ankets/images/original/11338884842.jpg[/img]\nполностью отвечает ее характеру.\nВсе понравилось. Вот мои оценки:\nТТХ  - 4,5\nКС  - 5\nМН  - 5\nОтношение к клиенту - 5+++++++\nШГ - 5\nПойду ли я еще? Да.', 0, 1347013485, NULL, NULL, 141, NULL),
(295, 'Vladlen', 231, '194.126.180.121', NULL, 'Спасибо за тему, и за отчет, спасибо брат, буду знать. Кстати, Машенька хороший вариант, думаю, что отведаю ее в ближайшее время :)', 0, 1347013566, NULL, NULL, 41, NULL),
(296, 'Vladlen', 231, '194.126.180.121', NULL, 'Наташа, тел.: +380632135257\n[img]http://natashaescort.com/components/com_ankets/images/original/11345793530.jpg[/img]\n[url]http://donetsk.natashaescort.com/natasha/407[/url]\nОтодрали её вместе с другом, девка знает свое дело, так что мы с ней не соскучились. Как попа так и влагалище - упругие, было оч. приятно.\nВот оценки:\nТТХ  - 4\nКС  - 5\nМН  - 4\nОтношение к клиенту - 5\nШГ - 5+\nЦВ – 600 грн\nПойду ли я еще? Да, хочу ее еще сам потрахать, без групповухи :)', 0, 1347013899, NULL, NULL, 142, NULL),
(297, 'Vladlen', 231, '194.126.180.121', NULL, '[img]http://natashaescort.com/components/com_ankets/images/original/11344331370.jpg[/img]\nОльга, +380668152919\n[url]http://donetsk.natashaescort.com/olga/546[/url]\nЭтой женщине уже 32 года, но фигурка еще держится, пообщались и перешли к делу, обрезинила ртом, немного пососала, и перешли к классическому траху - нормально, активно.\nВ итоге оценки:\n\nТТХ - 3 (возраст как ни как)\nМН - 4+ (видно любит это дело)\nШГ - не знаю, и не спрашивал\nЦВ - 500 грн\nПойду ли я еще? думаю, что пока нет..', 0, 1347014396, 1347014427, 'Vladlen', 143, NULL),
(193, 'brabuss', 254, '194.126.180.121', NULL, 'Обожаю секс, как еще к нему можно относиться. Негативное отношение может быть разве что у немного нездоровых людей.', 0, 1346842149, NULL, NULL, 92, NULL),
(194, 'brabuss', 254, '194.126.180.121', NULL, 'Чаще всего специально включаю свет, нравится рассматривать девчонок, когда их трахаю :)', 0, 1346842227, NULL, NULL, 44, NULL),
(178, 'Kortes', 163, '194.126.180.121', NULL, '[quote=dennton]Интересуюсь литературой по пикапу, технике съема да и вообще обольщению, если кто знает стоящие книги, которые реально помогают и дают быстрый результат, прошу выкладывать их в этой теме.\nСпасибо.[/quote]\n\nА я в последнее время очень интересуюсь л-рой по пикапу, но и домоседом себя назвать не могу, наоборот в клубах хочется побыстрее соблазнить девченку, а где как не в книгах по пикапу можно узнать новые методы сьема?', 0, 1346821596, NULL, NULL, 29, NULL),
