(213, 'vessemacina', 182, '194.126.180.121', NULL, 'Нас с мужем всегда возбуждает, когда во время секса на мне надеты стринги. Их даже можно не снимать, а просто немного отодвигать. Однако со временем у меня часто стала возникать молочница. \nВрач-гинеколог сказал, что это все из-за стрингов, которые натирают кожу половых органов и способствуют ухудшению микрофлоры. \nТеперь, к сожалению, я такие трусики больше не надеваю... хоть нам они очень нравились. \nМожет, врач преувеличивал и стринги тут ни при чем?', 0, 1346847663, NULL, NULL, 104, NULL),
