(223, 'Andy Garcia', 261, '149.3.129.202', NULL, 'Всем респект!\nПервый (не последний надеюсь) отчет, если что не так... так и будет  :-P \nОднажды вечиром, напившись на презентации, паехали на левак допивать. Допили. Отшлифовались. Откуда-то из-за угла выскочила пустая  хата. Отбиваться не стали. Телефонов под ркой не было и было интересно посетить "магазин", т.к. давно не был.\n"Магазин" - окружная. Таксист попался жалостливый ) и 2 круга мотал за 65 грн. Было отсмотрено и забраковано по причине несоответствия типу хомосапиенс много гуманоидов, имеющих некое подобие с вторичными половыми признаками.\nТем не менее, пеленг сработал: была найдена Оля. На вид лет 18-19, студентка из Сум. "Сбежала от родителей"  :loool:\nМестоИмения - своя квартира\nЦена - 300 грн час  :o  :eek: на всю ночь (с 2 до 7) 500 грн, после недолгих переговоров.\nАтчИОт - Мы были вдвоем. Поочереди. Работала усердно, но непрофесионально и неинтересно как-то... поначалу. Потом разошлась и... стало немного веселее. Разминирует на 3. Все остальное по 4 - за технику, за отношение к клиенту (общительная и не грузит) твердая 4.\nИтого: 4 (как для окружной - так повезло)\nТТХ - 4 (маленького роста, грудь - 2, фигуристая, лицо миловидное не более)\nКС - 4\nМинНет - 3 (не умеет)\nОтношение к клиенту - 4\nШГ - не пробовал. Риск прорыва презерватива прямопропорционален самоубийству.\nПойду ли я еще? Вряд ли найду, телефона нет, работает с 20 до 01. Да и не хочеца павтаряцца.', 0, 1346864342, NULL, NULL, 106, NULL),
(224, 'Andy Garcia', 261, '149.3.129.202', NULL, 'Пишу 2-й раз, та что звиняйте если что не так.\nЗамученный спермотоксикозом, не дождавшись подруги(должна приехать дней через 5) пару недель тому(задержался) звоню Инне, которой 30..Прошу тех кого знаю(т.н. ее подруги), но их нет.Предлагает за 40 у.е  30-ти с чем то лет подругу .Соглашаюсь.\nМестоимение-гостинка на Р.Ролана, слегка уебаная, но так может быть.\nНа хате- 2 уеб. лет 40-45 и 30-35, За 300грн предлагают втроем, с дуру(спермотоксикоз) соглашаюсь.\nНа чинают елозить. лизать яйца, минетить и т. д.Вобщем-хуйня\nОтстрелялся 2 раза, попил чая, ушел.\nИтого: \nМясо-2\nМестоимение-3\nПроцесс3+(и то только из-за того что впервой)\nБодьше к этим неходок\nВывод:пользуйся тем что знаешь и умей вовремя послать на х.', 0, 1346864652, NULL, NULL, 107, NULL),
(225, 'sig', 169, '194.126.180.121', NULL, 'Всем доброго времени суток! Выбрал себе подругу на ночь на [url]http://kharkov.natashaescort.com/ania/424,[/url] так как она полностью подошла под мои запросы, на ту ночь по крайней мере :)\nЗовут Аня, тел. +380936718450\nвот фото:\n[img]http://natashaescort.com/components/com_ankets/images/original/11340468902.jpg[/img]\n\nа вот атчёт:\n\nТТХ (для любителе худышек) 4\nКС: незнаю, драл сам\nМН: 5\nОтношение к клиенту: 4\nШГ: не почитатель\nЦВ: 500 гр \nПойду ли еще? Думаю, может когда то да пойду, хоть вариант хороший, бюджетный, но чет еще более уникального хочется...', 0, 1346870802, NULL, NULL, 108, NULL),
(226, 'sig', 169, '194.126.180.121', NULL, 'Захотелось отодрать опытную тигрицу, которая с опытом, но в отличной форме, и такой вариант нашелся вот тут: [url]http://kharkov.natashaescort.com/miroslava/390[/url]\nФото прилагается:\n[img]http://natashaescort.com/components/com_ankets/images/original/11341342616.jpeg[/img]\n\nЗовут сию "принцессу" Мирослава, тел.: +380990699396. Также помимо классического траха заказал тайский массаж, должен сказать, девчонка знает свое дело на этом поприще, так отмассажировала, что я чуть не кончил.\nИтак делюсь впечатлениями в отчете с оценками:\nТТХ: 5+ для 29 лет, выглядит на 23летнюю\nКС: 5\nМН: 0 не знаю, не заказывал :)\nОтношение к клиенту: 5\n\nЦВ: 600 гр  \nПойду ли еще? Обязательно', 0, 1346871342, NULL, NULL, 109, NULL),
(227, 'Zalina', 167, '194.126.180.121', NULL, 'Мне кажется врач преувеличил. Стринги-это зло! О_о и из-за них может возникнуть много проблем, но это все теоретически, поэтому я несмотря ни на что все равно их ношу, хоть и осознаю что вредно(но красота есть красота)', 0, 1346871743, NULL, NULL, 104, NULL),
(228, 'sig', 169, '194.126.180.121', NULL, 'А можно подробней насчёт зла и проблем? \nКаким таким образом стринги могут причинить вред половым органам и здоровью?', 0, 1346871876, NULL, NULL, 104, NULL),
(229, 'Vladlen', 231, '194.126.180.121', NULL, 'Да кто эти стринги будет носить в повседневной жизни? Их же скорее всего тока для развлекухи и перед секасом одевают!', 0, 1346871954, NULL, NULL, 104, NULL),
(230, 'brabuss', 254, '194.126.180.121', NULL, 'насчёт того, что вредно, скажу следующее: есть мнение, что будто бы у мужчин которые носят чаще всего плавки, в будущем могут возникнуть проблемы с потенцией.. Но что-то в это с трудом верится...', 0, 1346872097, NULL, NULL, 104, NULL),
(231, 'Kortes', 163, '194.126.180.121', NULL, '[quote=brabuss]насчёт того, что вредно, скажу следующее: есть мнение, что будто бы у мужчин которые носят чаще всего плавки, в будущем могут возникнуть проблемы с потенцией.. Но что-то в это с трудом верится...[/quote]\nНичего подобного не замечал за собой. Сам ношу практически всегда плавки(иногда просто обхожусь без них), и не могу перейти на менее "травматичные" трусы "семейники" и шорты "боксёры"...', 0, 1346872227, NULL, NULL, 104, NULL),
(232, 'Kortes', 163, '194.126.180.121', NULL, 'Ага, офигенно, я бы даже сказал профессионально фото сделано! Да и фея не менее эффектно выглядит.\nХочу!', 0, 1346872364, NULL, NULL, 105, NULL),
(233, 'Kortes', 163, '194.126.180.121', NULL, '[quote=brabuss]1-2 раза в день[/quote]\nКруто, повезло тебе, мне пока так часто и не хочется...', 0, 1346872438, NULL, NULL, 38, NULL),
(234, 'Kortes', 163, '194.126.180.121', NULL, 'фуууу, какая то тема противная, как вам в голову пришло такое!!!', 0, 1346872516, NULL, NULL, 102, NULL),
(235, 'Kortes', 163, '194.126.180.121', NULL, 'Алина, +380984412607\n\nВот ссылка на сею фею: [url]http://natashaescort.com/alina/520[/url]\nи ее фото:\n\n[img]http://natashaescort.com/components/com_ankets/images/original/11341335741.jpeg[/img]\n\n+мои оценки:\nТТХ (тактико-технические характеристики) - 3\nКС (классический секс) - 4\nМН (миннет) - 4-\nОтношение к клиенту - 2\nШГ (шеколадный глаз) - нет\nЦВ(цена вопроса) - 300 за час\nПойду ли я еще?  - нет\n\nЗ.Ы. это просто дешевый и менее более приличный вариант для одноразового траха, ИМХО', 0, 1346872774, NULL, NULL, 110, NULL),
(255, 'SantyaGo', 174, '194.126.180.121', NULL, '[img]http://natashaescort.com/components/com_ankets/images/original/11340644598.jpg[/img]\nИра, +380630680900\n\n[url]http://lvov.natashaescort.com/ira/459[/url] - вот здесь нашел эту прекрасную львовскую блонду. Впечатления остались приятные, советую попробовать. Особенно запомнился миньет, такое впечатление, что ей действительно нравится его делать.\n\nМои баллы:\nТТХ  - 4\nКС  - 4\nМН  - 5+ - очень понравилось, суперски сосет\nОтношение к клиенту - 5\nШГ - 0\nЦВ – 600\nПойду ли я еще? Да. Как только буду во Львове - сразу к ней :)', 0, 1346911868, NULL, NULL, 129, NULL),
(254, 'SantyaGo', 174, '194.126.180.121', NULL, 'Всем только что зарегистрированным на форуме желательно отписаться тут в формате:\n\nИмя,\nКем работаете,\nХобби,\nОпыт общения с проститутками(сколько времени уже пользуетесь их услугами, например: 1год)\n\n;) ;) ;)', 0, 1346911465, NULL, NULL, 128, NULL),
(253, 'SantyaGo', 174, '194.126.180.121', NULL, 'Нашел молоденький(ей 22 года) и бюджетный вариант.\nЗовут Ника, тел: 0637981777 за час берет всего 400грн.\nОставляю фото:\n[img]http://natashaescort.com/components/com_ankets/images/original/11345208276.jpg[/img]\n\n\nи ссылку на ее профиль на сайте: [url]http://dnepropetrovsk.natashaescort.com/nika/602[/url]\n\nСкажу сразу, что отлично потрахался за такие то деньги, советую всем.\nОценки:\nТТХ  - 5\nКС  - 5\nМН  - 4\nОтношение к клиенту - 4\nШГ - 0, не интересовался\nЦВ – 400 грн\nПойду ли я еще? Да, и думаю что в скором времени.', 0, 1346911286, NULL, NULL, 127, NULL),
(250, 'SantyaGo', 174, '194.126.180.121', NULL, 'Всем приветы, делюсь отчетом о проституточке по имени\nЮленька, +380631280070\n\n[img]http://natashaescort.com/components/com_ankets/images/original/11344843349.jpg[/img]\n\nНашел ее вот здесь: [url]http://dnepropetrovsk.natashaescort.com/iulenka/595[/url]\n\nСкажу сразу, что хоть грудь у нее маленькая, она этот недостаток компенсирует стройной фигурой и жарким трахом. Трахается очень страстно, приходилось даже себя сдерживать, чтоб заблаговременно не кончить.\n\nМои оценки:\nТТХ  - 4,5\nКС  - 5+\nМН  - 4\nОтношение к клиенту - 5\nШГ - 0\n\nПойду ли я еще? Да.', 0, 1346910473, NULL, NULL, 125, NULL);
