(251, 'SantyaGo', 174, '194.126.180.121', NULL, 'А почему бы и нет, я бы и сам обрадовался подобному подарочку. Ты глянь какие оценки и сам все поймешь ;)', 0, 1346910577, NULL, NULL, 35, NULL),
(252, 'SantyaGo', 174, '194.126.180.121', NULL, 'Когда то была еще юношеская фантазия трахнуть юную Герду из сказки снежная королева, и на той неделе в одну прекрасную ночь эта фантазия сбылась :). \nЗаказал шлюху по имени Гедра, +380994379911 \nи отпердолил ее как следует.\nВот ссыль на ее страничку: [url]http://dnepropetrovsk.natashaescort.com/gerda/594[/url]\n\n[img]http://natashaescort.com/components/com_ankets/images/original/11344842681.jpg[/img]\n\nМои баллы:\nТТХ  - 5\nКС  - 4\nМН  - 4\nОтношение к клиенту - 4\nШГ - 0\nЦВ – 700 грн\nПойду ли я еще? Даже и не знаю, возможно через месяц...', 0, 1346910839, NULL, NULL, 126, NULL),
(256, 'SantyaGo', 174, '194.126.180.121', NULL, 'Сейчас как то все стабильно получается 4 раза в неделю, даже кажется что в одни и те же дни :)', 0, 1346911953, NULL, NULL, 38, NULL),
(257, 'SantyaGo', 174, '194.126.180.121', NULL, 'Охрененно потрахался с одной ночной бабочкой по имени Ельза, +380978000508\nТело у девочки просто супер, зацените:\n[img]http://natashaescort.com/components/com_ankets/images/original/11344382794.jpg[/img]\n\nНашел ее конечно же на наташаэскорте, вот тут: [url]http://lvov.natashaescort.com/elza/554[/url]\n\nВыставляю самые высокие оценки, это для меня впервые :)\n\nТТХ  - 5\nКС  - 5\nМН  - 5\nДополнительно заказал глубокий минет, очень понравилось, буквально ублажила меня, ставлю еще одну 5\nОтношение к клиенту - 5\nЦВ – 800 грн\nПойду ли я еще? Да.', 0, 1346912259, NULL, NULL, 130, NULL),
(258, 'Kortes', 163, '194.126.180.121', NULL, 'Да, очень удобно подобрать себе проститутку по вкусу и по возрасту, вбил характеристики :) и наслаждайся', 0, 1346934468, NULL, NULL, 101, NULL),
(259, 'Kortes', 163, '194.126.180.121', NULL, 'Привет!\nХочу оставить оценки о фее по имени Влада, 0997792141\n[img]http://natashaescort.com/components/com_ankets/images/original/11344420767.jpeg[/img]\n\nСразу скажу, что сей "цветок" советовал бы всем любителям юных спутниц на одну ночь. Так как девчушка очень молоденькая, я бы даже сказал игривая, но при всем при том отминетила(в презике, надела ртом, за что +) качественно, и трах получился зачетный. С суперским аналом, не смог удержаться, чтоб не проникнуть в ее маленькую попку :)\nТак вот сссылка на ее страничку: [url]http://kharkov.natashaescort.com/vlada/555[/url]\nИ мои оценки:\nТТХ  - 5\nКС  - 5\nМН  - 5+\nОтношение к клиенту - 4\nШГ - 5\nЦВ – 400\nПойду ли я еще? Да.', 0, 1346934847, NULL, NULL, 131, NULL),
(260, 'Zalina', 167, '194.126.180.121', NULL, 'да, как говорится, волка бояться - в лес не ходить ;)', 0, 1346935055, NULL, NULL, 104, NULL),
(261, 'Zalina', 167, '194.126.180.121', NULL, '[quote=vessemacina][quote=brabuss]У меня душ всегда после секса, так как когда все идет к сексу - тогда не до душа :)[/quote]\nПылкий Вы какой то ;) а мне вариант отношения к сексу как "с пылу жару" не нравится.[/quote]\nДа, но вначале отношений, когда страсти распалены, по иному чаще всего и не выходит...', 0, 1346935144, NULL, NULL, 43, NULL),
(262, 'Zalina', 167, '194.126.180.121', NULL, 'В наше время презерватив нужен всегда, исключением из правил могут быть разве что действительно плотные и очень доверительные отношения давно знающих друг-друга партненов', 0, 1346935241, NULL, NULL, 33, NULL),
(263, 'Zalina', 167, '194.126.180.121', NULL, 'Вы меня конечно извените, но по-моему, так это очередная глупость из раздела "размер члена мужчины равняется размеру его ноги, руки и т.д." :)', 0, 1346935350, NULL, NULL, 89, NULL),
(264, 'Vladlen', 231, '194.126.180.121', NULL, '[quote=Zalina]Вы меня конечно извените, но по-моему, так это очередная глупость из раздела "размер члена мужчины равняется размеру его ноги, руки и т.д." :)[/quote]\nНо я спрашиваю о взаимосвязи миниатюрного роста, а не о сопоставлении размера стопы или других частей тела, интересует именно влияние роста!', 0, 1346935512, NULL, NULL, 89, NULL),
(265, 'Zalina', 167, '194.126.180.121', NULL, 'Думаю девчонки да и парни тоже со мной согласятся. Какая здесь может быть связь? \nУ всех свои анатомические особенности, мало зависящие от роста', 0, 1346935628, NULL, NULL, 89, NULL),
(266, 'Zalina', 167, '194.126.180.121', NULL, 'Привет! Я недавно на этом форуме. \nЗовут меня Залина,\nработаю секретарем-референтом,\nхобби - вышивание, прогулки на велосипеде,\nк проституткам пока не обращалась :)', 0, 1346935731, NULL, NULL, 128, NULL),
(267, 'Zalina', 167, '194.126.180.121', NULL, 'По мне, так те, кто не занимается сексом тогда, когда ему хочется - нездоровы психически... ничего ужасающего не вижу в сексе во время "этих дней".', 0, 1346935893, NULL, NULL, 102, NULL),
(268, 'Kortes', 163, '194.126.180.121', NULL, 'Привет, опишу ночную бабочку Натали, +380663117737\nДевушка очень веселая, мы с ней ржали и говорили на протяжении всех 20 минут...самое смешное было то что она делает минет и что то смешное ляпнет между прочими или может что то пиздонут во время класики..\nа самое главное что девушка сама оченнннььь преться от траха что очень большой ++++))))\n[img]http://natashaescort.com/components/com_ankets/images/original/1natasha.jpg[/img]\n\n\n[url]http://kharkov.natashaescort.com/natali/172[/url]\nТеперь оценки:\nТТХ - 4\nМН - 5\nКС - 5 (просто ураган))\nотношение к клиенту - 5+ (плюс за то что веселая и пиздит обо всем)\nЦВ - 500 грн\nПойду ли я еще? Обязательно, такого приятного времяпрепровождения в компании девочки по вызову давно не испытывал.', 0, 1346936175, 1346936214, 'Kortes', 132, NULL),
(269, 'Kortes', 163, '194.126.180.121', NULL, 'Не могу согласиться, все таки у человека пропорции тела взаимосвязаны, и вполне вероятно что у миниатюрной девчушки маленькая пещерка', 0, 1346936326, NULL, NULL, 89, NULL),
(270, 'Kortes', 163, '194.126.180.121', NULL, 'Интересует вопрос, все таки, как нужно двигать членом внутри влагалища? а именно, вводить нужно плавно и медленно, или быстро и интенсивно?', 0, 1346936665, NULL, NULL, 133, NULL),
(271, 'Kortes', 163, '194.126.180.121', NULL, '[img]http://natashaescort.com/components/com_ankets/images/original/11346442500.jpg[/img]\n[url]http://kharkov.natashaescort.com/katiusha/591[/url]\n\nМарина, 0669060330\nКлассно и как ни странно быстро все получилось, наверное, я сам того не замечая, смог расслабиться в компании сей дивной феи.\n\nОценки:\nТТХ  - 4,5\nКС  - 5\nМН  - 5( глубоко минетит)\nОтношение к клиенту - 5\nШГ - 0\nЦВ – 600 грн\nПойду ли я еще? Да.', 0, 1346936873, NULL, NULL, 134, NULL),
