(274, 'Andy Garcia', 261, '64.62.244.51', NULL, 'Под конец рабочей недели, думаю - не махнуть ли к фее в обед. перерыв.\nБыла выбрана Мира 8(063)874-69-69 \nСозвон,  в гости можно?\nПриезжай. \nОк, в течении часа буду.\nПринимает возле м. Политех. институт.\nЗвоню, спрашиваю какая парадная, грит последняя. \nЖду, её нету. Звоню, она - подожди 30 мин. \nмля...... послал нах.... обед  не безграничный.\nДалее идёт судорожное листание топ-моделс в инет-кафе.\nДашенька , Дина принимают после 16-00 .... студенточки ...\nДальше выбор пал на Леночку \nСозвон. А её нету, буде завтра. Но, говорят, есть Яна, новенькая. Попросил описать ттх. \nОкей, еду.\nПринимает на красноармейской возле м. Либлядска \nВстретила. \nКвартира 3 комнаты.  не очень.\nНа кухне голоса подруг. Работают их там 3-4  чел.\nЗовут Яна(160см +-5,  грудь 1+,  худенькая), провела в комнату. Выдала полотенце, чистое но жёсткое. Тапок нету. Крепление для душа сломано.\nПриступили. Траходром - на "2", простыня  б.у. \nМиня на 3 с минусом,  во время мини вспоминалась\nСашенька 8(066)546-19-41 , кто был - поймёт  ;-)\nОбрезинила  руками, дал замечание, второй раз "резинила" ртом.\nДевочка какая-то дёрганая, спешит.  пристрелил в КС быстро.  Люблю в глаза смотреть .... \nПолежали, поговорили, девочка из Донецка, училась в Харькове. 3амужем. харьковской з.п.  ей мало.  В Киеве 2 день говорит. Предложила массаж,  но предупредила что делать не умеет.(нах предлагать?). Согласился, выдержал 3 мин.,  пошёл в душ. \nВторой заход опробовал в разных позах. Понравилось псом, говорит любит так, вид сзади + попка класс. \nПристрелил в кс. Помылся, постояли на  балконе, поговорили.\nВозле лифта пересеклись с Ланой\nИтого 3-:\nТТХ  3-\nКС 3\nМН 3-\nОтношение к клиенту - 3+(учится)\nШГ - не уточнял\nЦВ(цена вопроса) -500 грн. (реально на 350-400 тянет)\nПойду ли я еще? Леночку попробовать - возможно.', 0, 1346943729, NULL, NULL, 135, NULL),
