(301, 'Vladlen', 231, '194.126.180.121', NULL, 'Преветы!\nХотя я уже обжился на этом форуме, все же захотелось засветится в этой теме.\nЯ Владлен,\nпредприниматель,\nпокатушки на джипе, отдых на природе, рыбалка,\n3 года', 0, 1347016096, NULL, NULL, 128, NULL),
(302, 'Vladlen', 231, '194.126.180.121', NULL, 'Идут парень с девушкой по лесу.\nДевушка: «Дорогой, ты можешь ради меня сломать берёзу?»\nПарень: «Могу»\n- «И дуб?»\n- «И дуб могу»\n- «А сосну?»\n- «А соснёшь – я тут всё переломаю»\n\n\nВстречаются две проститутки, одна говорит другой:\n- Прикинь, вчера чуть сотку баксов не нашла;\nДругая ее спрашивает;\n- Как это? Чуть не нашла?\nТа отвечает: ну представь, иду, аллейка, валяется сотка зелени, я наклоняюсь, нееее, чуствую что отрабатываю))\n\n\n- На столе лежат линейка, карандаш, циркуль и резинка. На листе бумаги нужно начертить окружность. С чего Вы начнете?\n- Возьму резинку, пойду по бабам. Нафига мне эта окружность…', 0, 1347016280, 1347016288, 'Vladlen', 22, NULL),
(298, 'Vladlen', 231, '194.126.180.121', NULL, 'Да, посмотрел на эти ножки, и захотелось пробраться между них... Может даже в ближайшие выходные я это попробую осуществить :)', 0, 1347014575, NULL, NULL, 105, NULL),
(299, 'Vladlen', 231, '194.126.180.121', NULL, 'Фоты на сайте так сделаны, что не разберешь, она ли это, да и фигурку трудно по фото рассмотреть.\n[img]http://natashaescort.com/components/com_ankets/images/original/11339248058.JPG[/img]\n[url]http://donetsk.natashaescort.com/masha/382[/url]\n\nСозвонились(тел.: +380997741333), встретила Маша, фигурка оказалась приятная, предложила чаек, потрындели...сходил в душик, и понеслась...сначала сосала, а потом понеслась..делает все сама ты тока лежишь и отдыхаешь...потом острелялся...сделала масажик приятный, потом ещё раз стрельнул...вообщем фигурка зачётная, ...сиськи отличные - упругие 2й размер, вид сзади офигенный, приятно что за временем не слидит, приятная в общении...вообщем очень приятная и милая...и так:\n\nИтого:\nТТХ - 5 (отношение к клиенту просто офигительное)\nКС - 5 (очень активая в постели)\nМН - 5 (только в презе, рот отлично работает) \nОтношение к клиенту - 5+\nШГ - не спрашивал\nЦВ - 800 грн\n\nПойду ли я еще? Да, обязательно.', 0, 1347015814, NULL, NULL, 144, NULL),
