(327, 'Zulus', 181, '194.126.180.121', NULL, 'Не помню где, но вычитал, что разы в неделю неэффективно подсчитывать, гораздо точнее будет подсчет, если считать, сколько вы занимаетесь сексом в часах в неделю или месяц.', 0, 1347024518, NULL, NULL, 38, NULL),
