(330, 'Ivan', 282, '194.126.180.121', NULL, '[quote=Kortes]Недавно думал над ситуацией: \nпредставил себе, что живу в другой стране, в маленьком городишке где русскоговорящих людей практически нет и как при этом найти девушку? если я из другой страны и не знаю языка. Что скажете? Как решить такую задачку?[/quote]\nОО. весьма сложная ситуация, разве что язык жестов использовать, или попросить ее прочитать в словаре: "Ты мне нравишься" ;)', 0, 1347024793, NULL, NULL, 97, NULL),
