(332, 'Zulus', 181, '194.126.180.121', NULL, 'Вот полюбуйтесь:\n[img]http://natashaescort.com/components/com_ankets/images/original/11339874764.jpeg[/img]\nЗначитсо, зазондировал свой шатл в эту красотку.\nУвидев фотку этих сисек ([url]http://natashaescort.com/karolina/393[/url]), решил опробовать сею красотку в верховой езде.\nБез проблем созвонились, уточнила, что именно я желаю с ней делать, так как у нее в арсенале есть и золотой дождь(выдача), и страпон, и ролевые игры.... но мне этого не нада, захотел обычного траха, ну как обычного, классического и качественного! Запрос был удовлетворен в полной мере :) Трахаетсо отменно и самоотверженно.\nВ общем, оценки:\nТТХ  - 5 (классные сиськи при стройненькой фигурке - очень люблю такие)\nКС  - 5\nМН  - 4\nОтношение к клиенту - 4+(сразу перешла к делу)\nШГ - 0\nЦВ – 1000 грн\nПойду ли я еще? Да. Отменный секс. Всем советую.', 0, 1347025576, NULL, NULL, 148, NULL),
(333, 'Zulus', 181, '194.126.180.121', NULL, 'Для тех кто хочет попердолить телочку с большими сисяндрами, советую шлюшку по имени\nМИЛАНА, 063-878-17-31\nЗацените, какую красоту я имел на прошлых выходных(причем имел в нескольких позах):\n[img]http://natashaescort.com/components/com_ankets/images/original/1glavnaya.jpg[/img]\nИтак, оставшись вечером наедине с самим собой, решил поискать развлечение...порыскав по сайту, решил, что лучшим вариантом, будет эта сисястая деваха: [url]http://natashaescort.com/milana/233[/url]\nСозвон, цена 400 грн за часик, фото говорит мои 100%. Еду!\nВстретила она, точно такая, как на фото, чем приятно удивила, приветливая с очаровательной улыбкой,сразу тапочки,чай и понеслась....\nМилана разделась, я заценил ее отменные сиськи и она приступила к делу, обрезинила ртом, минет - хороший. Секс тоже понравился.\nОценки:\nТТХ  - 5(сиськи, сиськи, сиськи - упругие и большие - просто класс!)\nКС  - 5\nМН  - 5\nОтношение к клиенту - 5\nШГ - 0\nЦВ – 500 грн\nПойду ли я еще? Канечна да!', 0, 1347026237, NULL, NULL, 149, NULL),
(334, 'Zalina', 167, '194.126.180.121', NULL, 'Мне нравится, я бы даже сказала, мне очень приятно, когда молодой человек кончает меня.', 0, 1347026501, NULL, NULL, 45, NULL),
(335, 'Zalina', 167, '194.126.180.121', NULL, 'А что касается полезности для кожи, вот что нарыла в нете:\n[quote]\nПо мнению польского врача-косметолога Збигнева Томашевского, лучшее средство для косметической маски — эякулят любимого мужчины.\n\nСперма содержит в себе 42 биологически активных вещества, придающих коже упругость, делающих ее гладкой, устраняющих излишнюю сухость или жирность. Чтобы наиболее полно использовать полезные свойства спермы, необходимо свежее семя нанести ровным слоем на кожу лица, через 35 мин смыть горячей водой без мыла. Повторять такую процедуру можно 2—3 раза в неделю. В качестве косметического средства семя можно использовать и для нанесения на кожу шеи, груди, а также на другие участки тела. \n[/quote]', 0, 1347026632, NULL, NULL, 45, NULL),
(337, 'lu4ano81', 284, '46.185.69.85', NULL, 'Не так давно отметился и я у этой Яны... \nИ поскольку фото настоящие, имеет смысл оставить для потомков\nВот только лицо серьезно отфотошоплено... в жизни значительно попроще\nЧто сказать камрадам - отношение вроде как получше стало чем на 3+. Улыбалась, хотела угодить, чай-кофе предлагала, на часы не смотрела и никуда не торопила\nНо все еще была такая же суетливая и дерганая... Хотя после ебли стала такая расслабленая, улыбчивая и поспокойнее...\nДеньги вперед не просила, но потом призналась что просто забыла...\nИТОГО :\n- внешность - 4\n- фигура - 4 (вроде на мой вкус, хуинькая-хуинькая... но какая-то нескладная)\n- грудь 1-1,5 - эрегирующая, связь с органами дыхания присутствует...\n- миня - так себе\n- трах - нормально, и сама кончила и обо мне не забывала, старалась\n- отношение к клиенту - есть\n- местоимения - см. выше... Кстати, этот дом чего-то так популярен у сутеров... Я знаю уже третью блядо-хату в этом же доме\n- БИ - х.з.\nРекомендована любителям хуиньких девушек, по нынешним временам как для 500 правильных денег - очень и очень... на Топе вон за 750-800 девки, от которых я разворачивался и уходил когда они еще 30 баксов просили...\n:0', 0, 1347040668, NULL, NULL, 135, NULL),
(338, 'Kortes', 163, '194.126.180.121', NULL, 'Привет,\nя Kortes, прошу меня звать-величать по нику, так как именно таким образом проходит общение на форумах.\nведу небольшой бизнес, а в свободное время ездим с друзьями на рыбалку и охоту, ну и ночных бабочек иногда любим половить :)', 0, 1347043911, NULL, NULL, 128, NULL),
(339, 'Kortes', 163, '194.126.180.121', NULL, 'Очень удобно на строгом чёрном фоне отыскивать себе спутницу на одну ночь по своему вкусу и предпочтениям. Спасибо модерам и админам ресурса ;)', 0, 1347044134, NULL, NULL, 101, NULL),
(340, 'Kortes', 163, '194.126.180.121', NULL, 'Так как фотки этой девчушки на сайте ([url]http://kharkov.natashaescort.com/ksiusha/622[/url]) сделаны только со спины:\n[img]http://natashaescort.com/components/com_ankets/images/original/11346938591.jpg[/img]\n\n, то чтоб узнать, она ли это, решил при встрече отодрать Ксюшку сзади :)\n\nНабираю номер, берет трубку, голос оч. приятный, договорились о встрече.\nВстретила очень миловидная симпатичная девочка. Пообщались и она приступила к делу, гондон надела ртом, довольно быстро и умело, поминетила минут 5 - понравилось, старательно работает ртом, не зря у нее такой голос приятный, видать любит "брать на гланды" :))))\nПерешли к класическому траху, я зашел ссади, спинка ровная, кожа приятная, как на фото, думаю это она, да и попец зачётный, так что от этих красот я отстрелялся минут за 10...\nЭх хорошо было...\nОценки, думаю, заслужено все 5ки:\nТТХ  - 5\nКС  - 5\nМН  - 5\nОтношение к клиенту - 5\nЦВ – 600 грн\nПойду ли я еще? Да, обязательно.', 0, 1347044369, NULL, NULL, 151, NULL),
(341, 'Kortes', 163, '194.126.180.121', NULL, '[quote=Zalina]Мне нравится, я бы даже сказала, мне очень приятно, когда молодой человек кончает меня.[/quote]\nДа... повезло твоему пареньку, можно себя не сдерживать, завидую ....', 0, 1347044454, NULL, NULL, 45, NULL),
(342, 'Kortes', 163, '194.126.180.121', NULL, 'Нет, я хоть и курящий, но после секса, как то хочется просто полежать с партнершей в тишине, а тянуться и дыметь в комнате и на кровати, как то для меня не катит...', 0, 1347044580, NULL, NULL, 140, NULL),
(343, 'Kortes', 163, '194.126.180.121', NULL, 'Чувак! Тебя прёт от насилия над твоими сосками О_о , да... узнаю тебя с новой стороны...', 0, 1347044649, NULL, NULL, 146, NULL),
(344, 'Kortes', 163, '194.126.180.121', NULL, 'Даже не был в Москве ни разу, да и не знаю пользовался бы я там шлюхами... не бось у них там цены космические...', 0, 1347044710, NULL, NULL, 36, NULL),
(345, 'Kortes', 163, '194.126.180.121', NULL, 'Дык попка это и так эрогенная зона, там же куча чувствительных клеток на сфинктере.', 0, 1347044822, NULL, NULL, 147, NULL),
(346, 'Kortes', 163, '194.126.180.121', NULL, '[img]http://natashaescort.com/components/com_ankets/images/original/11341230265.jpeg[/img]\n[url]http://kharkov.natashaescort.com/nika/474[/url]\n\nСкажу сразу, позвонив Нике на тел.: (066)9060330, можно получить норм. массаж, приличный минет в резине, ну и классика тоже не хромает, но все как то это без изюминки... да качественно, да правильно все технически, но без огонька чтоле. Поэтому ставлю 4ки:\nТТХ  - 4,5(фигура классная)\nКС  - 4\nМН  - 4\nОтношение к клиенту - 4\nЦВ – 600 грн\nПойду ли я еще? Нет, то ли я придирчивый стал, то ли девчонка технично все делает, но без огонька.', 0, 1347045164, NULL, NULL, 152, NULL),
(347, 'Kortes', 163, '194.126.180.121', NULL, 'Спасибо за отчет, узнал много нового про красоты Поднебесной страны.', 0, 1347045296, NULL, NULL, 150, NULL),
(348, 'Kortes', 163, '194.126.180.121', NULL, 'Ага хороший вариант, я ее в прошлом месяце заказывал, минетик у нее отменно получается, думаю это ее фишка, да и киска у нее ухоженная и тесная, приятно было.', 0, 1347045442, NULL, NULL, 108, NULL),
(349, 'Kortes', 163, '194.126.180.121', NULL, 'Заманила ее фотка на [url=http://kharkov.natashaescort.com/nastia/527]сайте[/url] в пене в душе\n[img]http://natashaescort.com/components/com_ankets/images/original/11341996954.jpeg[/img]\nтак и захотел там оказаться и драть ее до самого утра.\nТак и поступил, позвонил Насте на мобильный +380978393678.\nЗаказал ее на 2 часа. Приехала, поболтали, попили кофейку и Настёна взялась за мой стержень, хорошенько обминетила его, фиг сним, что в резине, все равно приятно было. Уболтал ее принять со мной ванну, все таки мысль потрахать сею попку покрытую пеной не уходила у меня из головы, побултыхались в ванной я хорошенько попердолил ее ссади и от перевозбуждения через 5 мин отстрелялся. Поплескались, душ... потом 2й заход уже был классический в комнате и на кровати, Настя кстати отлично делает тайский массаж, тут я уже дольше продержался где то через 20 мин. отменного траха отстрелял последнюю гильзу :)\nВ итоге ставлю такие оценки:\nТТХ  - 5(классные сиськи 4размера)\nКС  - 5\nМН  - 5+\nОтношение к клиенту - 5\nЦВ – 800 грн за час, за 2 часа 1600грн.\nПойду ли я еще? Да, мне все понравилось.', 0, 1347046121, 1347046136, 'Kortes', 153, NULL),
(350, 'Kortes', 163, '194.126.180.121', NULL, 'Дороговато как на меня, хотя если девчонка знает свое дело, то можно и роскошелится...', 0, 1347046266, NULL, NULL, 130, NULL),
(351, 'Kortes', 163, '194.126.180.121', NULL, 'Не больше 20 минут, ну бывают редкие моменты, когда в перемешку с перерывами на ласки могу продержаться 25 мин.', 0, 1347046405, NULL, NULL, 37, NULL),
(352, 'Kortes', 163, '194.126.180.121', NULL, 'Ну если брать время, как показатель частоты секса, то это уже получится показатель общей продолжительности, что как то не относится к сей теме, тут я хотел поговорить суто о частоте, а именно сколько раз в неделю хочется, а продолжительность это уже показатель выносливости отдельных организмов :)', 0, 1347046526, NULL, NULL, 38, NULL),
(353, 'Kortes', 163, '194.126.180.121', NULL, 'Кстати, хорошая идея, но если нет словаря под рукой, как все таки можно привести в свою постель иностраночку, не зная ее языка?', 0, 1347046599, NULL, NULL, 97, NULL),
(354, 'Kortes', 163, '194.126.180.121', NULL, 'Все зависит от предпочтений человека, кому то нравится, а кому то палец в попе и вовсе не нужен, я например и так много удовольствия испытываю', 0, 1347046695, NULL, NULL, 47, NULL),
(355, 'Kortes', 163, '194.126.180.121', NULL, 'Да, при таком качестве фото, мне бы было трудно разобрать, та ли эта девчушка, но если приедет блонда с такими сисяхами - я по любому буду рад :)', 0, 1347046797, NULL, NULL, 93, NULL),
(356, 'Kortes', 163, '194.126.180.121', NULL, 'Тело на фотке довольно аппетитное, да и цена приемлемая. Спасибо за отчет ;)', 0, 1347046902, NULL, NULL, 103, NULL),
(357, 'Kortes', 163, '194.126.180.121', NULL, '[quote=sig]Ну чувак.... от тебя я точно не ожидал такого вопроса... думал ты уже поднатаскался в подобных вопросах...[/quote]\nЯ то поднатаскался, но все же интересует мнение девушек, да и опытом с другими мастерами этого дела обменяться, думаю, будет не лишним', 0, 1347046972, NULL, NULL, 133, NULL),
(358, 'vessemacina', 182, '194.126.180.121', NULL, 'Ну понятно, что ребятишки смущаются признаться в желании получить анальную стимуляцию, чтоб их не дай бог не приписали к педикам', 0, 1347049228, NULL, NULL, 47, NULL),
(359, 'vessemacina', 182, '194.126.180.121', NULL, 'привет, \nменя зовут Лариса,\nДва года назад стала владельцем салона-парикмахерской, этим и зарабатываю на жизнь по сей день.\nУвлекаюсь новыми дизайнерскими стрижками, макроме, люблю читать детективы и любовные романы.\nК проституткам/тутам :) не обращалась и думаю, что не понадобится.', 0, 1347049428, NULL, NULL, 128, NULL),
(360, 'vessemacina', 182, '194.126.180.121', NULL, 'Интересно, как в порнофильмах не побоюсь этого слова "герои" могут продержаться минут эдак 40???\nТакое в реале вообще возможно?', 0, 1347049634, NULL, NULL, 37, NULL),
(361, 'SantyaGo', 174, '194.126.180.121', NULL, '[quote=vessemacina]Интересно, как в порнофильмах не побоюсь этого слова "герои" могут продержаться минут эдак 40???\nТакое в реале вообще возможно?[/quote]\nНе забывайте про такое явление, как монтаж, а он я думаю в порнухе, по полной используется. Одну сцену в норм. фильмах могут и несколько дней снимать.', 0, 1347049771, NULL, NULL, 37, NULL),
(362, 'dennton', 164, '194.126.180.121', NULL, 'Не обязательно монтаж, весь секрет может быть в инъекциях, которые по слухам порноактеры делают прямо в член, и он приходит в состояние эрекции, даже без предпосылок к этому и может стоять часами, для качества съемки(чтоб много кадров наснемать можно было)', 0, 1347049928, NULL, NULL, 37, NULL),
(363, 'vessemacina', 182, '194.126.180.121', NULL, 'Ого, это же наверное вредно?', 0, 1347049973, NULL, NULL, 37, NULL),
(364, 'dennton', 164, '194.126.180.121', NULL, 'Ну, чего не сделаешь ради искусства....', 0, 1347050063, NULL, NULL, 37, NULL),
(365, 'vessemacina', 182, '194.126.180.121', NULL, 'Думаю вам нужно смотреть по ситуации и по поведению партнерши! Ее тело думаю само подскажет как нужно поступить.', 0, 1347050330, NULL, NULL, 133, NULL),
(366, 'vessemacina', 182, '194.126.180.121', NULL, 'Да, продолжительность это уже совсем другая тема, давайте тут лучше о количестве секса на душу населения в неделю поговорим ;)', 0, 1347050481, NULL, NULL, 38, NULL);
INSERT INTO `newforumposts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`, `forum_news`) VALUES
(367, 'vessemacina', 182, '194.126.180.121', NULL, 'А мне нравится, когда муж кончает прямо в меня! Это еще больше возбуждает, прямо-таки не знаю почему! Также приятно когда на грудь или на животик...', 0, 1347050541, NULL, NULL, 45, NULL),
(368, 'vessemacina', 182, '194.126.180.121', NULL, 'Мы вообще не курящие, сразу после секса лежим и наслаждаемся действительностью :)', 0, 1347050642, NULL, NULL, 140, NULL),
(369, 'Zalina', 167, '194.126.180.121', NULL, 'ИМХО, не нужно покупать какие-то навороченные и дорогие шарики, я себе всего за 120 рублей купила в секс-шопе, дизайн и цвет роли не играют, думаю это и так ясно.', 0, 1347088148, NULL, NULL, 28, NULL),
(370, 'dennton', 164, '194.126.180.121', NULL, 'Да нам как то цвет действительно по фигу, главное, чтоб проблему решить, и чтоб в кратчайшие строки желательно', 0, 1347088214, NULL, NULL, 28, NULL),
(371, 'Zalina', 167, '194.126.180.121', NULL, 'Да не волнуйтесь, не такая это уже и проблема, еще хочу добавить, что лучше сначала купите 2,5-3 см. в диаметре это средний размер, а то маленькие будут выпадать и "теряться", такие маленькие шарики уже для профи :)', 0, 1347088327, NULL, NULL, 28, NULL),
(372, 'Zalina', 167, '194.126.180.121', NULL, '[quote=dennton]Да нам как то цвет действительно по фигу, главное, чтоб проблему решить, и чтоб в кратчайшие строки желательно[/quote]\nНа счет сроков не знаю, это уже зависит от вашей партнерши, если в прошлом она не занималась никакими спец. тренировками, то вряд ли эффект будет быстрым, но и спешка здесь неуместна.', 0, 1347088470, NULL, NULL, 28, NULL),
(373, 'vessemacina', 182, '194.126.180.121', NULL, 'Ненатренированность может стать препятствием, ведь свое тело нужно развивать, я вот про упражнения Кегеля еще в 17 лет узнала. Тренировалась периодически. А потом шарики помогли мне почувствовать, как именно нужно работать мышцами', 0, 1347088701, NULL, NULL, 28, NULL),
(374, 'Zalina', 167, '194.126.180.121', NULL, 'Кстати мышцами влагалища можно работать даже во время секса, это дает дополнительную тренировку.', 0, 1347088769, NULL, NULL, 28, NULL),
(375, 'Zalina', 167, '194.126.180.121', NULL, '[quote=vessemacina]Ну понятно, что ребятишки смущаются признаться в желании получить анальную стимуляцию, чтоб их не дай бог не приписали к педикам[/quote]\nЯ тоже начинаю склонятся к такому мнению, парням наверное просто трудно признаться о своих желаниях, но это тоже для меня полезная инфа, значит желание все таки имеется )))', 0, 1347089375, NULL, NULL, 47, NULL),
(376, 'Zalina', 167, '194.126.180.121', NULL, '[quote=Kortes]Знаю, что пальцем в попе можно как то стимулировать эрекцию, но я на это пока не готов пойти[/quote]\nТоже где то про эрекцию слышала, думаю стоит попробовать, или хотя бы почитать литературку на эту тему', 0, 1347089439, NULL, NULL, 47, NULL),
(377, 'sig', 169, '194.126.180.121', NULL, 'Заметил внизу форума теги появились, так еще удобнее в нужную тему попадать.', 0, 1347089642, NULL, NULL, 25, NULL),
(378, 'sig', 169, '194.126.180.121', NULL, 'Увидев фотку на: [url]http://natashaescort.com/larisa-delaiu-vse/394[/url]\n[img]http://natashaescort.com/components/com_ankets/images/original/11340049007.jpg[/img]\nподумал, что фото не ее, или с фотошопом кто то постарался. Ну не может так выглядеть девушка в 32 года. Решил удостовериться. Созвонились(+380967269595), голос приятный, договорились о встрече, открывает двери, действительно Лариса, перекинулись парочкой слов и Ларка взялась за дело, по законам жанра минет в резине, потом пошла классика, тело действительно ухоженное, я бы даже сказал "пышные формы" приятная кожа... через 15мин отстрелялся.\nВот отчет:\nТТХ  - 5+(для ее возраста выглядеть на 25 - это просто искусство)\nКС  - 5\nМН  - 5\nОтношение к клиенту - 5\nШГ - 0\nЦВ – 800 грн\nПойду ли я еще? Да, именно ради качественного классического секса.', 0, 1347090300, 1347090326, 'sig', 154, NULL),
(379, 'sig', 169, '194.126.180.121', NULL, 'С таким то телом:\n[img]http://natashaescort.com/components/com_ankets/images/original/1p796192.jpg[/img]\n можно в фотомодели идти, а не ночной бабочкой работать... хотя что я такое несу, хорошо, что можно [url=http://natashaescort.com/lilia/243]здесь[/url] найти эту фею, и здорово, что всего за 500грн, можно потрахаться с такой красотулей...очень красивая девчушка, личико мне очень понравилось, до сих пор перед глазами картина, как эта милашка у меня сосет...\nДолжен сказать, что Лиля(0635780234) и в классике тоже довольно страрательна. Так что советую всем. \nМне очень понравилось, обязательно еще пойду, ставлю 5+ за минет и КС.', 0, 1347090801, 1347090840, 'sig', 155, NULL),
(380, 'sig', 169, '194.126.180.121', NULL, 'Для всех любителей тел предбальзаковского возраста, могу посоветовать такой вариант:\n[url]http://natashaescort.com/valentinka/484[/url]\n[img]http://natashaescort.com/components/com_ankets/images/original/11341238057.jpeg[/img], тетка отлично держится, сисьги упругие и жопа тоже норм.\nЗовут Валентинка, тел: +380983096915, ей 35лет, мне сделала минет в гондоне, и классика. Попердолил ее раком таки прилично, так как продержался целых 22 минуты!!!\nИтак:\nТТХ  - 4(возраст как ни как)\nКС  - 5\nМН  - 4\nОтношение к клиенту - 5(приветливая)\nЦВ – 300 грн\nПойду ли я еще? Думаю, что да, хороший бюджетный вариант', 0, 1347091247, NULL, NULL, 156, NULL),
