(407, 'dennton', 164, '194.126.180.121', NULL, 'Виолета. Выцеплена была на наташаэскорте: [url]http://odessa.natashaescort.com/violeta/547[/url] \nЗацените, какой ципе я воткнул:\n[img]http://natashaescort.com/components/com_ankets/images/original/11344335802.jpeg[/img]\nСозвонился(оставляю номерок: +3806729635340)....девочка на хате ждала именно, в сексапильном халатике.....\nПо факту, девочка очень хороша. \nСиськи - просто отпад, божественные холмики - одним словом))). Инициативная, с самоотдачей, за что + к оценкам, я не на шутку завелся от минета(хоть и через презик), и перешел к делу... поипал ее минут с 14-15 и кончил...\nОценки:\nТТХ 5\nМН 5\nКС 5\nШГ хз\nЦВ 800грн. (она того стоит на все 100%)\nСоветую всем.', 0, 1347102487, NULL, NULL, 158, NULL),
(408, 'rafinad', 285, '46.185.69.85', NULL, 'Маи впичатленийа:\nБыл поставлен в очередь (перезваните через 40 минут, потом исчо через 15). Наконец добрался...\nБыла выйебана тока адин раз. Второй раз ипал-ипал, но так и не кончил, видно устал от предыдущих возлияний и нервных переживаний от столь позднего накаута, в который фсе же послал некоего афраамериканца наша спортывна надийа "Володя Кличко"\nЯна:\nТТХ: 4.  Попка имееца, а вот с сисьгами напряг, йединичка ни более, плюс йесть какийета родинги на теле, как на мой фкус нимнога худавата\nМН: Акрестнасти: 5 (нежна и прикольна), йа эта дела палюбляйу. Сасанийе: 3, паддрачивала рукойю, ничего асобенаго. Средний бал: 4\nКС: 4. Делала вид (или вправду такойе было), што, тащицца. Раком упиралась так страстно ручками в диван... Сверху тоже ниплоха. Лезла цилавацца даже, и ваще в сехсе ласкавайа дефачка\nШГ: ниспрашивал\nЦВ: 500 гривен\nАтнашенийе: как по мне 5-. Адназначна имееца. Не грузит, не глупайа (но йи не будущий нобелефский лауериат). У миня вызвала некатаруйу симпатию. Минус так на фсяк выпадок\nАриентацийа: хз (йоманафрот, апять забыл спрасить)\nХата: три комнаты. В хате была исчо адна дефачка, а потом и мамка ихняя причалапала. В комнате в каторай йа с ней йопся, диван риально ацтойный, весь кайф прападайет, скрипит, и пачти нах разваливаицц0 такойе фпичатленийе. Ваапще было жарко шопесец...Вана нормуль на 4 с минусам, есть чем намылицца палатенце чистайе удовлетварительных размероф\nРазнойе: Учицца в харькове, и туда вроде как скоро поедет опять В киеве "на каникулах". Скорее всего ипацца за деньги будет и там (уже ипалась до того как приехала в Киев). Про мужа нихера не грила. Грила, был парень, но сплыл. Хотя а нам то какайа разницца...\nПослефкусийе:  испорчено недойбом (майа вина),  а так ниччо...Мож даже зайду исчо, если карта ляжет, ехать нидалеко, да и пристрелить надо бы фсе же еще разок другой....', 0, 1347385190, NULL, NULL, 135, NULL),
(409, 'Andy Garcia', 261, '46.185.69.85', NULL, 'карочи Яны уже там немайе. Но предлажили некую Алину. Сказали по формату Яна, тока рыженькая, но вот в общении намного превасходит. И всего с позавчера работает. В общем решил рискнуть, риск благородное дело, етить...Забегая напиред, формат и впрямь как у Яны. Мож они сестры какие? и по траху тоже похоже.\nИтак в установленое время примчался на хату. Встретило вот это тело (сходство 90%, так как на фотке вроде как парик на себя натянула. В реале аолосы рыжые (на фотке красные какие то) и покороче, но все равно нужно при минете держать рукой, чтоб не мешали)\n[img=PunBB bbcode test]http://ib1.keep4u.ru/b/080815/7e/7e786de1e61b0cf7ce.jpg[/img]\nПолотенце маленькое, как кухонное какое то. Карочи минус. Еблись теперь в другой комнате (направо). там траходром вроде получше аказалси, чем в комнате "неалево".\nИтак присев на кровать грит: раздивай миня (была в каком то платье-топике и трусикаг). Аднако аригинальна, я аж неожыдал такого поворота...\nСиськи хуевые у нее конечно. 1-го размера и висячие, шо писдец. Када накланилась минетить, висят бля как у валчицы каторая приняла участие в организации славного города Рима. В обшем вид не ахти...Но процесу деваха отдается полностью. При минете подсовывет письку, чтоб потеребил. Мокреет сама. тока грит пальцы совать низзя, бо ей это не по кайфу и може засохнуть. Минет в принципе никакой на твердое "три" (много шума, слюней, дерганий, а вот ощущений как то ноль) Обцыловывает нежно, окрестности старательно обрабатывает При смене поз тоже поминетила, неплохо!\nПрикол еше: В начале каже давай поиграем "какого цвета гандон". Ну я деньги люблю "грю зеленага". Ан нет Красный. Тут я про вражый Спортаг" вспомнил (как раз перед игрой дело было). НЕ к добру думаю такой цвет на писюн надевать...А шо делать...Но ссука самое прикольное, что на второй заход гандон уже синего цвета был. Динамовский нах! Но если честно мне такая мозаика не до вподобы. то синий хуй, то красный...\nКароче при всем процесе ебли теребила себе клитор и просила меня продержатся подольше (с первого раза у мна не вышло конечно, а на второй вроде даже довольной осталась). Когда ебал сидя (она лежа) прикольный видон когда она письку себе теребит. Потыкал еще ее хуем врот када она на спине лежала. Два раза кончил когда был сзади (тоже прикольно за яйки прихватывала теребя себя). Когда Она сверху была: как то аккуратно,без драйва что ли. Но лезла целоваться и пальцы лабызала. Да писька туговатенькая.\nОтношение очень гут: напоила соком халодным чаем, следит чтоб клиент не парился (салфетки, сама все вытирает, убирает). не даже показалось как то много внимания. На второй заход полезла самаВ общении тоже нормуль. Не грузит. Да, сама кстати из Харькова, учится дето на заочном, вроде как замужем (про мужа чего то упоминала, да и кольцо на нужном пальце имееца, но мне эти разговоры похер). Прям какой то праст-филиал какого то Харьковского ВУЗа\nОценки:\nТТХ: 4 -  стройная фигурка, попка тоже есть. Кароче фигура мне очень понравилась, лицо так себе, а вот сиськи атстой\nМН: 3+ (плюс за окрестности)\nКС: 3+: ничего особенного, но в процесе ведет себя натурально вроде как. За это и плюс\nОтношение: твердое 5 с плюсом\nШГ: не интересовался\nЦВ: 500 гривен\nВряд ли рекомендована. Для тех же кто отважится, торопитесь, а то она в киеве наездами, может и свалить на сесию какуюто', 0, 1347385551, NULL, NULL, 135, NULL),
(410, 'rafinad', 285, '46.185.69.85', NULL, 'Я приветствую всех.Случайно наткнулся на этот форум.И захотелось поделиться своими недавними приключениями в Тайланде.Я уже на одном форуме какомто про это пробовал написать,но там люди оказались немного слабоумоёбнутые и не поняли ничего,а мне хочется ,поведать о своих недавних удалых приключениях,и вот решил ,с вами поделиться,думаю тут меня поймут)))\n   Итак....Я пару недель назад был в Бангкоке и Паттае,был там один и в первый раз,просто недавно с женой разошолся и решил отдохнуть и отдых скажу вам получился пиздец какой.Я не был на экскурсиях ваще,но зато переебал там всё что передвигается и даже сам охуел от себя.Я там начал немного превращаться в ебанутого,от этого всего,что было ,и до сих пор немогу отойти.\nКароче ,я заказал билет и гостиницу в Бангкоке 2 дня и в Паттае 10 и уебал туда один на ебаном самолёте с разными долбоёбами на борту.Туда летели всякие разные дуримары,некоторые мирно спали со своими пиздами под мышку,некоторые нажрались и устроили там пляску около сартира с бутылками и песнями.Я молча наблюдал.Потом сам наебенился и тоже заплясал с ними и поебать.Кароче прилетаем в Бангкок ,у всех рожи опухшие и в дверь непролазят,но мы выбрались.Потом бесконечная вереница и покланение и приседание и хуемахание и вот я на улице,я отправился в гостиницу на такси с группой эстонцев,те все были со своими самоварами и им же хуже в дальнейшем от этого)))', 0, 1347385725, NULL, NULL, 159, NULL),
(411, 'rafinad', 285, '46.185.69.85', NULL, 'Я незнаю почему сообщение немогу больше написать,но ладно...кароче....как только я прибыл в гостиницу,мне предложили двинуть на экскурсию с этими эстонцами,я канешно согласился и сразу съебался в город один.Там я сразу заблудился,и попал в сраные Бангкоковские районы,где ползают облезлые собаки и нищие туземцы и маленькие воришки и т.д. Я сразу послал их на хуй, ёбнул литр пива и мне стало спокойней и веселее.Там я блудил долго,потом както выбрался.зашол в какойто ебаный жральник.Там сидели одни узкоглазые мужики рабочие,но я устал и хотел ещё пива и отдохнуть.Ко мне прилип ,хозяин этого срача и типо мы друзья и всё заебись,кароче я с ним попиздел он меня подвёз на машине ,поближе к более приличным улицам.Я его послал на хуй,он меня поблагодарил за это.И вот я иду дальше.я уже кривее стал.Потом ещё выпил...потом провал памяти и я уже еду на мопедной рикше(в Бангкоке они с крышами,а в Паттае ,просто мопеды без нихуя).Я вдруг врубился,память врубилась.Думаю,что за хуета?Проверил сразу деньги-на месте .значит похуй,едем!я ору этому лакею,ты бля сука меня куда везёшь?Он мне буб-буб ок и типо заебись....я ему объясняю на полу англизких пальцах,что я дринькнуть хочу и что он долбоёб ёбаный и что надо мне дринька побыстрее.Тогда он остановился я ему денег дал он мне дриньку принёс.еду дринькаю бля...Заезжаем в одну ебалкину контору,там с меня содрали за пиво и показали баб штук 10.цена 5000 батов на ночь,я послал их.сказал я сам себе подрочу и собрался уходить.мопедист-лакей меня успокоил и сказал я тебя сейчас отвезу в другое место,сколько дашь?я говарю мне на час не надо,я уже упитый,ночью буду ебать за 2000 у себя в отеле.Ок!едем.Заезжаем в какието ворота ,с правого борту бандит,слевого-бандит,думаю пиздец мне,дринькнул перекрестился в уме и поебать думаю.хотябы обоссу кого нибудь перед смертью...Заходим в большой зал ,впереди стойка там баба явно не блядь наливает,сидит рядом видимо рыло поглавнее.Дёрнули занавеску,а там визг,баб 30 все руки ко мне тянут,визг и плач и у меня глаза округлились.Красивые суки.Бандюган меня позвал.Я с ним дринькнул вина,естественно за мой счёт)))Я сказал 2000 ночь и хуй больше недам.Он оказался редкостным уёбком и начал на моего лакея наезжать.Тогда я опьяненно быканул бля,пнул бутылку пива и сказал ему ,моего лакея не обижать.У когото в это время рука потянулась за револьвером.Тогда я быстро сказал ок и пошол к блядям,ткнул на одну пальцем,другие разозлились на неё сразу,я им язык показал,она схватила сумку свою и ко мне,я схватил лакея ,сунул бандюге 2000 и за вино и пиво 300 батов помахал рукой и быстро с вещами на выход.Лакею дал пинок под зад ,чтоб шевелился и мы быстро съебали.Тинг-тонг-сумащедший,я понял.Кстати никакой не "фаранг",а "фаланг"-они так говарят все,именно "фаланг",я вроде не глухой.продолжение чуть позже...', 0, 1347385800, NULL, NULL, 159, NULL),
(412, 'rafinad', 285, '46.185.69.85', NULL, 'Итак...едем на ебаной мопедной рикше....Я ему говарю,прокати меня по вашему ебаному Бангкоку вместе с этой мочалкой,но сначала в магазин,заезжаем в магазин,я кривой бля ,купил каккието 5ти градусные напитки и вино и цветок для бляди,дал ей сказал в жопу себе сунь.Она улыбнулась и покланилась я понял что она сука ещё та....мчимся с этим гонщиком по улицам,я ахуеваю и смотрю всё кругом ,дринькаю и тоже прищурился как и они суки,спросил у тела женского рода -"ну как?Похож на вас?"Она мне "дарлинг хуярнинг и т.д.",короче я понял,что непохож....бля и хорошо...её звали толи Айе ,толи Нана,уже непомню...Прихуярили в отель...Лакею дал пива и 100 бат и послал,он съебал без разговоров,потому,что видимо я его уже доканал за поездку и он ахуел сам уже...на проходной все улыбаются и тоже бабла запросили суки,ну я уже устал и заплатил.У бабы забрали документ до утра.\nПоднялись на верх.Заходим.Она умылась и я.включили телевизор я задремал на часок она меня нежно массажировала и чтото пищала на ухо,я набрался сил.Начала дрочить.Хуй разпух не по децки.она ахуела и немного испугалась.Потом надела гандон,у меня были слава Богу свои взяты(потом о местных гандонах отдельно)сосала нормально в горло и пыталась чтоб я кончил,лишь бы не в пизду сувал,но я её за пиздень ухватил...Она была мокрая,и всё равно она её ещё пиздомазью мазанула и в путь.Перевернул на спину и на половину сунул и по тихоньку пизда начала привыкать,хоть и корчилась она но я её выебал и раком застрелил.Дринькнули с ней я её попосылал на хуй,заставлял кричать по русски разные приколы и ржал,особенно весело когда она хай гитлер орала и визжала как дура.Мы поспали немного и утром я её ещё выеб и прогулялся с ней за сигаретами и она съебалась за гаризонтом...\nя двинулся дальше,обедал пил жрал какуюто хуйню,катался на мопеде..к вечеру зарулил в гого бар...\nтам плясуньи плясали и все мне улыбались и я им...Сначала одна ко мне подсела я с ней пиздел,она просила кактель,я внимательно на неё посматрел и послал на хуй,она обратно на танцевальный стол,другая сразу со стола танцует и мне пальцами показывает типо ,ну как?Ты типо бум-бум с этой?нравится7я показываю ,мол нихуя.тогда она ещё быстрее завертелась.и пизду мне показывает и улыбается,я улыбнулся,смотрю на другую,эта уже злится вижу и ревнует блядина!я ахуеваю!Они бляди ещё и ревнуют!И такое было постоянно там,особенно когда на ночь брал!))\nКороче я взял и не ту и не эту и не следующую,разозлил всех и взял ваще ту которая неожидала,потому что я на неё типо не смотрел)))Но я то не пёс,я всех вижу и даже затылком.Заплатил мамаше и меня проводили в комнату для фалангов ебучих.Там кроватка видимо недавно ёбаная и мне неочень понравился запах.эта сосала хуже,но тоже ничего.Мне лень было с ней проявлять эксперименты в этом сраче и я её перевернул и пристрелил за 40 минут уложился ,она просила денег ещё и просилась ко мне,я сунул руку в её мокрую пиздень ,сделал фигу и дал ей понюхать,она понюхала и неулыбалась больше.я умчался от туда...', 0, 1347385884, NULL, NULL, 159, NULL),
(413, 'rafinad', 285, '46.185.69.85', NULL, 'Через некоторое время я зарулил ещё в один го го ,там всё тоже самое,правда меня просили постоянно пиво брать,пару блядям текилу купил.долго там сидел в полу сонном состоянии наблюдал и дремал.потом всё таки одну взял и выеб в ебалкиной комнате,там была кроватка получше и я там немного подремал с ней.потом быстро ломанулся в отель,там завтрак и собираемся в Паттаю.\n   ехали с этими  эстонцами и их самоварами на микроавтобусе,они тоже ехали в тот же отель что и я.Они меня спросили почему,такой мятый?почему  на экскурсии неходишь,где был?Я объяснил ,что я хожу на экскурсии ,правда я просто от своей экскурсионной чехарды немного устал..\nприехали в отель на Джомтиене,отель засранее ,чем в бангкоке,но у меня сингл и мне насрать,главное кровать есть и душ и ванна и сральник.Правда кровати две и я их сдвинул сразу,чтоб на пол ненасрать случайно,а в простынку завернуть и интелигентно оставить.\nВышел на улицу...Бля сплошной русский мат!я думал я в России.Мопедов с крышей я больше невидел,но зато появились тук-туки в которые ,сразу залезает по 10-15 лешаковых пассажиров и за 20 батов он ебошит в центр,днём то нормально,за 10 минут и 20 батов,а вечером ,только на мопеде и за 50-100 обратно .я мопед нестал брать на прокат,побоялся ,что убъюсь пьяный или разобью его,а нах платить за хуйню потом?\n  Рассказывать,про то как я на море ходил с блядьми и как меня на рынке наебали бухого и как в магазине и какие там пиздаболы черножопые со своими ебаными "привет дружище.а не сшить ли тебе костюм"",я думаю все знают и это очень долго рассказывать.итак теперь я начал встречать на улице -жопошников,переодетых в баб.Днём их сразу видно там незнаю как надо ужраться.чтобы не понять ,что перед тобой -жопошник ебаный.Но я всётаки лоханулся однажды и очень круто,об этом потом.\nиду по волкин стрит днём,видно рожи у баб хуже чем в бангкоке но всётаки есть нормальные.Забрёл на набережную выпил ,пожрал дерьмеца ихнего  и посрал сразу в баре.(я там срал сразу,как только пожру,через 5 минут) \nиду вдоль моря,сразу подбегает жопошник,видно зашпаклёваный сука пидарюга на славу.Он мне говарит.Типо я с тобой хочу.я ему-ты типа леди бой.Он утверждает .что он баба и бъёт себя в грудь.я его тогда за подбородок взял и говарю,ты бы пидарюга побрился сначала,у тебя борода торчит пиздун ебаный,я тебе щас нос растопчу.фак ю.Он сука прихуел и говарит,ок.ок ай эм леди бой,отбежал подальше и мне фак показал,ну я нестал с ним спорить и дальше пошол.Гандон,хоть и симпатичный,но явно хуй есть и голосок несовсем писклявый.\nиду по улице.все орут "массаж","хуяж".Хуй с вами.думаю,давай свой ебаный массаж 250 батов вроде.Меня заводят в холодильник,там такой дубак.пиздец,и вентиляторы хуярят ещё.Я замёрз.Лёг она меня ещё маслом начала тереть.Потом говарит снимай трусы ато запачкаю маслом типо.ну хуй с тобой снял,она всё к хую ближе гладит.потом перевернулся на спину у неё натурально слюни потекли,(баба не особо красивая,но нормальная свиду лет 27)\nНачинает хуй гладить и к нему всё ближе и ближе,то лизнёт,то дрочнёт...он уже встал.Что делать?Она говарит мол "ай вон" и показывает на свой рот ,им очень нравятся белые хуи .это я понял и тем более те на которые местные гандоны,даже на залупу ненатянуть,они прямо балдеют когда сосут.сосала без гандона и очень хорошо,сосала и причмокивала,нюхала и балдела реально,я пристрелил,несмог терпеть.прямо в рот.Она просилась ,со мной за 500 батов на день,но я заплатил ей 300 и послал на хуй и в кассе 250 вроде ещё  и упиздил от туда.Думаю ещё не вечер,я лучше найду....', 0, 1347385964, NULL, NULL, 159, NULL);
INSERT INTO `newforumposts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`, `forum_news`) VALUES
(414, 'rafinad', 285, '46.185.69.85', NULL, 'Итак..ещё немного напишу ,потом надо по делам,но вечером продолжу рассказ....\n   Ну так вот....Меня зовут вообщето Влад,но узкоглазые просто немогут никак выговорить "влад" они говорят "влас" или "власт".меня заебало с ними спорить.Кароче так я превратился во Власа ,да и похуй.)))\nв паттайе скажу коротко в гого барах трахал постоянно по одной две,и всё там практически одно и тоже,сидишь пиво пьёшь потом одну выбираешь и она у тебя на коленях голая сидит и ты ей напиток покупаешь дёргаешь за сиськи за жопу пизду.что хочешь и потом ебёшь в комнате.\nСамые красивые гого я брал прямо с пиздо шоу на ночь за 2500,но это стоило того.\nЯ попал на шоу пизды случайно.я шол по улице и ко мне подошол узкоглазый пиздо проводник и сказал по русски,что его зовут Денис и что он может мне предложить посмотреть шоу пизды за 500 батов.я ему сказал 300 ,он поломался.но согласился и вот я иду на шоу с Денисом сраным,который ваще больше нихуя по русски сказать неможет за 300 батов.Заходим в помещение,там охуительные просто красивые бабы пляшут под музыку в юбочках и лифчиках.Я спросил это чтоли шоу?он говорит .шоу будет через пол часа.иди пива попей.Одна ...очень охуительная.сразу заметила.что я один без экскурсий(туда обычно экскурсиями водят и по 550 батов с рыла,а я за 300 прошол) и она сразу прыг ко мне под бочок,она заметила что я поплыл по ней глазами как сопляк и она была довольна.Потом подтянулись ещё группы долбоёбов экскурсионные со своими бабами под ручку и они все на меня глазели как я сижу и уже две красавицы меня гладят и я курю и пиво пью.а бабы с этой экскурсии ваще там сидели злые и на меня всё пялились а не на гого пляшущих девок.но вот девки убрались и шоу начинается....продолжение следует.', 0, 1347386024, NULL, NULL, 159, NULL),
(415, 'rafinad', 285, '46.185.69.85', NULL, 'Выходит баба голая одна из тех которые в юбочках плясали и самая некрасивая,которая ваще мне непонравилась,она в основном всё и делала пиздой.В это время я обнимался с другой сучкой красивой и она явно хотела чтоб я её взял(она тоже плясала на сцене и была самая красивая и её тело гнулось как пиздец што,так и хочется схватить и сунуть)Вторая которая со мной сидела поняла,что ей несветит ничего,потому что, у неё зубы были захуярены  рисунками или хуй знает как это называется хуета,незнаю.Она разделась догола и пошла пизду свою показывать под музыку на соседней сцене,отличная фигура и лицо,но зубы с хуйнёй,нелюблю.\nЯ сижу курю и пью пиво ,сучка мне шею мнёт.на сцене из пизды вылезают шарики,тряпки и т.д,пизда плюётся и курит,но не говарит ,вот еслиб заговорила я бы ебанулся бы об стену жопой с разбегу наверно и рожей потом.\nПринесли всем шарики надувные ,дали в руку и чудеса ебаные она пиздой стреляет точно и у всех шарики лопаются,подошла очередь стрелять в мой шарик,чудеса начали давать осечку,видимо ей мешало то что я с её напарницей уже почти спарился и шарик мы с ней уже в двоём держимровно и ближе,но пизда промахнулась раз и мимо!я уже ржу,два!и мимо!моя массажистка уже меня негладит и мою руку ближе к стрелялкиной двигает пизде,а стрелялкина -три! и мимо!и потом уже шарик ещё ближе двинул и наконец.чудо!попала.просто видимо она когда плясала ещё в юбочке,она хотела чтоб я её снял,вот и пизда у неё заклинила в мою сторону.самое интересное,что после меня она ещё стрельнула в 5 шариков и все с первого раза лопнули.вот такие чудеса,но если пизда неравнодушна к мужику,то она просто пизда,а не пулемёт.просто мокрая пизда и всё.)))я ей 100 батов дал.\nБольше ничего интересного особо я там невидел.потом шоу кончилось.и мамаша прибежала говорит хочешь эту девку С которой сидишь? я -хочу!Девка говорит за 2000 батов пойду на ночь с тобой  и мамаше 500.я говарю хорошо.Но у меня небыло с собой столько бабла, были бабки в отеле,а мамаша сказала,что эту девку,только сразу деньги все.и в этот день я её несмог взять.я её поймал через день,она мне телефон дала.\nЯ уныло вышел ,в сумке у меня было бухло и в кармане 1500 батов.ебаный лакей на мопеде тут как тут.хочешь девку?\nя ему давай за 1100,пиздёшь поднялся и мы решили за 1300 на ночь.я говарю пойду тут рядом в баре посижу.там меня развело и я ещё выпил и через 10 минут он уже с бабой приехал.Причом отличной.хотя та лучше была из шоу,ну хуй с ней.впереди садится лакей ,заним я и сзади почти весит шлюха,мы втроём мчимся в темноте,по ебаной патае на мопеде.этот сука оказался укуренным гандоном.он разогнался как сукин клещ,я бухой в одну сторону поклонился ,шлюха в другую и наша ебаная карусель чуть не убилась на повороте на хуй.сука мчался как выебаный по кочкам.У них смертная казнь вроде за наркоту.А он сказал я курю каждый день марихуану и мне поебать.Я сказал,что мне тоже поебать тогда и закрыл глаза ваще нахуй бухие свои.Мы примчались я расплатился за карусель и за шлюху и он умчался в ночь курить свою поебень дальше.я взял бабу и пошол с ней в отель.', 0, 1347386098, NULL, NULL, 159, NULL),
(416, 'rafinad', 285, '46.185.69.85', NULL, 'Мне никуда ненадо сегодня,спокойно пью пиво и рассказываю миру о том что происходило неделю назад в Тайланде.Я думаю вам интересно будет знать пизда по тайски-"тим",хуй-"куай",похоже не правда ли?)))Хуй он во всех языках с буквой "у" наверно))) КатЫй(не катой ,не путать)-пидарас,жопошник,транс и т.д. Пом рак гун-я тебя люблю и т.д. Я жил там с этими блядьми и коечто запомнил.А ещё в шоу мне понравилось как она в пизду открывашку вставила и бутылку открыла пиздой,я пробовал пробку рукой хуй откроешь.А о том как я транса ебал я расскажу потом.У меня был ваще .ебучий случай,это существо было полностью бабой,даже пизда была .как у бабы.но я его раскусил ночью.об этом потом.', 0, 1347386192, NULL, NULL, 159, NULL),
(417, 'rafinad', 285, '46.185.69.85', NULL, 'Итак я двинулся с сукой в сторону отеля,я взял ей лёгких напитков алкагольных и мы около бассеина с ней беседовали на полу англизком,полу первобытном.Девка попалась на радость весёлая и симпатичная,мне с ней было легко,ей было 19 лет,представилась как Катталия,ну это не важно.Мы сней долго сидели и просто ржали над ебаными разными словами.Потом пришли в отель,фигура у неё ахуеть,но пизда опять маленькая ,надо тянуть нежно,она сказала,что ебётся только с белыми и никогда не выезжает с чёрными,потому что хочет ваще родить от белого,может её мечта и сбудется)))\nкароче ебал я её в рот ,без гандона,долго зверски. Она по горло глотает и всё равно не лезет хуй ,я ебу а у неё слёзы текут.потом засадил мощно она ваще блеванула на меня.Я больше не стал в рот.дал ей отдохнуть,но она меня завела больше всех на тот момент,потому что как то ,чем то она мне близка показалась.Что то в ней было такое.\nУ меня остались 2 гандона своих.Один напялили ебал долго,она орала и кончила и я её пристрелил.и рубанулся на ней,вынимаю потом хуй,а гандон ваще разорвался.тьфу бля!побежали ,поскакали мылись .мылись и закурили молча.Хуй с ним, заржали выпили уснули.Проснулся утром и хуй как дед мороз стоит.на неё посмотрел,ваще пиздец  ангел лежит,только с Будой на шее.бляя....Надеваем последний гандон и ебля тинг тонг просто.свалились на пол,я руку себе подвернул,больно сука,но ебля продолжается и тоже самое этот гандон тоже пизданулся.и тоже кончитто в пизде забурлило.Я хуй драил и кожу на залупу натянул и ссал чтоб промыть,незнаю пока.спидонос я или нет...Ну что делать,ебучий случай.Нехуй было ваще ебаться,она неушла ,мы с ней ещё до вечера были ,накупил разных гандонов неодин неналез на хуй,ебал осторожно в рот один раз.потом мы с ней гуляли и она мне сумки носила.(у них у всех такая привычка,я например покупаю пиво или что и они сразу сумку хватают и несут,ну я невозражал)Потом она съебалась я ей пожрать ещё купил хуеты,что она просила и всё.', 0, 1347386295, NULL, NULL, 159, NULL),
(418, 'rafinad', 285, '46.185.69.85', NULL, 'Ну так вот...Катталия съебалась я решил просто поспать один и рубанулся,утром пожрал на завтраке и сразу побежал срать.Потом на пляже валялся и ко мне долбоимитаторы приставали постоянно.Достал кудрявый телефон в котором стояла карта интер сим,тайландская я её там заряжал постоянно и она быстро заканчивалась,ебать колотить.\nПозвонил в пизду к этой танцшоубабе.Видимо пизда была занята и трубка не бралась,зато играла музыка пездей и я её послушал по телефону.Я прогулялся в массаж,там всё тоже самое,но я не дался и удрал.Я не хотел.Заплатил в кассу и ауфидерзейн.Долго шароёбился,потом опять позвонил в пизду,пизда вдруг неожиданно спизданула что то,я испугался даже,но в штаны срать не стал.Я сказал "ай эм Влас ай вон ю,рак гун лав ю бум бум" и всякую хуйню понёс просто.Она мне начала пиздеть какието координаты,но я нихуя незнаю там и предложил,волкин стрит ин зе бич эбаут уан хаур.Ответ -ок.Я думал пиздит,ну думаю хуй с ней.Всё равно надо туда ехать.Прыгнул в лоховоз за 20 батов и умчался туда.Там долго ходил,видел только жопошников и уродок ,заебался ....Пошол взял пива и лежак и ебанулся туда,прошол ещё час,одни жопошники кругом и жопорожие бабы совершают кувырки в воде передо мной.\nПросятся на хуй.Я уже собирался уёбн зе битн делать от туда и вдруг заметил ,что кто то движется,правда с какойто бабой и лакеем мопедистом.Кароче баба вторая отвалила я заплатил 2500 этой и сказал сама с лакеем расчитайся.Уже темнело.Мы погрузились опять втроём на мопед и помчались.Я подумал что надо бы пожрать.Остановились недалеко от отеля был какойто типо ресторан.Лакея нахуй послали,он съебался.Я попросил чтоб она мне еды взяла той чтоб я необосрался опять.Кароче какуюто лапшу с чемто сожрал и мясо с рыбой .Вроде не сиранул под стол как всегда,она взяла тоже какуюто поебень себе.Взяли вина.Я охуел с её красоты.Вот это точно думаю мне сегодня повезло.А,кстати я забыл сказать я долго шлялся и гандоны искал ,я научился их определять,раньше как то не думал об этом,попадались маленькие,но не на столько.И вот якупил гандоны ,правда они втри раза дороже мелких там.В сартире открыл и вроде так прикинул.Эти норм.\n( извиняюсь.я тут пишу и паралельно жру,по телефону пижжю и другие дела по дому делаю и пью и пиво и криво и т.д. Кароче я до сих пор отойти немогу от этого Тая ебаного)\nПрипёрлись в отель.Я спросил а ты умеешь пиздой курить?ай вон ю тим смоук!Говорит,неумею.Может пиздит.Она сказала ,что она ваще не курит.Зато включил музыку и она мне стриптиз устроила ,я ахуел это тело было не просто дрыгальник из халявного бара гого,тело,.это было ,явно лучше.Она меня замасажировала и стала сосать без гандона,одела гандон,я её передвинул на хуй,она яростно стонала,потом я сверху,она начала клитор свой дрочить и кончила,даже не один раз,но !.....Всё было очень красиво и мне очень понравилось,мы с ней просто поговорили и бухнули.....я ей ещё денег дал за шоу стриптиза.Но!Вчерашняя хоть и не такая распиздатая и крутая и красивая,а завела меня больше чем эта.Вот так вот.Эта ушла утром и всё.', 0, 1347386406, NULL, NULL, 159, NULL),
(424, 'rafinad', 285, '46.185.69.85', NULL, 'Я смотрю никто,ничего неотвечает.вроде форум про это и все притихли,что то непонимаю.Я читал тут всякие похождения.Но ребята ехали толпой.а вы попробуйте съездить в одну репу ,хуй знает куда,в совершенно неизвестную для вас страну .И заебенить там еблю,посылая всех на хуй и вернуться живым.Вот это экстрим,я считаю.', 0, 1347653710, NULL, NULL, 159, NULL),
(420, 'rafinad', 285, '46.185.69.85', NULL, 'Итак подбираемся к самому гавну.Несколько ночей я спал один ваще и отдыхал,ходил по рынкам дочке подарки покупал.Ебал в го го прямо в баре или в массаже ебал и съёбывал от туда.Но я ещё брал на ночь двух негативных персонажей.Сначала -1 вариант.\nЯ забрёл в бар и взял пиво ,ко мне подсела полу тайка,полу негритоска.чёрная,но вроде симпатичная баба.Я подумал ,а не присунуть ли обезьяне ебаной?\nКароче заплатил в баре 300 батов за неё и ей обещал 1000 утром и взял в отель.Сука черножопая мне испортила настроение.Она вымылась и т.д. Но это ей непомогло.Она стала делать мне массаж и нихуя неможет неумеет,только ржот и скребёт,либо кулаками машет,мне дурно стало.Никакого возбуждения ваще.Зато она вся течёт ваще и пизда у неё ваняет зверьём,противно.\nЯ сразу начал превращатся в фашиста медленно.а она больно пиздит и ржот,а сама течёт как собака недоёбаная,она увидела мой хуй и как начала сосать я ей руку в пизду сунул,лучше бы не сувал,вонь зверьём меня окутала,это облако вони витало надо мной.Я убежал в сартир ,вымылся представил себе Анжелину Джоли,пшикнул в нос дезодорантом.Приказал ей успокоиться,вроде притихла.Поставил раком чёрную жопу и анжелину вспомнил одел гандон и ебал,я ебал и ебал она кончила,я её перевернул и долго ебал,она кочила,я -нет.я ёбнул водки и ебал в рот её долго по горло и не кончил,я устал и так и уснул злой.Утром проснулся.а она уже тут как тут сидит и смотрит,"дарлинг,ду ю вон финиш?"Ноу! -заорал я.Я ей дал 400 батов и купил молока,она хотела и даже не проводил.Просидел пол дня с сигаретой один,успокоился.Пошол в массажную,там хотели маслом залить,сказал -ноу!соси!отсосала я ушол спать обратно в отель и наебенился водки один.а дальше меня ожидало ещё веселее существо.это пиздец...', 0, 1347432776, NULL, NULL, 159, NULL),
(421, 'rafinad', 285, '46.185.69.85', NULL, 'После негритоски я трахнул в гого ещё и успокоился.Как то вечерком иду,курю,подъезжает лакей на мопеде,типо подвезти?типо ненадо!а девочку надо?Ну я вспомнил Катталию и подумал ,что лакей мне её вдруг опять притащит,лакей ломался кароче договарились с ним за 1500 батов на ночь,но чтоб молодая и красивая ахуенно и не негритоска .Он сказал Ок! и умчался за бабой.Через 5 минут привозит красивую бабу,я подумал заебись.На всякий случай пощупал и спросил не леди бой?нет,говорит .это баба.А она заржала и говорит ,потрогай мол пизду.Темно было и я на всякий случай потрогал и действительно пизда.Я ему сказал ты мол помнишь сука,что бабу я только утром отпущу?Баба знает что до утра?баба засуетилась и они начали пиздеть друг с другом на своём.Это мне уже непонравилось.обычно бабы сразу как то по другому действуют стараются обнять или поцеловать,а тут хуйня какаято...Они попиздели и баба говорит ок гоу!Мы на мопеде втроём примчались к отелю.Этот лакей оказался уёбком начал просить ещё на чай.Я ещё раз сказал,что у меня ваще скоро не встанет на вас всех уебанов и сказал у меня ваще уже настроение пропало ебать!(видимо природа мне шептала "Влас не еби существо это")\nя ещё раз пальцем по часовой стрелке показал ,типо до утра.Баба опять начала пиздеть с лакеем,я уже разозлился,оказывается баба хочет ,что когда я кончу и усну,она съебёт.Нихуя!сказал я.я щас вам дам за такси и на хуй пошлю обоих сук,заебали!(вот уж точно такого небыло гемороя за всё время)\nТогда баба говорит резко,всё заебись я согласна до утра.Но я вижу и чую,что то не то и чего то она боится,я непонимаю.Но я устал и у неё пизда есть,думаю я наверно просто уже сам ебанулся,я даю лакею 1500 и посылаю натурально не на хуй как обычно а в "тим" ебаный.Он уёбывает.Я смотрю на эту бабу внимательно.она типо улыбается резко и потом резко как отвернусь ебало кирпичом и по сторонам смотрит.Сели у бассеина пьём.Молчит и гоняет у себя что то в башке.я смотрю и думаю.Как только замечает что я не пью,сразу пихает выпей,выпей,бля.Другие наоборот говарили не пей пошли ебаться,а потом попьёшь.А эта странная сука...\nУ меня желание пить пропало.Заходим в хату.типо улыбается и обнимает и опять через секунду кирпич ебаный и гоняет в башке што то у себя.Потом говарит ,а давай ты всё таки финишь сделаешь и я домой к ребёнку пойду у меня дочка дома одна.я говарю покажи фото дочки и показываю ей свою дочку на фото,оно всегда в кашельке у меня с собой,а эта баба говарит что у неё с собой нету фото.Опять странно.....Все бляди мне показывали фото своих детей изза которых они работают блядьми и фото у них всегда с собой,а у этой нету нехуя....Я опять задумался...она вымылась и передо мной стоит,стройная,невысокая,как трансы обычно с пиздой и сиськами и голос негрубый и бороды нет ваще.но что то нетак.Я непонимаю.\nКароче делает мне массаж ,всё нормально не дёргается,всё заебись и нежно я уплываю.Повалил её смотрю в глаза взгляд непонятный ваще ,я подумал я устал.Она или Оно постоянно курит нервно.Потом хватает телефон и звонит кудато,и пиздит.Потом говарит ты кончишь и я уйду давай пососу и всё.Тогда я взбесился и сказал у меня друг тут мент ебаный и участок тут рядом передай своим пидарасам,что и тебе и им штраф вьебут и разденут сук.если рыпнешся.Кароче она пиздит по телефону и потом резко бежит ко мне и улыбка теперь натянута постоянно и говарит дарлинг и т.д. прости.Я успокоился закурил,достал хуй и в рот сунул ,но это всё в башке крутится и я немогу возбудиться нормально.Тогда Оно резко знает ,что мне надо ,достаёт свой телефон и врубает там порнуху на нём и телефон мне даёт и сосёт.Хуй распух ахуенно существо заметалось ваще.Сунул руку в пизду пизда маленькая и сухая,существо достало смазку и захуярила в пизду свою.Существо приготовилось к смерти,но пыталось улыбаться.\nЯ начал сувать туда,а пизда нетянется и существу больно,оно типо охает,но на самом деле крякает предсмертно.\nя вижу что это ваще конслагерь тут получается.Я понял почему оно так боится ебаться,я понял что это за взгляд и что пизда сшитая сто раз и пизда не для того чтоб ебаться,а для того,чтоб ссать просто и пизда невозбуждается на мужиков ваще и ваще мужики её неинтересуют,этой пизде нужны только деньги и чтоб её хвалили и смотрели на неё,что это пиздА о Да!Я взял за горло сучоныша и спросил ,пальцем в рыло тыкнул и говарю ему -"Ю ! леди бой!"\nМолчит .Но злится.И смотрю у него уже ручки посильнее стали немного.Ничего неответило мне существо.Оно просто быстро съебалось.а я свалился на пол и закурил.Кто это был?баба или нет?Но пизда и поведение не бабское.А взгляд мужика,который меня ненавидит,натурального мужика.На следущий день я долго немог прийти в себя я уже видел везде это существо .Мне мерещилось,что все бабы такие сшитые и пуговицы вместо глаз ещё пришить осталось.Тьфу,бля! Потом всёже упился прокатился на мопеде ночью,упился так,что шлем съехал на ебало и я уже ваще невидел куда мы мчимся и зачем?Отмассажили меня отсосали и т.д.', 0, 1347432881, NULL, NULL, 159, NULL),
(422, 'rafinad', 285, '46.185.69.85', NULL, 'Эпилог\nЭто всё происходило начиная с 12 ноября этого года.Я чуствую,что я уже тоже ебанулся от этих ебаных людей,от этих жителей ебучей чехарды.Но мне просто хотелось продемонстрировать свой взгляд.на происходящее в Тайланде,я понимаю,что там были многие из вас.Но я был именно ,ежедневно в ебучей атмосфере.И самое интересное,что я не жалею ни о чём.даже денег проёбанных нежалко ваще.Но психика моя нарушилась немного и я сам чуствую это.Но зато я выебал Тхайлэнд !)))', 0, 1347433052, NULL, NULL, 159, NULL),
(423, 'Andy Garcia', 261, '46.185.69.85', NULL, 'доброе время суток.\nрешил проехаться в район Борщяговки, съехал с Окружной на конечную скоростного трамвая, а под мостом тело стоит, у гашенное в хлам... гамадрил гамадрилом...и тут бля светофор красный и менты с права стоят....бля...остановился,жду....тут тело гребет к машине (и нахер я двери не блоконул) залазит и говорит милым бля голосом:\nдовези меня любимый домой....\nя ей слыш тело, с какого это хе, тебя вести... а оно жалостно....нажролося я тут понимаешь. бабла нет....короче хош отсосу..... ну говорю соси, стал чуть дальше остановки по прямой.....девка в натуре сосать лезит, хорошо в бардачке коробка гандонов была, говорю подожди, а оно лезит бля....ну короче успел бля скафандр натянуть....а баба бля страшновата, лет так бля 30-32....короче отсосала бля..... ну бля говорю куда вести хоть не на Троещину? а оно говорит Л.Курбаса 9Ж, ну я короче в навигатор вбиваю...а оно бля мне маршрут рисует, по прямой триста метров на право и сразу на лево во дворы......ну я и по рулил...\nпри въезде во двор(какой то мини маркет ) тело говорит что хочет пивка еще уябать литру, говорю детка спать, оно мне домой надо тогда.....через пять сикунд заявка, говорит я ведь еще не рассчиталась, давай отсосу....бля, ну в чем вопрос, скафандр на дружка и вперед.... сосала конечно долго но результат все же пришол.....\nподъехал к ее дому, говорю вылазь бля, а оно на меня тупиться и говорит . а у меня денег нет чтоб за такси рассчитаться, не ну не бля  \nпотом милым бля голосом. мож я отсосу у тебя? не ну не бля.....третий раз за 20 минут....ну говорю соси.....не ну и как не смешно, отсосала......ну выходит с машины и говорит, ты если что звони... говорю куда? говорит записывай... и того дала мобильный и домашний...ржачь бля....\nмобила 097-527-72-73 ( набрал ее со скрытого номера, труба звонила), домашний 273-48-08 (хер его знает, ее или нет)...\nи того:\nТТХ (внешность) - 3-  да ну его нах, жирная бля, все обвисшее, но сиськи 4+  \nМестоимения - 5.  таки моя то машина\nКС - 0   Замечаний особо нет. Так как не рискнул.\nМН - 5+. три раза подряд\nШГ - 0   не ну бля за рулем не пью\nРекомендации:  если кому не невтерпеж слить, это для Вас \nЦВ - поездка через пол города на Борщяговку ,одна заправка:D , цена вопроса 0 денег 0 копеек, максимум 500 метров проехал  \nвот думаю может грачивать пойти \nда и главное спросил можно ли ее номер друзьям давать...говорит, давай, я бля ебаться люблю...', 0, 1347461823, 1348158194, 'Andy Garcia', 106, NULL),
