(427, 'rafinad', 285, '46.185.69.85', NULL, 'Вот я думаю,может стоит поехать куда нибудь где не туристические районы ,туда где туристов нет.и неожиданно их выебать .так чтоб они неожидали.Потому что эти уёбки ,они готовятся каждый день,как  наебать,они живут защёт туристов и наебалова,у них все ходы просчитаны.Даже если косая сука тебе пиздит лесть и свиду выглядит прилично и пытается в доверие войти....всё равно -это пиздёшь.для них мы просто мешки с деньгами и у них щётчик вместо глаз ебаных.И это в тех местах где туристы,а где их нет?Кароче я думаю надо их врасплох застать,чтоб они ниготовы были и тогда посмотреть как они себя поведут.', 0, 1348156440, NULL, NULL, 159, NULL),
(428, 'rafinad', 285, '46.185.69.85', NULL, 'Так что ребята ,остерегайтесь жопошников в Тайланде.Удивительно.Я раньше думал,что у всех жопошников есть хуёк.Я предварительно перед поездкой перерыл интернет и получил скудную информацию о них.Некоторые мужики нарывались на жопошников там,и у всех у них был хуёк.А про тех у которых уже пизда,я ничего нечитал и по этому снял пидара со спокойной душой.Возможно ,что некоторые мужики ебали таких,только они сами по пьяни видимо непоняли ничего.Они наверно думают,что они баб ебали.)))Я ахуею,ребята.)))\nЖопошники сначала делают себе грудь,а хуй болтается.А потом делают пизду и тогда его отличить от бабы сложнее.Вот в чём дело.Но у любого пидара ,даже полностью переделанного остаются глаза и поведение и пизда не такая как у бабы,надо только внимательно посмотреть на него ,и тогда станет ясно.Жопошники сразу хотят сосать и ведут себя как пидары обычные.Смотрите внимательно на них и учитесь на ошибках таких идиотов как я.Привет!)))', 0, 1348156547, NULL, NULL, 159, NULL),
(429, 'rafinad', 285, '46.185.69.85', NULL, '[img=PunBB bbcode test]http://img410.imageshack.us/img410/4411/74589387.jpg[/img]\n\nВстретила меня Лера так, чтобы сразу сразить на повал - в прозрачном черненьком платьице и на высоком каблуке.\nДолжное впечатление на меня было произведено - всё увиденное сразу говорило о том, что гармония будет достигнута (отдамся пару разов).\nПрямо с порога захотелось просто раздвинуть широко руки и заключить в объятие с криком: "Здравствуй тело молодое!".\nВыглядит девушка шикарно - высокая, молодая, стройная, симпатишная, приветливая, ухоженная.\nБыли предложены тапочки. Также во временное распоряжение было выдано большое синее полотенце (мой любимый цвет, мой любимый размер).\nНапоила чаем.\nПредложила конфеты - у неё их пару килограммов наверное накопилось.. всё носят и носят..\nКстати, закончился "Красный мак" - необходима допоставка .\nРасполагает к себе практически мгновенно - минут через 10 общения появилось очень важное ощущение давнего знакомства.\nКвартира - нормальная, чистая, хрущевка с евроремонтом, перестроенная под студио.\nИз необычного - в комнате имеется пилон для выполнения стрипа.\nТакже имеется на хозяйстве зверюга - кот (связанных плохих запахов при этом не обнаружено).\nПро деньги намекнула сразу.\nНе думаю, что это минус. \nИбо всё, что происходит после часа, происходит уже безкорыстно, по личным симпатиям и по обоюдному согласию.\nА это может быть в общем случае и пол часа, и час.\n(И когда уже бабы в конторах поумнеют! Кому нах надо этот регламент? Главное, чтобы клиент вернуться захотел!).\nСекс был зачетный.\nВалерия действовала самоотвержено, порывисто, без устали.\nОзвучка была тихая, но зато своя - аналоговая без театральной фальши и томительных стонов.\nВ перерыве был сделан отличный мосаж, хороший такой жёсткий, полупрофессиональный.\nВ процессе никто не беспокоил (возможно повезло или телефоны были отключены).\nПослевкусие отличное: отдохнул душой и телом. Дело было в районе обеда. Т.е. пообедал Лерой так сказать и обратно на работу.\nБарышня не курит, долбоебических наколок и пирсингов не имеет.\nБеседу поддерживает, лаской и вниманием окружает, ведёт себя вобщем естественно.\nВсё, что написано в анкете, подтверждаю:\nВозраст 23 (я бы дал 22)\nРост 170 (реально высокая, с каблуками все 180)\nВес 49 (тело красивое)\nБюст 2 (натуральные, шикарная форма и состояние)\nИ табель:\nТТХ - 5- (минус - нужно немного инвестиций в солярий и маникюр, это красиво, только боже упаси без наращивания когтей) \nКС  - 5 \nМН  - 5 \nОК  - 5+\nШГ  - 0 (Access forbidden)\nЦВ  - 800 UAH (стоит этих денег)\nОриентация - Mono\nПойду ли я еще? Ага', 0, 1348156803, NULL, NULL, 162, NULL),
(431, 'rafinad', 285, '46.185.69.85', NULL, 'на рот без гандона лучше проверенным бабам давать и то страшновато.... а ябать...так это героизм  \nбереги здоровье камрад  \nврач проверенный годами  \nмного друзей обращаются по всякой хрене...не разу не подводил', 0, 1348157248, NULL, NULL, 106, NULL),
(432, 'rafinad', 285, '46.185.69.85', NULL, 'снял сегодня похожую под описание особь на секас в машине . просила 300 в час, дал 200  \nбаба лет так 27+, блондинка, сиськи 2+ (размер), стояла на остановке на Окружной в районе улицы Янтарной  , рост около 1,80 (здоровая лошадь бля, в руке держала недопитое пиво....\nи так, села в машину, отъехали метров 200, там съезд в право вниз (старая заправка)по окружной в направлении проспекта Победы....\nраскинул сидушки и понеслась...попыталась сосать без скафандра, была резко остановлена  \nнатянула резину руки+рот, заглатывала глубоко... на 10 минуте издевательства, была перевернута в колено локтевую и засажена по самые гланды..... отстрелил сняв скафандр ей в рот ( начала что то пиздеть... но мне было по хуй...)\nпокурили, начала  туфту  гнать что бля семья, муж вроде был или есть, хуево с деньгами, что любит поябатсо.... на этой ноте был отдан приказ приступить к сосанию....с чем она и справилась   далее мисионерка. полный отстой, была перевернута на бок и засажена в ШГ, хотя бля начала потом пиздеть..я так понимаю что разницу не заметила   \nтак и пристрелил, резину сняла сама, облизала яйца и протерла дружка влажной салфеткой....\nснова по пиздели о какой то хуете... она сделала пару глотков своего пивка...типа в горле пересохло.... третий заход длился минут 20-25.... отстрелил снова без резины ей в рот ( в этот раз не пиздела, даже не сплюнула ) еще пару минут и была отпущена на свободу за пределы машины....\nтолько она вышла к дороге как подкатило сразу три машины .....  со вторым уехала в даль....\nи так:\nтело 4- (высокая бля и пизда лохматая немного)\nгрудь 3+\nминя 5- ( опять минус сука руками лезла, хотя спросила не мешают ли ее грабли)  \nШГ -5+ \nотношение 4- (пиздит дохуя)\nцена вопроса заявлено 300 в час , оплачено за час с 15 минутами 200 украинских денег\nпойду ли еще, ну пойти не пойду, но наверняка поеду  \nтелефон суко не дала, говорит что часто курсирует в этих местах, если захочу то найду', 0, 1348157420, NULL, NULL, 106, NULL);
INSERT INTO `newforumposts` (`id`, `poster`, `poster_id`, `poster_ip`, `poster_email`, `message`, `hide_smilies`, `posted`, `edited`, `edited_by`, `topic_id`, `forum_news`) VALUES
(433, 'rafinad', 285, '46.185.69.85', NULL, 'поехал пожрать в мак на академке,  только отъехал на парковку, подходит к машине маленькая рыжая баба, на вид лет под 20 и спрашивает, как насчет поябатсо...чуть бля колой не облился ( бля сколько не прошу лед не ложить, а они суко спецом накладывают)...ну короче, говорю почем такое удовольствие, говорит хочу 150 за все, типа что даш...говорю 50 грн. и соси бля...чето начала там мурыжить...короче была послана на х...   дожрал и допил только собрался ехать , а она подходит опять и говорит, ну давай 50 только вперед... и еще надо гдето гандонов купить.... спасибо в бардачке две пачки лижит на черный день, короче посадил ее в машину, говорю ну давай, а оно, может без резинки, говорю да ну нах, одевай, опять тормоз. начала натягивать... я просто в шоке, она в обще как будто в первый раз это делала... пришлось самому. начала сосать не уверенно , вяло, спрашивать не больно ли , как мне нравиться....  \nкороче не выдержал такого издевательства над малышом, говорю давай ябаться, ну оно так что то ушло в стопор на секунд десять и начала стягивать джинсы, разложил сидушки, врубил музон и понеслась....  ябал наверное минут за 20.... за 40-50 минут до этого и так три раза отстрелялся, но бля шара, короче ели пристрелил.... начала рассказывать что приехала с Малина к подружке, та ей работу обещала в Киеве, но что то не сложилось...вот снимает комнату за 850 гривен с хозяйкой в какой то пятине на Вернадского а днем торгует цветами на окружной, за ново беличанским жд мостом где то в районе поворота на Коцюбинское  \nкороче предложил ей еще пососать и о чудо. она согласилась (приятный бонус) короче дал ей в рот без резины, вроде чистенькая. без запахов ( кроме легкого парфюма)\nтак и дошел до логического завершения. отстрелил ей в рот, правда она сразу сплюнула в салфетку , но это фигня, второй раз сосало уже уверенней, приходилось слегка помогать   \nи бля самое обидное попрощались как друзья, поцеловала в щечку , а телефон суко не взял, а вспомнил уже в районе моста под проспектом, развернулся , нарезал еще один круг. но малой и след простыл  \nа звали ее Вероника', 0, 1348157522, NULL, NULL, 106, NULL),
(434, 'rafinad', 285, '46.185.69.85', NULL, '...ну потянуло меня домой, яйца просто как колокольчики звенели и просили их больше не трогать.....нет бля, в районе между обойным рынком и электон машем ( он же ВУМ) стоит девушка, кругленькая. личико приятное и ловит машину.... ну бля суко, возьми да остановись....\nи тут сразу сходу 150 миня, 250 поябатсо...ну я точно в стопор ушол... глянул в зеркало, а заде псы проехали медлено, понятно что она машину ловить начала...менты проехали метров 50 и остановились.....а тело говорит. давай за 100 миня в машине, только давай где то поедим отсюда.... говорю. детка, дам 50 грн. за миню и поехали. тут уже стопор у нее...посмотрела она на псов в переди стоящих, говорит ладно поехали.... ну короче сорвался с места, проезжая мимо псов посигналил им и прижал педаль газа до пола попиздячил по окружной....доехали аж до поворота на Вишневое, там чуть дальше разворот в обратную сторону и боковой съезд к озеру, ну здесь все намного продвинутей, с сумочки были до станы салфетки, гандоны и главное (смазка)  \nодела гандон ртом, и начала  засаживать  все глубже и глубже... руками почти не помогала.... и так, на 10-12 минуте сосание девочка выдохлась, раскинулась на сидушке. перевела дыхание и говорит, может поябемся  ну думаю бля пиздец какой то... яйца и так в шоке с дружком от такой нагрузки  ну говорю давай только ты с верху...согласилась...залезла сверху, тело конечно тяжеловато, но форму держит...сиськи мягковатые но честная троечка, соски торчком  \nзапахов от тела не наблюдалось, пизда выбрита, прыгал бедняжка минут 10...но таки пристрелил.....гандон сняла сама салфеткой, завернула в нее, достала еще одну, вытерла дружка. который был уже в полном нокауте \nиз всего не понял одного, накой смазка если сама мокреет, да и + звук полный аналог, спросил телефон, говорит номер на память не помнит, а трубку собой не носит, а менты постоянно к ней доебуются   \nкороче попросила подвезти ее на отрадный.... в соседний дом с некой Анет, если кто помнит отчеты по ней, хороша девка была, да вроде замуж вышла  \nкороче высадил ее с машины и погнал домой отсыпаться, припарковался возле дома , вышел с машины и вспомнил, что я ей денег не дал нихуя...  \nвот зашел домой и решил выложить все как было....\nхотел бы что спиздеть, да нечего', 0, 1348157588, NULL, NULL, 106, NULL),
(435, 'rafinad', 285, '46.185.69.85', NULL, 'и так проехался в направлении метро Нивок, развернулся под мостом в направлении Святошино... сразу на конечной маршрутки на рисовалось тело, брюнетка, сиськи под 5 номер... рост 1.65 (не больше), думаю мож подвезу, маршрутки уже не ездяют, на часах пол второго ночи, тормазнул, подошла , открыла дверь, говорю куды надобно, а она говорит. все кроме анала и миня только в резине  \nговорю, а почем нынче ябля то стоит, говорит 100 миня или 150 палка в машине. сауна на час 250 либо готель какой, по квартирам не ездяет...\nну закатал за 70 грн. пососать... посадил в машину проехал немного в перед, там по правую сторону улачка и офис Венбест... ну резину натянула сама и без рук ( за что +) начала сосать, вывалила сиськи ( даже наверное не сиськи, а вымя  ) ...\nметодика сосания однообразная...заябала на 7-8 минуте , точно не засекал, говорю соси глубже. а она чето там мычит себе под нос (вернее мне под хуй, наверное с дружком моим поговорить решила) и так еще минуты две издевательств.... короче заябала, взял за голову и ускорил процесс  \nправда после вчерашний приключений как то не очень это все впечатлило... ну не то совсем...короче говорю заябала, снимай штаны ябать буду, а она, я сама хотела предложить...ну короче завалил ее на бок и о трахал до отстрела.... она повалялась еще с минуту, оделась, получила свои честно заработанные 70 грн. и упиздовало куда то в направлении частного сектора....\nна этом как бы весь рассказ... рекомендовать сее тело не буду, если кто снимет, дохуя денег не давайте ( ну не стоит даже 70 грн.) и на что то приятное губу не раскатывайте...\nза пять минут разговора сказала что работает продавцом в ларьке, живет на венике. есть дочка, с мужем в разводе и какого хуя этим занимаеться и сама понять не может...', 0, 1348157748, NULL, NULL, 106, NULL),
(436, 'Andy Garcia', 261, '46.185.69.85', NULL, 'Итак, прочитав соответствующую тему про Варшаву и не найдя отчетов, решил, что пора браться за дело. \nПроверил выложенные ссылки, остановился на ресурсе roksa.pl (модеры простите за ссылку). Позже выяснилось, что это не самый популярный ресурс, а самый популярный odloty.pl (простите еще раз). Ссылки выкладываю, чтобы камрады не парились посиками нужных ресурсов, будучи в соседней державе. Опять же, есть надежда, что они употребив кого-либо, поступят оп моему примеру и напишут отчетец.\nФоток не выкладываю, поскольку анкета не соответствует, а будет только отвлекать внимание.\nИтак, проверив полтора десятка анкет остановился на своем типаже: высокая брюнетка, 4й размер, 24 года. К тому же говорит по-русски. Цена 200 злотых, что по нашему составляет 48 евро (гы... по-нашему, мля!). Прикидываю, что это очень вменяемая цена. Также отобрал еще несколько вариантов про запас, решив, что на компромиссы не пойду!\nПриятный голос ответил в телефон, сказала, что доберется за полчаса. Через 45 минут нежный стук в дверь, открываю, запускаю.\nКак и предполагалось, фотки не ее. Стоит дородна дивчина, ростом под метр восемьдесят (на каблуках), брюнетка, с серыми глазами. Кожа лица и приоткрытого плеча - соответствует указанному возрасту. Личико простецкое, несколько селянское, но приятное. Решив, что не хер испытывать судьбу, оставляю ее у себя. Сразу определились со временем, будем общаться 2 часа. Взяла в 100 евро + 100 злотых на такси, отписалась мамке в смс.\nСели поговорить под бокалы с вином из минибара, оказалось зовут Алена, родом с Волынской области, возраст 22 года, хотя выглядит старше лет на 25. Причем, это связано с тем, что она крупная. Нет, не толстая, не корова, но большая девочка. В процессе общения проявила себя весьма положительно, очень общительная, причем не для затяжки времени, просто любит поболтать. Тело в хорошей кондиции (молодость, однако), попа тоже гладенькая. круглая, признаков целлюлита не обнаружено.\nДопив вино приступили к делу. Начали с взаимных ласк, одетыми. Возбуждение проявилось не только во мне. Целуется вовсю (люблю я это с хорошим девочками). Раздев ее догола, отправил таки помыться, но больше по ее желанию. Видимо, врожденное чувство чистоты. Поскольку опять же ощущения затягивания времени не возникало. Вернувшись из ванной, взялась за меня энергично и опять возбуждаясь. После процесса взаимных ласк, взялась за миню. Делает хорошо, без зубов, с хорошим  вакуумом, довольно глубоко, но не в горло. \nДа, чуть не забыл ее описать. Кожа хорошая, молоденькая, мягкая, бархатистая. Лобок выбрит начисто, ножки гладенькие, в общем кул. Фигурка есть, как я уже сказал, девочка крупная, но и я немаленький. Грудь второго размера (не 4го как указано в объяве), да и хрен с ним, форма красивая, соски небольшие.\nПосадил в позу наездницы, что оказалось не очень удобно, в виду односпальности кровати. Вторая кровать отъехала в сторону еще минут 20 назад. Перевел ее на спину, сам сверху с закинутыми ногами. Чувствую, ей нравится, подмахивает. (Сцуко, ща пишу, и опять ее хочу). Перевел ноги на сторону, в такой позе и завершили.\nОстальное время пролежали, болтая ни о чем. \nВ итоге, \nТТХ (тактико-технические характеристики) - 4. Крупная, не всем может понравиться. Лицо простоватое. Кстати, оказалось, что она природная блондинка, но крашенная в темный цвет.\nКС (классический секс) - 5, старается, сама получает удовольствие. Если нет, тогда игра - на высоте.\nМН (мин нет) - 4+ \nОтношение к клиенту - 5. Настроились друг на друга сходу. Без всяких выебонов и хитростей. Несмотря на то, что мамка ее ждала в машине под отелем, она перележала рядом со мной минут на 10-15 больше.\nШГ (шеколадный глаз) - не спрашивал, не любитель.\nЦВ(цена вопроса) - 100 евро + 100 злотых (25 евро) + 50 злотых за вино из минибара. Всего по времени больше 2-х часов.\nПойду ли я еще? Да, если только не подвернется какой-то сногсшибающий вариант.\nОднозначно рекомендована: не затасканная, свежая, упругая, обалденно пахнущая везде. Один из немногих вариантов, когда нет ощущения, что зря платил бабки.', 0, 1348158520, NULL, NULL, 163, NULL),
(439, 'rafinad', 285, '46.185.69.85', NULL, 'В Чате Bizarre нарвался на непонятный ник: "в_машине_м". Спросил.Оказывается - девочка зарабатывает минетами в машине. Списались, договорились. В чате отвечает достаточно быстро, четко, грамотно. Живет и работает на Березняках.Цена - 80 грн.\nНа встречу опоздала на 4 минуты.\nДевочка молодая, улыбчивая, контактная, вежливая. Внешне - невысокая, мезоморфного телосложения, можно сказать - симпатичная, несколько полновата. По ее словам - 24 года, 164/54/2.\nМестоимения (куда заехать от чужих глаз) было с ее помощью найдено мгновенно (Березняки - набережная, таких мест хоть отбавляй).\nПроцесс: През одет ртом.Минет плотный, несколько агрессивный, но не однообразный, с творческим, так сказать, подходом. Девочка старается однозначно. В процессе - прервались, спросил, как насчет полной программы? Оказывается - возможно за доплату, но не захотелось корячиться в машине.Далее по обоюдному согласию през был снят выброшен на хер, и процесс был продолжен до логического завершения. Живительные соки были выпить до последней капли. Дальше -отвез девочку домой, получил "Спасибо за визит" и уехал думать над своим отвратительным поведением.\nИТОГО:\nТТХ - 4\nКС - отсутствовал\nМИНЯ: - 4 (надо бы нежнее, особенно без чехла)\nШГ - не спрашивал.\nОтношение к клиенту - 5+ (был приятно удивлен пунктуальностью, вежливостью, тактичностью (ну приоритеты поперли -старею, бля!).\nПойду ли еще - не исключено.\nP.S.Этот опыт с сексом за $$$ у меня первый. Имею большое желание активно пополнить ряды уважаемых Форумян и употрЕбителей. Поэтому слезно прошу опытных людей разъяснить один сугубо технический момент:\nУ всех проституток расчет оплаты зависит от времени (напр: 50$за час,)возникает вопрос: от какого момента начинается отсчет времени? Как зашел в хату, или как начал процесс? Ведь при первом варианте не исключено, что пока снял верхнюю одежду, попил кофу с сигареткой, попиздел, помылся, вытерся - 55 мин уже прошло и пора, заплатив бабло за час через 5 мин уебывать домой с раздутыми помаранчевыми яйцами!!!', 0, 1351452683, NULL, NULL, 166, NULL),
(440, 'Andy Garcia', 261, '46.185.69.85', NULL, '[quote] от какого момента начинается отсчет времени? [/quote]\n\nДля лохов - с момента когда поднимаеццо трубка, чтобы позвонить бляди, а для правильных пацанов с момента ввода своего младьшенького в мясо, всегда так вроде было :loool:', 0, 1351453052, 1351453159, 'Andy Garcia', 166, NULL),
