(444, 'Карлсон', 300, '46.211.120.240', NULL, 'Всем привет . пишу свой первый адчет о посещении проститутки с [url=http://natashaescort.com/]данного рецурса[/url], прошу не закидывать тапками , да барышня канешно на любителя но блин так получилось шо был неподалеку поэтому собственно и воспользовался сервисом )) ну и жлобство ясен пень подсобило . двести пятьдесят гривен палкочас  таки . Ну ближе к делу , или к телу кому как угодно [url=http://natashaescort.com/lena/293] ссылко на анкету проститутки [/url] НО замечу сразу ипал другую барышню , там такой себе минибордельчик из двух персон эта Лена которая в анкете и другая дамочка , тоже из серии [b]проститутки за 30[/b] или даже под сорок ) ее фоток не нашел ну там такая блондинистая тетка с коротковатой стрижкой и начинающей плыть фигурой короче . Ну тетю Лену бля я уже как то тестировал , в принципе тетка ниче так может как нибудь еще поведаю , но сейчас по Люде это вторую так зовут значит . Начну с того, что любителям изысканных интерьеров наверное в это логово разврата соватся не стоит тонкая душевная организация может не выдержать , ну а нам детям трущеб настрать , мы и в худших местах просыпались во времена своей молодости (я про общагу студенческую если че) ну ладно продолжим . Вобщем пришел распугав рой мух (летом дело было) выбрал эту самую Люду , сполоснул свои прибамбасы , холодной водой пилять , ну и приступил к процессу . Чай кофе не предлогали . Сосет тетка ниче так нормально , глубоко с душей , а да минет без резинки был если кому эта опция важна то берем на заметку , правда после отстрела дамочка уж излишне неполиткоректно умчалась сплевывать )) Второй заход начался с мини а закончился позой бобра , ниче так видон нормальный задница как для почти сорокалетней [b]проститутки[/b] крепенькая , гладкая без всяких целюлитов и тд. Жопную еплю не практикует , между перепихонами планомерно выносит мозк .  Рекомендовать конечно не берусь . но кто забредет на огонек то лучше берите Лену она хоть и пострашнее н