(445, 'Карлсон', 300, '46.211.120.240', NULL, 'Хай падонки ! Вот выпала свободня минутка , решил поделится впечатлениями от посещения очередной [b]проститутки[/b] . Персонажа думаю достаточно известного в наших кругах , по имени Зарина бля буду но в барышне есть че то цыганское , [url=http://natashaescort.com/zarina/167]ссылка на анеку проститутки[/url] прилогается . Ну а теперь по делу . Фото в анкете значит оригиналу вполне соответствует , небольшой фотошоп канешн присутствует но вмеру , ну тоесть особо реальность не искажает . По внешности невысокая , грудь немного подвисает жопка ниче так ну в общем не самый худший вариант в этом сегменте . да цена 600 гривен палокочас .  Когда я посещал принимала на Дружбы Народов , созвонился приехал , был отправлен в душ , после прошли в комнату и приступили к процессу . обрезинивает ртом сосет не плохо но как по мне немного жостко , хотя хз может то мне так показалось , после не продолжительного минета была посажена сверху и так опреходована . Скажу сразу это не ее поза , грудь несовсем эстетично подпрыгивает ну не суть . Отстералялся и ладно . Полежали немного потрындели , девушка в принципе не напряжная веселая , хотя может просто в настоении была . ну вобщем полежали потрындели грю нефиг попусту кислород переводить давай на второй заход , натянули през и вперед ,  опять немного пососала , грю давай избушка поворачивайся к лесу передом а ко мне задом зайду с черного хода , взяла смазку смазала инструмент и понеслась . видок сзади ниче так жопка аппетитно выглядит , компрессия правда не такая уж шо пипец ну в принципе терпимо , потому что в классике там вообще достаточно свободно все . так раком и добил . Да, время сечет достаточно строго .  Общее впечатление неоднозначно вроде негатива нету никакого , но душевности нехватает . конвеер вообщем . хули еще ждать от [b]проститутки[/b] то )) хотя по сравнению с [url=http://forum.natashaescort.com/viewtopic.php?id=169]Людой[/url] небо и земля )) \nТТХ - 4-- \nМН - 4- или 3+, (в резине)\nКС - 4-\nШГ - 4\nБИ - хз\nЦВ - 600', 0, 1354446236, 1354454676, 'Карлсон', 170, NULL),
