(461, 'makar', 313, '46.211.124.100', NULL, '[img=фото проститутки]http://s019.radikal.ru/i623/1302/23/7327a44aafa7.jpg[/img]\nПриветствую камрады . хочу поделится инфой по поводу одной вполне достойной на мой взгляд [b]проститутки[/b] , правда для любителей постарше , потому что фее лет сорок с небольшим , хотя в анкете и заявлено 37 . Кстати по поводу анкеты , фото выложинные там все ее , и как можете судить фигурка там для ее возраста очень даже неплохая . Росту среднего весу тоже кило шестьдесят может чуток больше , совсем чуток , килограмм на пять )) сисько маленькие не больше единицы но с прикольными торчащими сосками . Лицом конечно не Моника Белуччи , но и не Мерлин Менсон )) на любителя вобщем ) встретила достаточно приветливо , напоила кофеЕм . Дальше душ . Полотенце нормальное , резиновые тапки на любую ногу (неопределенного размера) . Дальше в койку , в качестве траходрама используется матрас , не ватный если че , а такой обстоятельный каркасный , возможно даже ортопедический я в матрасах не шибко шарю . в качестве подушки – пара сисег – плюшевая такая хрень , типо игрушки или чето вроде того . ну ниче помоему в тему )) По процессу : сосет так себе , окрестности особо не жалует , распускает руки , не очень глубоко , но в целом все на уровне . в секасе достаточно активна стонет подмахивает , верхом правда не скачет а елозит , я про позицию наездницы )) но ниче так прикольно вполне получается , позы меняет легко , трогать разрешает везде . Озвучка хрен его знает наверное все таки цыыфра , хотя чем черт не шутит … В жопу , пардон анал не практикует . Время особо не сечет , пробыл пару часов . Между палками сделала неплохой массаж . При общении не лучше упоминать Хорватию , покер , и мамбу – возможен вынос мозга )) В общем в целом неплохо провел время , деньги отдал когда уходил . цена вопроса 400 грн.  Подкатывал через анкету на мамбе но видел еще гдето на сайтах . и уверен что встречал раньше в одной конторе в центре (брал тогда другую девку , помоложе, но