(462, 'makar', 313, '46.211.120.220', NULL, '[img=проститутки Киева]http://totalfuck.info/wp-content/uploads/2013/02/226.jpeg[/img]\nМарго , долго косился на топмоделсе на это силиконовое счастье но цена в триста убитых енотов определенно останавливала. Но как то приняв на грудь для смелости немного вискаря , достал из под матраса заначку решился все же попробовать на ощупь творение пластических хирургов . Принимает в центре . Тетка вполне симпотичная силиконовая кукла с губами ихтиандра ) Квартира соответствует прайсу . кровать большая в ванной пол с подогревом , ну так а х*ли за триста то баксов . Гели полотенца присутствуют , чаем напоила . в принципе телка вполне позитивна но какой то налет чисто профессиональный присутствует . дистанцию держит в общем . Теперь по самому процессу – сосет старательно с заглотом облизыванием памидоров и тд., в секасе тоже активна , прыгает меняет позы . в общем старается угодить и схватить за яйца ))) хер его знает наверное бзик такой у девки , схватить камрада за яйца – цувство контроля наверное дает )) а хули когда тебя за яйца держат особо не забалуешь )) во время епли применяются резиновые письки по желанию . пока пер ее в зад она резиновым членом имитировала активный трах основного отверстия . Анал не плох посторонних запахов замечено не было все практически стерильно , и обхват достаточно тугой . Между палками перекинулись парой фраз , разговор поддерживает , без груза . Но сильно разговорами не увлекайтесь а то потом начнет отлынивать от второй палки , типо цигель цигель ай люю , времени мало осталось и все такое . Ну вот вобщем то и все . В целом сходить разок можно , типа экзотика , и секс вроде неплохой и анал , но я больше не пойду потому что больше ста баксов все это не стоит а переплачивать двести баксов за пол с подогревом глупо .\nТТХ – 4 (слишком много силикона как по мне)\nМИ - 5 (эта пять без вопросов)\nКС – 4 \nМН – 4\nШГ – 5\nЦВ – 300 $', 0, 1361356656, NULL, NULL, 177, NULL),
