(467, 'Do_do', 314, '46.211.122.135', NULL, '[img=киевские шлюхи]http://s017.radikal.ru/i411/1302/aa/fbaca24b7de6.jpg[/img]\nТело найдено мною на мамбе , анкета увы уже убита . но фотку слямзить таки успел . Фотки ееные, телка я б не сказал что бы красавица , но фигурка нормальная а лицо ну с него воду не пить как говорит пословица . Возраст 2о с небольшим по ходу . лишний вес ненаблюдается , обитает в районе Леси Украинки . Сиська не большая в пределах единицы , чистенькая , приятно пахнущая , но блеать какая то стеснительная или хер просцишь . тапки с напитками непредложили , вышел из душа . она сидит с краешку траходрома . инициативы никакой . Говорю ну может начнем уже , скидывай свой лапсердак (пеньюар или какая то такая хрень на ней была) . Сосет как то неуверенно , такое ощущение что специально время затягивает , вобщем мурыжила она его мурижила , говорю ложись лучше буду епсти . легла голову в сторону повернула - мол епи х8й с тобой . С горем пополам кончил , озвучка какое то невнятное сопение , полежали немного рядом глядя в потолок . говорю давай на второй заход заходить , она времене мало мол не успеем все равно . ну блеать думаю хрен с тобой один хрен уже настроение испортила , плюнул ушел вобщем . вот такие расклады . от рекомендаций как вы понимаете воздержусь . за анал даже спрашивать не стал ))\nИтого :\nТТХ - твердая четверка \nМИ  - хата тоже в принципе нормальная \nМН -3\nКС - 2 \nШГ - небыло', 0, 1361459784, NULL, NULL, 180, NULL),
(468, 'Do_do', 314, '46.211.122.135', NULL, '[img=киевские проститутки]http://ib3.keep4u.ru/b/2013/01/01/56/5620e6bab8a90e0d27c014f534ff91f5.jpg[/img]\nВалерия из всем известной конторы на Подоле . в принципе ниче так тетка , пардон барышня бальзаковского возраста . Фото ее но правда на них не видно достаточно приличное пузце , но то такое , х*ли вы хотели за триста то гривен ) по конторе собственно расписывать особо нечего . контора как контора хоть люди и трындят на это бордельеро . но встречаются и гораздо хуже конторы поверте на слово . ну а по даме что сказать . для своих сорока барышня неплохо выглядит если не особо парится на счет упомянутого ранее пузца )) \nПозвонил спросил Валерию , блядодиспечер грит занята пока подьезжай через часок . Подьехал . Все путем дама свободна можно епстись . В процессе довольно активна , собствено в деле не первый год , минетит нормально , я бы даже сказал проффесионально . трогать можно везде , мокреет в принципе сама . в процессе совокупления тоже все неплохо стоны подмахивания , прижимашки ... позы меняет охотно , но мне больше всего понравилось трахать ее сзади , наездница не совсем эстетично смотрится из за складок живота )) сиськи тоже довольно крупные но подвисают уже . второй заход в принципе ничем особо не отличался . Вобщем неплохая такая опытная профи , можно даже рекомендовать , по соотношению цена/качество только ж это контора не факт что застанете именно ее . так что смотрите сами . Да анал отсуствует если че .\nТТХ - 4, для ее возраста\nКС  - 5, \nМН  - 4\nОтношение к клиенту - 5\nШГ - нет \nЦВ - 300', 0, 1361461762, 1361461829, 'Do_do', 181, NULL),
(469, 'Do_do', 314, '46.211.127.185', NULL, '[img=киевские проститутки]http://s2.hostingkartinok.com/uploads/images/2013/01/5d8991c4ce6d842fc16a7065d1ebabfb.jpg[/img]\nСразу скажу что это фото , на которое я повелся , в реале там вместо улыбающейся брунетки - рыжая наглая курва прошу прощения конечно за мой французский, но бля обидно когда прешся через полгорода по пробкам , а по приезду какая то курица с наглой мордой тебя пытается убедить что на фото таки она , но фото старое . ну вобщем по порядку ссылка на мамбу давать не буду , потому как она все равно их меняет по сто раз на дню , но если вам выдадут этот номер , задумайтесь . Вобщем списался на мамбе , заявила 300 - минет , полчаса с аналом включительно 400 , час 600 грн. Цена устроила , обитает на Печерске . Хамить начала еще при теле. переговорах , когда и где свернуть налево )) чето типо мужчина не тупите вы тратите мое драгоценное время  , наверное привыкла что в ее родном Мухосранске на одной улице заблудится практически нереально , но тут бля Киев а я цуко на этом Печерске в последний раз был когда из армии вернулся и неделю отмечал это дело , так что местность помню с трудом ))) Ну короче с горем пополам добрался , открыло рыжее бледное тело , на вопрос ты кто такая , заявила что алена . Где брунеткО ? А я просто перекрасилась . Ну блеть я лох да ? Ну хрен с тобой думаю раз через полгорода приперся разок вдую, хата так себе потянет , сполоснулся по быстрому и в койку . През надела руками , сосет неважно - вяло , проскакивают зубы , помогает руками , не глубоко , пару раз лизнула помидоры (наверное чисто случайно) . Говорю нах , закругляйся и поворачивайся к лесу передом а ко мне задом , вобщем раком и пристрелил . Озвучка цыфра . Анала не было . През снял сам . Отдал оговоренные 400 грн. и свалил . Рекомендовать , из за наеба с фото не стану . а так чисто теоретически, по быстому в зад вдуть конечно можно \nМИ - 3 \nМн - 3 \nКС -3 \nШГ - небыло \nЦВ - 400 (полчаса)', 0, 1361527476, NULL, NULL, 182, NUL