(470, 'vladlen2', 316, '46.211.127.185', NULL, '[img=фото проститутки]http://s51.radikal.ru/i134/1210/f8/1c0dce974b08.jpg[/img]\nВсем привет , вот решил настрочить отчетик о своем посещении одного миникоперативчика на оболони , в районе одноименного пивзавода . Выбрал девушку Настю , ее фото прилогаю , хотя на фото и выбран наиболее товарный ракурс , лицо у девушки скажем так на любителя , особенно запомнился шнобель извиняюсь конечно за выражение . сама дама откуда то толи из Прилук , толи откуда то еще , по профессии парикмахер , но наверное вовремя поняла что руками с ножницами не заработаешь столько сколько п*здой и подалась в проститутки . В квартире была еще какая то девка . низенькая крепко сбитая петеушница (на вид) \nПо Насте - фигурка не плохая , стройная , грудь не очень большая , ростом сантиметров на пятнадцать ниже меня (то есть где то 160 см.) лицо как я говорил уже страшненькая . Сосет средненько , при этом сопит и кряхтит ,  необычно в общем . в сексе аналогично ничего сверхъестественного с аналогичной озвучкой . основной калибр достаточно разношен . В процессе соития заявился очередной клиент , слава богу согласился на подругу "петеушницу" причем диалог с с камрадом в силу тонкости стенок пришлось мимоволи слушать и мне . Полотенце , чай все было , Анала не было .  \nИтого : \nМИ – 4\nТТХ – 3\nМН - 3 \nКС – 3\nШГ - нет\nОтношение – 4\nЦВ – 400', 0, 1361535799, NULL, NULL, 183, NULL),
