(472, 'vladlen2', 316, '46.211.127.185', NULL, '[img=фото проститутки]http://ib2.keep4u.ru/b/2013/01/15/32/3204fc2841766a5335208ed58a8e0df7.jpg[/img]\nНовая девушка в конторе на Никольско-Слободской  ,  девушка толи татарка толи чето такое в плане национальной принадлежности . заявлено 21/177/ 62 с сиськой пятеркой .  ну а теперь по пунктам ...\nМИ - траходром блеать скрипучий , сантехнику который в помывочной устанавливал "чудо технику" надо руки повыдергивать , ну и движуха как на вокзале , ну контора я понимаю , но надо ж как нибудь .... ну не знаю регулировщика какого нибудь поставить что бы разруливал , и камрады друг с другом не пересекались )) \nТТХ -Сиськи большие тяжелые , собственно по фото все видно , да и вся фигурка такая , ну вобщем есть за что подержатся , легкая прослойка жирка присутствует , но в тему . Писько тоже красивая акуратненькая , без посторонних запахов . личико тоже вполне симпотичное , с легким восточным налетом конечно .\nМН - тоже нормально , но только в резине \nКС - темпераментно , озвучка в принципе немного наигранна но даже прикольно - типо да да траха менЮ !!! обхват тоже плотненький , през снимала сама .\nШГ - не пробовал но вроде присутсвует .\nну и кому интерестно практикует МЖМ вот .  что еще добавить . Задорная в целом позитивная телка за вполне разумную плату \nЦВ - 300 грн.', 0, 1361539230, NULL, NULL, 184, NULL),
(473, 'nike', 317, '46.211.122.226', NULL, '[img=фото проститутки]http://img651.imageshack.us/img651/6725/sofiaw.jpg[/img]\nПривет уважаемому сообществу , решил поделится впечатлениями об одном из своих похождений , извиняюсь за каламбурчик , итак София из вполне бюджетной конторы (три сотни укроденег) Фото в целом передает , что представляет из себя девушка , но без лица все же не возьмусь утверждать что оно стопудово принадлежит опробованной мной панночке :) хотя фигура очень и очень похожа . Ну а теперь по порядку \nЧай предлогали , полотенце тоже , деньги вперед . когда шли в поебочную на горизонте промелькнуло и исчезло в соседней комнате еще одно тело блондинистого окраса . Сама девушка сосет нормально , през одевает ртом но помогает руками (поправляет) . Сиськи мягковатые , с небольшими слабо реагирующими сосками , хотя по ходу там все слабореагирующее , в том числе и недоразвитая пимпочка которую и клитором назвать язык не поворачивается :rolleyes: кстати руки туда совать нельзя , писька аккуратненькая в принципе , не мокреет , пользовалась смазкой , причем не жалеючи так пользовалась :D в процессе в принципе послушна делает все что скажешь , озвучка цифровая вяленькая . Сделал два полноценных подхода , время вроде не затягивала , так что девка в принципе неплохая за тристо то гривен .  Когда выходил с поебочной рядом со своими штиблетами заметил исЧо одни говнодавы размеру такого , шо зимой наверное пездато по снежному насту бегать - хер провалишся :lol:\nТТХ - 4\nМН - 4\nКС - 3\nШГ - не уточнял , но вроде нету \nЦВ - 300 грн.', 0, 1361632815, 1361633080, 'nike', 185, NULL),
(474, 'nike', 317, '46.211.127.205', NULL, '[img=фото проститутки]http://i.imgur.com/FvcCu.jpg[/img]\nЗолотая рыбка бля Саша Александра , почему золотая потому что прайс немного завышен как для Харькова , почему рыбка думаю сами догадаетесь . В общем посмотрел очередной раз Лару Крофт , и так захотелось вдруг по силиконовым губищам цюцюркою повазюкать как говорил когда то один мой сослуживец в армии :D созвонился с Лександрой , приехал и немного прихуел , потому в реальности эти самые гудищи были таки губищами а не губками , ну блеать я отступать не привык , доводилось и страшнее ипсти . Встретила в секси прикиде , типо пояс чулки и все такое , выглядит значительно хуже чем на фото , но фото ее .  Дальше помыка и к делу . Обрезинивает руками , минет конечно неплохой с чувством я бы сказал , но увы какого особого прикола от подьепки пластического хирурга не заметил . Немного пососала перешли к наезднице , тут ниче плохого сказать не могу , скачет не филонит , и вообще в сексе довольно податнлива , и послушна без выебонов типа так не люблю то низзя , стонет подмахивает все как положено , старательно отрабатывает бабки вобщем . Второй заход в коленно локтевой тоже не плохо все . Анала не было (хотя вроде есть) \nПодытожу - все довольно неплохо , если бы цена раза два поменьше , даже бы рекомендовал , а так воздержусь , разве что ради галочки  :rolleyes: \nИтого:\nТТХ 4\nМН 5 с +\nМетоимение 4\nШГ - небыло \nотношение к клиенту 5\nЦВМ 800', 0, 1361718620, NULL, NULL, 186, NULL),
(475, 'nike', 317, '46.211.125.93', NULL, '[img=проститутки Харькова фото]http://s41.radikal.ru/i093/1210/61/6d88b2dcc9be.jpg[/img]\nТело было выцеплено на мамбе , сторговались на пиццот гривен , представилась Леной , места своего не имеет поэтому была ебана на дому . приехала довольно быстро , вроде на каком то пепелаце белого цвета (в окно марку не разглядел особо) , ухоженная пригламуренная цаца , надоела видать тому кто содержал ранее , а не работы не специальности не мозгов собственно как всегда в таких случаях бывает , в наличии нету . ну а кушать хотся то . вот приходится делать то что умеет =D\nНаговаривать не буду , фигурка неплохая . сиськи тройка , немного начинают подвисать но тем не менее , талия опять же на месте .  По самому процессу тоже все неплохо . Минетит нормально , могет и без резины с окрестностями . Мокреет  вроде сама , смазкой не пользовалась , сверху скакать не особо любит как я понял , ленится или хер его знает , поэтому трахал в миссионерке и раком , сзади видок зачетный , анал не практикует вроде как (хотя на вид черным ходом пользуются временами) ну в принципе , все так сказать достаточно неплохо , чувствуется опыт фейки в данной сфере . \nрекомендовать в принципе можно . \nИтого :\nТТХ - 4 \nМИ - 5 (как тут себя не похвалишь =D ) \nКС - 4+ \nШГ - нет \nЦВ - 500грн,', 0, 1361789861, NULL, NULL, 187, NULL),
(476, 'nike', 317, '46.211.125.157', NULL, '[img=харьковские проститутки]http://www.despero.net/wp-content/uploads/2013/02/har3.jpeg[/img]\nВот такую симпотичную малую выцепил на мамбе как то , цена в принципе устроила , район дислокации тоже (тогда принимала на Пушкинской сейчас вроде как переехали с подругой на Марьинскую) так вот списался значит . приехал . Дверь открывает миловидное тельце но не совсем то что на партрете выше (оказалось подруга или напарница . хрен их поймеш) вобщем , то се чай душ . вышла завернутая в полотенце . фигурка кластная , молодое крепенькое тельце , грудь двойка с половиной или даже тройка , красивой формы . Начала с обцеловывания , поелозила по члену сиськами , обрезинила , начала сосать , все гуд , душевненько так экспресивно даже . с заглотом нормально , хотя окрестности вниманием обделила . обрезинивает руками . после не продолжительного траха в ротовое отверстие , перешли к класиике , в наезднице шикарно смотрится . и за сиськи мять прикольно , в общем первый раз в наезднице отстрелялся . през сняла сама вытерла салфеткой все как положено . Второй заход начали с мини опять потом поставил на четвереньки , и таким макаром доеб до победного конца , в финале снял през и кончил на жопку . Жалко что нет анала , а то пожалуй вообще было бы супер все . \nИтого :\nТТХ - 5 \nКС - 4 \nМН - 4  \nШГ - нет\nЦВ - 400', 0, 1361799652, NULL, NULL, 188, NULL),
