(479, 'makar', 313, '46.211.182.44', NULL, '[img=фото проститутки]http://totalfuck.info/wp-content/uploads/2013/03/232.jpeg[/img]\nХай други !\nНу что выпала в кои веки то свободная минутка , так что решил ее посвятить на благо обществу . Поделится тоесть своими впечатлениями от посещения сисястой Томы , из собственно небезызвестной конторы . Повелся на большие сиськи и достаточно гуманный прайс в триста гривен . Телка такая присутсвует , тут без наебок со стороны конторы . тело молодое но увы на жопке даже не взирая на возраст уже начинает зарождатся целюлит . дали тапки полотенце сходил в душ . кофе не предлогали , деньги взяли вперед . Теперь детальнее по телу . Даже не взирая на средину дня , выбрал специально что бы меньше было движухи , так вот невзирая на дневное время девка была немного навеселе . Разделась , сиськи реально зачетные , с крупными сосками . През надевает руками не спеша и начинает минетить кое как . Минет реально никакой , я даже больше скажу НИКАКУШИЙ . Нет думаю ну его нахер такое , говорю давай как детка ложись ка ты будем сексится , помял немного ее пельмень , мокреет в принципе сама , смазка не потребовалась вобщем . в мисиионерке немного потрахал , потом посадил сверху так первый раз и доеб . Озвучка - невнятное сопение . Немного полежали , чето пыталась ездить по ушам , потом второй заход . второй раз трахнул раком , особо ничем не отличалось от первой палки , жопка в принципе неплохая такая , не костлявая , но в скором времени пострадает от целюлита как пить дать , задатки апельсиновой шкурки уже начали появлятся . все . сухой остаток :\nМИ- 4\nМН- 1 \nКС- 3\nОтношение -3 (нет интереса никакого)\nЦВ-300 грн', 0, 1362220777, NULL, NULL, 190, NULL),
(480, 'Do_do', 314, '46.211.182.44', NULL, '[img=киевские проститутки фото]http://ib2.keep4u.ru/b/2012/12/04/c8/c8f95a9da8794ce895259793ad5de0eb.jpg[/img]\nОля с оболони , по возрасту где то под сорок , ну покрайней мере я так навскидку определил , внешне присутсвует немного сальца на пузе , грудь неплохая по размеру . наверное тройка , но мягкая , а все остальное так в принципе пойдет . местоимение тоже средненькое , не хоромы но все необходимое присутствует , тапки полотенце , чай/кофе тоже имеются . расчет вперед . Минетит неплохо . чувствуется опыт , немного помогает руками но без фанатизма , окрестности не трогала . По процессу , телка реально заводится и бурно кончает . Между палками разговор поддерживает , но без лишнего груза по ушам . Вцелом можно рекомендовать кто не сильно придирчив к внешности , и возрасту . Довольно старательная бюджетная матурка . Единственное что не понравилось - это десять минут петлять под домом пока она пыталась определить маньяк ли я :D\nОбщие оценки :\nТТХ - 4\nКС - 5\nМН - 4 \nОтношение к клиенту - 5\nШГ - не интересовался \nЦВ - 400 грн', 0, 1362229886, NULL, NULL, 191, NULL),
