(484, 'vovan29', 329, '46.211.182.8', NULL, '[img=PunBB bbcode test]http://i53.fastpic.ru/big/2013/0406/14/c5d671da9fda145b9190172190b34914.jpg[/img]\nШалом славяне ) Хочу поделится своими впечатлениями от посещения Анет . Сразу говорю что это контора , что бы не возникало вопросов впоследствии , даже не отдельная контора собственно а походу просто филиал шалмана на Ванды Василевской , только тут (тут это на проспекте Победы) все не так запущено :rolleyes: работает четыре телки средней красапетовости , хижина тоже ничего приличная , евроремонты и прочая лабуда , даже кулер с одноразовыми стаканчикаами присутствует во как . Ванная тоже вполне достойная , выдают одноразовые тапки (не у верен конечно что они в прямом смысле одноразовые но тем не менее) вобшем к самой конторе претензий нет . Теперь перейдем непосредственно к телке , зовут значит Аней , бывшая массажистка вроде как , ну по крайней мере массаж не плохой сделала . На вид лет 25-26 , сиськи опять же зачетная такая треха , хоть подвисает конечно под собственной тяжестью но мне понравилась все равно , асобенно когда она ими по телу начинает елозить )) Сама девка не напряжная , не грузит , не хамит , старается угодить , может не давно в теме и просто скурвится не успела хрен его знает . През одевает руками . Сосет средненько но окрестности полирует неплохо за это плюс но опыта все же немного не хватает , пытается руками помогать немного . Трогать разрешает везде . Классика особо ничем не запомнилась , делает че скажешь , старается не филонить , в наезднице неплохо наблюдать как сисяндры подпрыгивают в такт )) Так же присутсвует анал кому интерестно там все нормально , тугонько . без эксцессов и неожиданностей . что еще добавить , для камрадов которые пешкадрала помоему недалеко метро . \nВ целом \nМестоимение: 5\nТТХ -4\nКС - 4\nМН -4\nШГ -5 эт да эт понравилось \nМЖМ - не спросил\nОтношение к клиенту - 5 \nЦВ - 600грн', 1, 1365410476, NULL, NULL, 192, NULL);
