(485, 'vovan29', 329, '46.211.120.117', NULL, '[img=PunBB bbcode test]http://i54.fastpic.ru/big/2013/0304/45/9cc949371b20f6902550fd5452541145.jpg[/img]\nНехеровая такая цучка Маронко , выцепил на одном рецурсе специально для жопной епли потому как я это дело полюбляю как вы могли уже наверное догадатся по моему предыдущему отзыву про [url=http://forum.natashaescort.com/viewtopic.php?id=192]Анет[/url] . Телка фотке соответствует целиком и полностью . Довольно стройная . лишний вес отсуствует , да это в принципе и без моих заверений видно . Озвучила прайс в пиццот гривен и пригласила на Позняки , от метро кстати минут пять ходьбы , для безлошадных камрадов (сам такой поэтому понимаю что для некоторых это немаловажный критерий при выборе [b]шлюхи[/b] ) Хата средненькой убитости "единичка", ванная тоже , смеситель дефективный , кран течет ну то такое . По самой девке . Сисько 1,5-2 . Как я уже сказал фотки соответсвую полностью хоть и сделаны скорее все го пару лет назад . Бляди они ж тоже девки , стало быть реальный возраст занизить им половая принадлежность обязывает )) Телка подтянута некрупная . в процесс включается довольно активно обрезинивает руками сосет с огоньком . Дальше классики немного , что удивительно там сохранилась довольно неплохая компрессия как для проститутки , а девка таки не первый год в теме, помнится мне мелькала несколько лет назад на Кудри вроде . После классики перешли к ШГ , за ним собственно и приперся потому как считаю что шлюхи без ШГ вообще и не шлюхи вовсе а подьепка для лохов ))) шучу ) вобщем поставил ее в коленно локтевую и понеслась , но увы после паруминутного жопновдувательства началось нытьё ...\nя ж цуко пришол специально что бы ее блядь в жопу трахнуть а тут начинается у меня уже болит там все бла бла бла . у тебя хер большой ... да какой там большой епт .. короче  не понравилось такое , хотя обхват плотненький . посторонних запахов и встречняков не было , в общем плюнул доеп в классике и свалил . Бабки взяла сразу перед душем . \nТТХ - 4 (вполне приятное тело)\nМН - 4\nКС - 4\nШГ - 3 (сам шг неплох , плохо желание побыстрее его закончить) \nМИ - 3\nЦВ - 500 грн\nобщее отношение двоякое , осадочек какой то остался конвеерный что ли', 0, 1365414880, NULL, NULL, 193, NULL),
(486, 'vovan29', 329, '46.211.120.117', NULL, '[img=PunBB bbcode test]http://img.donetsk-x.com/images/2013/03/28/6.jpg[/img]\nСобственно речь пойдет о конторской девке по имени Ксюха . Приспичило как то вечером кому нибудь присунуть по бырику и не дорого , выбор пал на контору о которой тут неоднократно тисалось [url=http://forum.natashaescort.com/viewtopic.php?id=185]ТЫЦ[/url] [url=http://forum.natashaescort.com/viewtopic.php?id=178]ТЫЦ[/url]  под выше приведенным номером . у конторы точек дофига ваще то  (непосредственно эта на левобережной) по приходу предьявили штуки четыре [url=http://forum.natashaescort.com/viewtopic.php?id=193]проститутки[/url] на выбор , скажем так вполне ебательной внешности . выбрал Оксану , на фотке вроде она хотя лица и не видно , но фигурой очень похожа даже хрень та шо на ней вроде как та же была . Блеать про душ отдельным пунктом упомяну потому как сток в кабинке был практически забит пока мылся натекло чуть ли не по колено воды . как там сами шлюхи моются хрен просцышь . теперь по поводу самой бляди , девка неплохая . даже не ожидал при таком то прайсе , за триста гривен разве что какого нибудь крокодила на подоле выебсти можно кстати про подольскую контору вроде как уже писали [url=http://forum.natashaescort.com/viewtopic.php?id=181]тут[/url] хотя там тоже иногда конечно шмары попадаются интерестные . ну ладно отвлекся . в общем девка старательная фигурка не плохая , но все портит начинающий появлятся живот ЦУКО . минет обычненький без окрестностей , в епле телка не ленится старается подмахивать , озвучка конечно цифра , мокреет слабенько . Первый раз вдул раком . задница гладенькая приятная на ощупь . жалко что жопную еплю не практикует до которой я шибко охочий . хотя хрен его знает может просто не готова была и поэтому в отказ пошла . Второй раз еб в миссионерке , тоже все нормалек правда голову отворачивала временя от времени но эт фигня . Между палками особо не грузит разговорами . в целом можно сходить и еще разок , если душ починят ))\nМИ - 2+ (цуко гребаный слив)\nТТХ - 3+ \nМН - 4- \nКС - 4 \nШГ - вроде нет\nЦВ - 300', 0, 1365421849, NULL, NULL, 194, NULL),
