(488, 'vovan29', 329, '46.211.120.117', NULL, '[img=PunBB bbcode test]http://i078.radikal.ru/1302/05/050912623351.jpg[/img]\nЕще одна бюждетная фейка Лиза . был правда когда то давно , и происходящее вспоминается с бооольшим трудом но тем неменее попытаюсь кое что изложить .  Итак зовут Лизой . Обитает на Политехе . Дама я бы сказал так НЕ ДЕВОЧКА годков чуток за тридцать по ходу. Небольшого роста . реально метра полтора в прыжке )) по фоткам [url=http://forum.natashaescort.com/viewtopic.php?id=194]шлюхи[/url] конечно видно что она не высокая , кстати фотка ее , меня встречала в этой белой комбинации или че это там такое хрен его знает , еще фотка чего не передает так это некоторых проблем с зубами , но как бы мы ж не лошадь выбираем )) Квартира вполне сносная двушка с помывочной тоже никаких траблов не замечено , тапки полотенца дезинфицирующие стредства были . Напоила чаем , кстати время чаепития сказала в общепоебочное время не учитывается , попадаются же таки [b]проститутки[/b] однако )) В процессе достаточно опытная , позы меняет охотно , в общем старается угодить , отстрелялся два раза , между поебками особо жизненными проблемами не грузит но поболтать не против , время строго не сечет . Анала нет увы . Да сиськи небольшие полторашка отсилы но упругонькие такие как и сама фейка . Денег вперед не брала , отдал когда уходил сам . цена вопроса 300 грн. Все . \nОбщие оценки:\nМИ - 4\nТТХ - 4\nМН - 4\nКС - 5\nШГ –  нет \nОтношение:5\nдумаю можно рекомендовать , по соотношению цена качество неплохой вариант', 0, 1365425933, 1365426312, 'vovan29', 195, NULL),
(489, 'vovan29', 329, '46.211.120.117', NULL, '[img=PunBB bbcode test]http://s018.radikal.ru/i508/1303/59/82de1c6cc54b.jpg[/img]\nДрал когда то по этому номером некую Олю, потому Аню (которая на фотках) о ней собственно и весь сказ ) так что номер или конторский или передается от телки к телке как переходящее знамя . так вот по Ане собственно . Списывался на мамбе но сейчас та анкета по которой списывался уже не активна так что прилогать ссылку смысла особого не вижу . Фотко же успел сохранить поэтому прилогаю . фото [b]шлюхи[/b] оригинальное , сама девка по годам лет 24 , весу кило писят с небольшим , довольно высокая по сравнению с описаной мнУ ранее [url=http://forum.natashaescort.com/viewtopic.php?id=195]Лизой[/url] по крайней мере , где то метр семьдесят . Принимала на Позняках , однушка с неплохим ремонтом , в ванной все необходимое , тапки , полотенце . отношение самой телки вроде как доброжелательное , но в то же время чувствуется что ты у [b]проститутки[/b] а не так погулять вышел )) даже чаем не напоили бляди )) точнее не напоила , потому как была таки сама без посторонних . по самому процессу начали с минета резинку напялила на полулежачий йух но цуко быстро довела его до нужной кондиции , сосет нормально , и языком работает и глубоко , вобщем на четверку с минусом скажем так , КС тут с компрессией конечно слабовато , плюс нелюбит наездницу вроде как , поэтому доеб как последнюю сучку по собачьи =D как по мне это просто гнилая отмазка которую практикуют практически все ленивые шлюхи - нах напрягатся легче ж раком постоять представляя что тебя Бред Пит пялит  . Озвучка тоже самое вяленькая цыфра . Анала небыло . Цена вопроса 500 грн.\nТТХ - 4\nМИ - 4\nМН - 4- \nКС - 4-\nЦВ-500 грн.', 0, 1365430681, NULL, NULL, 196, NULL),
(490, 'stasik', 332, '46.211.123.14', NULL, '[img=PunBB bbcode test]http://img.ii4.ru/images/2013/03/17/339919_110644_1_.jpg[/img]\nЗахотелось как то вдуть взрослой тетке , выбор пал на Вику собственно по скольку данная женщина по возрасту в самый раз показалась , годков там по ходу тридцать пять . на самом деле это контора и по сети полно анкет ихних телок , да и точки раскиданы по всему Киеву , Борщага , левый берег , политех , оболонь короче окупировали город аки немчурав сорок втором . При дозвоне диспечер спрашивает где ты есть и пинает тебя на ближайшую амбразуру . Теперь детали меня значит отправили на политех , сама тетка . как не странно фотки [b]проститутки[/b]  оригинальны хотя и запечатлели Вику пару лет назад , сейчас дама потолще будет . Сама же вроде и взрослая тетка но ведет себя так шо писец полный . епется так как будто делает тебе одолжение , если бы такое отношение было со строны какой нибудь двадцатилетней  [b]шлюхи[/b] модельной внешности это было бы еще понятно , но когда прицессу изображают бляди бальзаковского возраста это как то неестественно выглядит , по процессу - сосет так себе , постоянно пытается подключить руки и додрочить , сверху прыгать не хочет , позы меняет с гримасой та ты заебал уже . кончай быстрее и уебывай . Кстати если я не ошибаюсь они работают в паре с [url=http://forum.natashaescort.com/viewtopic.php?id=195]Лизой[/url] у которой спереди не хватает пары зубов . Вот Лиза девка душевная не то что этО . Когда то ее трахал . В общем с горем пополам отстрелялся два раза и свалил , и больше я к этой Вике вжизнь не пойду , хотя и понятно что за триста гривен [b]снять проститутку[/b] с модельной внешностью да еще что бы в жопу еблась , кстати про жопу - тут ШГ нету . хотя жопа сама по себе внушительная \nвобщем сухие оценки : \nМи -4 \nМН -3\nКС -3\nТТХ -3 \nШГ -НЕТУ\nЦВ - 300 грн.', 0, 1365497473, NULL, NULL, 197, NULL),
