(497, 'voland', 333, '46.211.182.129', NULL, '[img=PunBB bbcode test]http://img13.imageshost.ru/img/2012/11/09/image_509d50cab1ed6.jpg[/img]\nЕще одна Карина , которую мне недавно довелось посещать . о предыдущей я писал [url=http://forum.natashaescort.com/viewtopic.php?id=202]ТУТ[/url] только эта Карина , о которой я буду писать в этом топике трудится в небезызвестной [url=http://forum.natashaescort.com/viewtopic.php?id=172]подольской конторе[/url] так вот был конец трудового дня и рыскать по тырнетам в поисках чего нибудь нового и не изведанного было откровенно говоря влом . поэтому выбор на это заведение в силу его расположения по пути следования на базу . Хата там неплохая на два уровня . в полуподвале возле душевой вроде как даже какое то подобие сауны наблюдалось . отдельный плюс за наличие хлоргексина . Показали несколько тел на выбор - выбрал Карину . Сполоснулся и в койку значит , начала с какого то подобия стриптиза плавно перетекшего в минет , сосен как то монотонно без изысков . и не очень глубоко , окрестности тоже не жалует . потом перешли к классике . в сексе тоже ничего необычного , все довольно монотонно , но старается , стоны все этит наигранные присутствуют . Что еще следует отметить - то это злоупотребление салидолом блеать , вот уж чего чего а смазки не жалеет . трахал в миссионерке , и в наезднице и раком , последний вариант понравился больше всего , задница неплохая такая , в таком ракурсе первый отстрел и произошел . Презик сняла сама вытерла все влажной салфеткой . Предложила в перерыве сделать массаж . согласился . массаж в принципе пойдет , хотя я конечно в этом не особо шарю да и не любитель по правде , так пару раз мяли спину по пьянке в каком то салоне , так что сравнить честно говоря не с чем . Вобщем помяла немного спину то се потрындели немного . подняла младшего на второй раз , второй заход собственно не особо отличался от первого все добротненько старательно но не более того , душевности не хватает )) Отстрелялся сполоснулся и свал