(498, 'voland', 333, '46.211.182.129', NULL, '[img=PunBB bbcode test]http://ib2.keep4u.ru/b/2013/02/15/5d/5db39577c316e86f4de6a17166283e88.jpg[/img]\nДаме лет тридцать пять на вид . фигурка сохранилась на уровне , обитает на Березняках . походу индивидуалка , потому как никого постороннего по приходу обнаружено не было . В хате чистенько уютненько , на блядюжник сьемный не похоже поэтому вполне допускаю что принимает на дому . Встретила в джинсах и футболке вроде ну или чето такое , непомню если честно уже . проводила на кухню напоила чаем . девка распологает к себе скажем так . Дальше была помывка - тут следует особо отметить то что Яна сама принимает в этом процессе активное участие (имеется в виду собственноручное омовение клиента) гели шмели чистые полотенца все как пологается . Сама телка как я писал не студентка конечно но вполне на уровне сохранившаяся барышня , сиськи двоечка , жопка тоже без всяких целюлитов и прочеих траблов . Начали с минета , сосать таки умеет с окрестностями, на полную длинну, вобщем зачетно и без резинки , поэтому испугавшись что не выдержу такого напора и отстреляюсь раньше положенного остановил предложением переходить к основной программе . обрезинила по бырику запрыгнула на верх и поскакала , пару раз смена поз . без возражений и напряга . послушна активна в процессе . Второй заход тоже начали легко и не принужденно , с минета без резинки , предупредила что сперму не глотает , поскольку изначально договаривался про анал предложил перейти к данной опции , достала смазку и вперед значит . все тугонько без "сюрпризов" понравилось короче . но тоже жопную еплю практикует не всегда . так сказала по крайней мере . вот собственно и все . \nТТХ - 4 \nКС  - 4\nМН  - 5\nОтношение к клиенту - 5\nШГ  - 5\nЦВ - 500 (+200 ШГ)', 0, 1365598104, 1365598721, 'voland', 204, NULL),
(499, 'voland', 333, '46.211.182.129', NULL, '[img=PunBB bbcode test]http://s017.radikal.ru/i410/1302/67/76d62c4f348c.jpg[/img]\nКак зовут не помню по моему Лиля , да собственно это и не важно , найдена на желтеньком блядосайте который минуэт , можете кидать в меня тапками конечно но вот потянуло на такой сухостой хоть плачь , по этой конторе на красноармейской уже имеется парочка отзывов вроде  \n[url=http://forum.natashaescort.com/viewtopic.php?id=194]http://forum.natashaescort.com/viewtopic.php?id=194[/url]\n[url=http://forum.natashaescort.com/viewtopic.php?id=185]http://forum.natashaescort.com/viewtopic.php?id=185[/url]\nно по этой шмаре пока не писали значит пусть будет . Сбегал по быстрому сполоснулся , правда пока раздуплился как ебанутый душ включать аж вспотел :D позвать кого то на помощь не рискнул , стыдно епт )) телка пошла после меня . деньги отдал сразу . перешли к процессу . сосет никак ну тоесть че то там елозит . ко всему прочему резину пытается натянуть на еще лежачий член . блеать это шо то с чем то . чуть не заржал ))) Потом перешли с классике , от тут впервые пожалел что не взял кого нибудь погабаритнее , раком вид костлявой жопы убивает все желание , в наезднице своими костяшками давит , короче как ее епсти хер ее знает . по всякому неудобно . озвучки никакой . вялое сопение с устремленным вдаль взглядом , в общем с горем пополам кончил . Тело сьебалось в душь вернулось минут через пятнадцать (весьма не навязчивый способ которым бляди пользуются что бы потянуть время надо сказать) молча улеглось рядом . цука ну вот че с ней делать хер его знает . Попытки разговорить как то успехом не увенчались . ну думаю хрен с тобой . давай ко второму заходу приступим шоле . нехотя надела през , опять на полустоячего бойца ... дальше собственно описывать что то смысла нет , с горем по полам отстрелялся и свалил . Да в процессе когда набрал обороты услышался неприятный запах из песды . Про анал честно говоря не спрашивал .\nМи - 4 если закрыть глаза на уебищны