(500, 'voland', 333, '46.211.182.129', NULL, '[img=PunBB bbcode test]http://img13.imageshost.ru/img/2012/12/22/image_50d4d264e6f2f.jpg[/img]\nПо этому номеру тоже уже отзыв есть [url=http://forum.natashaescort.com/viewtopic.php?id=181]http://forum.natashaescort.com/viewtopic.php?id=181[/url] и как я понял речь идет об одной и той же конторе . Но раз девка другая то все же расскажу что она из себя представляет дабы довелось мне погонять лысого между этими сисяндрами . Зозвонился дали адрес на Андреевском , встретила девка с фото . Представилась значит Русланой выдала полотенце средней свежести отправила в душ . душ вроде в порядке ,  сполоснулся и перешел к процессу так сказать . чуток помял сиськи , хули мимо таких буферов не пройдешь однако , боец напрягсе и был обрезинен . Дальше непродолжительная миня , сама телка какая то зажатая , и безинициативная , вобщем помучила она немного бойца орально , перешли непосредственно к вагинальной случке , разложил ее на траходроме и вдул , освучка сдержанное сопение , никакого подмаха - тупо сисястое бревно , немного попотел в миссионерке портахал между сисег чисто для галочки блеать там и выстрелил . Полежали немного , телка на контакт не идет чисто на своей волне . настроение вообще пропало , плюнул ушел . Деньги отдавал сразу триста гривен , про анал не спросил но думаю что х8й там . Рекомендовать не буду . хотя кто его знает может то я просто ей не приглянулся а с другими она агонь )) \nТТХ - 5 сиськи таки зачетные тут не поспоришь , лицо конечно простенькое но не страшная \nМН - 4\nКС - 3 \nШГ - не спросил, но думаю нет \nЦВ -300 грн.', 0, 1365605531, NULL, NULL, 206, NULL);
