(501, 'Мегапихарь', 336, '46.211.120.3', NULL, '[img=PunBB bbcode test]http://ebiteua.com/extensions/hcs_image_uploader/uploads/70000/6500/76643/p1763hvi2tnvh2socmf16d1l7i3.jpg[/img]\nАнЁ найдена сырым апрельским утром на желтеньком сайте где бляди песдами барыжат , выбрана была в силу своей ценовой политики 300 грн. палкочас, и частичной ебабельности , говорю частичной потому что ебабельность ебалища прошу прощения за каламбур оценить не представлялось возможным :rolleyes: в реальности потом оказалось что с фейсом в принципе все нормально (для трех сотен конечно) . Обитает персонаж на Саксаганского . жилплощадь гуд , или я бы даже сказал вери гуд , достаточно уютненько чистенько , по домашнему цветочки , рыбки все дела . Сама девка  не уродина , сисько неплохие в районе тройки , сама ладная , личико конечно простоватое , не графское точно , но повторюсь не страшная . Единственный минус это "беременный" живот - ну портит всю идилию цукааа . Девка пиздливая  по ушам ездить любит , йух его знает может время просто так тянет , но вобщем нудно вовремя останавливать что б не увлекалась :/ Тапок в хозяйстве нет , не знаю как сейчас но по крайней мере когда я был то не было . с полотенцем все нормально . чистое сухое , БОЛЬШОЕ ) \nПо процессу:\nТрется сиськаме по всему телу абцеловывает . Минетит неплохо , хоть и не глубоко , окрестности не чипае , ну тоесть чипае ток руками ... за яйки , типо ласкаить :p Сама вроде ка иптсо любит с ее слов , и таки в секасе активна скачет сверху  подмахивает раком , активно мокрееть в процессе . с озвучкой правда не скажу точно , не стонать стонет но как то сдержано . В миссионерке обшимает прижимаетсо все дела . . Основное отверстие я бы сказал не совсем ведро . компрессия присутсвуеть . Сделал два стандартных подхода к "снаряду" , с черного ходу не пустила :|\n\nТТХ - 4 (трошки лишнего весу таки есть . живот опять же неэстетичный мля) \nМесто имения - 5\nМинет - 4\nКС - 4\nОтношение к клиенту - 5\nШГ - недала\nЦена вопроса - 300 грн.', 0, 1365754362, NULL, NULL, 207, NULL),
(502, 'Мегапихарь', 336, '46.211.124.192', NULL, '[img=PunBB bbcode test]http://s019.radikal.ru/i600/1301/8c/c75d8b3e65fc.jpg[/img]\nДаша с "улицы красных фонарей" :D по старинке именуемой Броварским проспектом . Тело фланировало с подобным организмом в сторону метро Лесная , одето было в синюю куртку юбку какие то сапожки или туфли уже и не помню. Притормозил подошли - спросил по чем . Было озвучено классика 300 миня 200 . Тело молоденькое по ходу лет двадцать не сильно страшное , говорю годится прыгай в пепелац . отъехали в укромное место перелезли на зандее сиденье . значит потискал ей сиськи малехо что бы боец поднялся , приступили к мине . без резины если честно не рискнул . пососала немного ощущений бля никаких , давай говорю снимай лучше трусы будем трахатся а то так не кончу и до следующих выборов президента которые в пятнадцатом году )) ну сняла труселя ноги в потолок уперла - ипи мол . Смазки ноль , на гондоне ж там ее почти нет не хера . сама не мокреет . блядь но все же кое как присунул . хрен его знает или песда там узкая совсем или просто потому все туго так было , вобщем с горем пополам но доеп . Ясен пень не о каком втором разе разговора небыло . про анал [url=http://forum.natashaescort.com/viewtopic.php?id=204]анал[/url] даже заикатся не буду . Ощущения никакие . Отвез где взял . отдал деньги и уебал на базу . Пока еб тело спрашивало ну что ты скоро там . цуко придушил бы . да жалко что пацифист ))\n\nИТОГО:\nТТХ - 4 \nКС - 2\nМН - 2\nОтношение - 3 \nШГ - нет\nЦВ - 300\nрекомендовать не осмелюсь , но если кто надумается то хоть шприц с салидолом из гаража прихватите )))', 0, 1365771581, NULL, NULL, 208, NULL),
(503, 'Мегапихарь', 336, '46.211.124.192', NULL, '[img=PunBB bbcode test]http://img803.imageshack.us/img803/9631/20130105174243.jpg[/img]\nА эта блеать Катя . обитает на Артема . Пиарится на укргоу незнаю стоит ли кидать линки на саму обьяву или хватит телефона ... Думаю обойдемся без аригинала обьявы .\nОтчет : \nВобщем списался на мыльницу оставила тел. перезвонил назвала координаты . припиздил . Блядюжник достойный че тут греха таить ремонты хуенты все на уровне , в хате присутствовала еще парочка организмов весьма не дурственной внешности , но заявленное КатЁ тоже имело место быть . Был напоен чаем , и отправлен на помывку . еще бы цуки чай за жали за такие бабки (оговоренная цена штуцер гриваков) да вот такой я лох блеать , ну захотелось чего то возвышенного . не все же блядей с броварского  типо [url=http://forum.natashaescort.com/viewtopic.php?id=208]Даши[/url] драть за триста гривен в пепелаце\nПо телке \nНа фото конечно ракурс такой что телка выглядит повыше . в реале там метр шестьдесят хдето , я то сам стосемсятпять см она на десяток см пониже . Личико конечно какое то ... бля вспомнил вампирское из сериала моей юности про Баффи ебашильницу вампиров )) сиськи неплохие хоть и подвисшие чутарик (твойка по ходу) \nМиня так сибе , впринципе не плохо но однообразна , на миню без гумки не согласилась . ну и хер с ним .\nВ классике нормально тоже . мокреет сама , озвучка почти естественная , не переигрывает короче . довольно активно все .\nАнал не заявлен \nОтношение позитивное , без хамства , надменности , или отстраненности .\nПойду ли еще ? \nСходил бы если бы прайс опустили . а так ну его нах . хотя все реально неплохо было . \nМИ - 5\nМН -4 (неплохо . но бывало и лучше)\nКС - 4 \nШГ - нет \nЦВ - 1000 \nОТНОШЕНИЕ - тут все в норме', 0, 1365776456, NULL, NULL, 209, NULL),
(504, 'Мегапихарь', 336, '46.211.124.192', NULL, '[img=PunBB bbcode test]http://www.top-modals.com/files/6515/v2.jpg?16[/img]\nКонтора на Горького 125  девку заовут Ирина . поюзал поиск тут этой конторе пару темок есть \n[url=http://forum.natashaescort.com/viewtopic.php?id=198]http://forum.natashaescort.com/viewtopic.php?id=198[/url]\n[url=http://forum.natashaescort.com/viewtopic.php?id=190]http://forum.natashaescort.com/viewtopic.php?id=190[/url]\nтак что даже не знаю как правильно отдельной темой или к преждним дописывать . наверное начну отдельную тему для отдельной телки . \nитак Ирина . Фотка ее . Девке под тридцать (28 или 29 чето такое) грудь слегка поюзанная конечно но пожмакать все еще приятно . Девка пока еще не заебанная контоскими буднями свеженькая веселая . Встретила в секси прикиде . в душ сходила до моего прихода . что приятно удивило обычно телки уябывают в душ что бы спиздить минут десять камрадского времени . выдала полотенце отправила в душ . По быстрому помыл прибамбасы . \nНачали с мини .\nСосет собственно на уровне , старается . но проскакивают зубы . и временами помогает руками . окрестности не жалует особо . \nПерешли к классике . Посадил верхом . Скачет неплохо , Сиськи помял немного , переложил в миссионерку так поеб немного . озвучка хоть и цифра коенчно (ну не верю я в аналог у фей) но в рамках разумного , не немецкая порнуха скажем так . Отстрелялся в позе сломанной березки . през сняла прибор салфеткой вытерла все как положено . потом ненапряжный межпалочный треп , попытка сделать вяленький массаж плавно перетекшая во вторую палку . Второй заход тоже неплохой . Телка не филонит . Наверное не давно в конторе и еще не испортилась .\n\nИтого:\nТТХ: 4\nМИ- 4 (поменьше там народу)\nКС: 5-\nМН:4\nШГ-неспросил \nОтношение-5\nЦВ: 300 грн.', 0, 1365778234, NULL, NULL, 210, NULL),
(505, 'Мегапихарь', 336, '46.211.124.192', NULL, '[img=PunBB bbcode test]http://img687.imageshack.us/img687/9886/webimg8633.jpg[/img]\nЭхххх нехотел делится ибо реально классная телка , ну да бох с ним , надыбал Лену на мамбе когда то давно , приглянулась . то се - озвучила цену сто убитых енотов , точнее 800 грн. Надо честно сказать что одетой Лена выглядит на эти восемь сотен . но без одежды все печально достаточно . грудь висит . живот проблемный с растяжками . это что бы быть до конца честным . но вот по самому процессу девка зачетная . согласен пару сотен ей на ТТХ скинуть не помешает но шо маемо то маемо как говорят у нас на Украине . \nПо процессу :\nНачало с минета , сосать она таки умеет , без б . любая поза глубина без вопросов . Прикольно разложив ее на спину тупо трахать в рот - все без вопросов и возражений . Кстати повернутым на гигиене - девка даже рот полоскает какой то какоУбивающей хренью . \nКлассика в принципе тут все тоже на уровне . активно с подмахиваниями стонами , обнимашками блеать и прочей хуетой .  \nАнал тоже зачетный ни каких встречняков или неприятных запахов не разу не обнаруживалось , хотя пер ее туда не однажды . согласен может не так плотненько как у некоторых девок но тем не менее . все без лишних возражений типа то не хочу то не буду , в любой позе . \nВ общем достаточно опытная телка . для неспешного качественного перепихона под рюмку винца . вот .\n\nИТОГО : \nТТХ - 4- (есть проблеммы конечно)\nМИ - 4\nМН - эта 5 \nКС - 4 ( компрессия не та уже конечно)  \nШГ - 5 \nЦВ - 800 грн. \nП.с. Шибким эстетам рекомендую не снимать лифчик', 0, 1365780065, NULL, NULL, 211, NULL),
(506, 'Do_do', 314, '46.211.122.145', NULL, '[img=PunBB bbcode test]http://s49.radikal.ru/i125/1304/12/d5a6691ebb2d.jpg[/img]\nОбитает на улице Васильковской зовут Соней . Фото прилогается , хоть и не информативное зато оригинальное . ТелкО реально симпотное , когда открыла дверь я реально немного подохуел . не ожидал при таком прайсе увидеть шото реально достойное . Тельце выставляет себя в роли [b]индивидуалки[/b] но я чето сильно сомневаюсь что это так . Кстати раньше фейка работала в конторе за 400 грнивен . Так что думаю что просто сменила хозяев не более того .\nСама телка не сильно высокая , смуглая , фигуристая , сиськи двойка на вскидку .\nДальше немного негатива - тапок не дали , полотенце явно пользованное , причем не так давно до моего прихода , высохнуть не успело . По процессу начали с вяленького минета . Ощцщения никакие . Реально вроде и делает там чето но ощущений ноль . говорю не так дело не пойдет давай наверное к классике переходить . Без проблем залезла сверху немного попрыгала , потом положил на спину еще немного потрахал, ну эмоций ноль в общем . \nМежду палками уставилась в телевизор . на меня ноль внимания , ощущения шо писец - реально не в своей тарелке . \nПопытался разговорить , односложные ответы да нет незнаю . На предложение сделать массаж нехотя помяла спину . Кое как с горем пополам возбудился рассматривая нехуевую фигуру , отстрелялся второй раз и ушел в расстроенных чувствах . Незнаю ленивая она или просто не попал в настроение но сам больше не пойду . Наивный думал за триста гривен лафа будет . Лучше б добавил сотку да еще раз к  [url=http://forum.natashaescort.com/viewtopic.php?id=191]Оле[/url] сходил \nМИ - 4\nТТХ - 5 (тут все нормалек че греха таить) \nМН -3 \nКС -3\nШГ - нету\nотношение к клиенту 3-', 0, 1365852576, 1365852789, 'Do_do', 212, NULL),
(507, 'Do_do', 314, '46.211.180.229', NULL, '[img=PunBB bbcode test]http://ib3.keep4u.ru/b/2013/01/20/be/be17535de0688c10c50d71724fd1b4a0.jpg[/img]\nТетка известная своими немаленькими сиськами , которые к сожалению не устояв пространство временному контилиуму и земной гравитации начали постепенно ползти вниз . Принимала в разных местах последний раз я был минутах в десяти пешей ходьбы от метро Лукьяновская . Жилплощадь вполне пристойная , неубитая ванная в которой присутсвуют все необходимые для омовения причандалы . Но все же давайте по порядку . значит созвонился , оговорили опции время стоимость . За классику озвучила цену в четыреста гривен . МБР +200 , ШГ +400 . Ну или 800 и по турецкому принципу все включено . Хер с ним давайте с жопой ! :D\nВстретила в корсете комбинации на каблуках , вполне епабельная сорокалетняя тетка . По поводу ее индивидуальноти утверждать не буду конечно на сто процентов , но и при созвоне общался именно с ней . и никого постороннего на жилплощади не наблюдал , и в спину никто не дышал в плане твое время вышло уябывай а то под дверью очередной камрад завис .\nДальше отправила в душ , предложила типо помыть но я отказался , не люблю такой хрени , так что плескался в гордом одиночестве . Вышел спросила за деньги - отдал , съебнула сама в душ , была не долго . пришла начала ластися поглаживать , поскольку сразу было оговорено про программу все включено , начали с МБР . сосет впринципе неплохо , пытается заглатывать по самые памидоры, их кстати тоже не сильно но полирует . Достойный миня в общем . Дальше была классика, надо признать хоть сиськи там и здоровые но когда епеш ее на спине то ани растекаются блать и выглядят неэстетично , поэтому бысто была поставлена раком и так доебана . Озвучка цифра , компрессии практически нет это минус . никах посторонних запахов не унюхал хотя конечно носом в песду не лез . \nВторой заход впринципе все тоже самое но был опробован анал, тоже все технично без неприятных моментов , опыт чувствуется . \nИТОги : \nТТХ - уже не то (4-) грудь хоть и неабьятная , но висит живот немаленький \nМИ - 4 \nМИ 4+\nКС -3 компрессии никакой и вообще как то без энтузиазма \nШГ -4 \nЦВ - 800 за все допы', 0, 1365939736, NULL, NULL, 213, NULL),
(508, 'Do_do', 314, '46.211.127.95', NULL, '[img=PunBB bbcode test]http://ebiteua.com/extensions/hcs_image_uploader/uploads/70000/6500/76614/p175uilp7c1opuagu1l28vbu1v854.JPG[/img]\nПерсонаж обнаружен на мамбе после недолгой переписки был оставлен телефон . по которому уже непосредсвенно получены координаты на Русановке, улица Энтузиастов .  Зовут персонаж вроде Кариной . Работают вроде как напару с подругой , подругу не видел , дверь открыла девка с фото насколько можно судить по фигуре и сиськам . В боевых доспехах и раскраске, личико симпотичное в принципе , но с каким то "восточным оттенком" шоле, фигурка тоже не плохая . Деньги отдал вперед ( 600 грн.) выдала полотенце большое сухое и чистое , а вот тапок увы нет .  В общем техническое оснащение на слабенькую четверочку скажем так. \nТеперь дальше . Карина выглядела немного скованной или мне так показалось , но тем не менее до конца так мне ее "расшевелить" не удалось увы . Минет был честно говоря слабоват , не глубоко, без окрестностей , если не брать во внимание масирование помидоров нЭжными дамскими пальчиками :D \nВ классике более менее , двигается активненько , скажешь скакать скачет , потом сбавляет темп и начинает елозить сверху , ее фишка по ходу это присевшая на корточки наездница )) Стоны кое какие присутствуют , предпологать что аналоговые даже не буду не на столько наивен . \nВторой заход инициировала сама . Бойца поднимала сиськамЕ , през одела ртом . Трахал в миссионерке и между сисег , потом поставил в коленнолоктевую и так пристрелил.  Сзади тоже видок не плохой . Молодая крепенькая жопка без всяких целюлитов . "Черный ход" не пользуют , вернее меня не пустили , но на вид вроде как паутиной не покрылся )))\nТТХ  - 4 \nКС  - 4\nМН  - 4-\nОтношение к клиенту - 4\nШГ - не заявлено \nЦВ  - 600 \nЕще один номер 8(063)264-70-59', 0, 1365942033, NULL, NULL, 214, NULL),
(509, 'Do_do', 314, '46.211.126.9', NULL, '[img=PunBB bbcode test]http://ebiteua.com/extensions/hcs_image_uploader/uploads/70000/6000/76080/p174n0905f8jrfhhvlt13s219k91.JPG[/img]\nДелать было не чего дело было вечером ... \nСписался с данным организмом по имени Камила списался на мабе , в анкете были левые фотки истественно , но барышня призналась что фото типажное (то что сверху я нарыл в личном архиве , так как когда то давно эта барышня уже мелькала на моем горизонте правда тогда она была толи Валерией толи Викторией) \nПригласила на Чоколовку . \nпо приезду сразу узнал, но поскольку какова барышня в епле помнил смутно и сама впринципе достаточно епабельная , то остался, росту не высокого , миниатюрная такая . По возрасту лет тридцать .\nСходил в душ по быстрому , ванная грязная была цуко , но кое как сполоснулся . Тапок небыло.\nТеперь по процессу \nСосет телка довольно не плохо . Заглатывает по самые немогу. Про минет без резинки не спрашивал . Ну пососала чуток , хули с той мини в резине понту , говорю давай сменим приоритеты )) Запрыгивай сверху - запрыгнула поскакала не долго правда . Устала . Хрен с тобой ложись на спину поехали дальше . Ну что сказать девка пялится за бабки лет пять минимум так что песда растянута мама не горюй а если еще учесть что фея смазки туда запихала добрых полкило, то ваще все со свистом . Вобщем еп еп . Заепался уже а долгожданного эффекту нет сука . Думаю может ее раком поставить - поставил . Ну так выглядит неплохо . Жопка махонькая такая . Нормалек вобщем застрелил . Полежали немного , попытался пообщатся немного , как то все натянуто . \nДумаю спрошу мол может хоть в жопу удастся присунуть а то в это ведро второй раз точно не кончу . Хуй там . \nНу тогда думаю надо собиратся хули . Расплатился ушел . Больше не пойду . хотя явного негатива конечно нет . Но все равно .\nТТХ 3 \nМИ 4 (- за грязную ванну)\nМН 4 (нормально в принципе но на пять не тянет все же) \nШГ - хуй\nЦВ - 400 гривен', 0, 1366034821, NULL, NULL, 215, NULL),
(510, 'Do_do', 314, '46.211.122.165', NULL, '[img=PunBB bbcode test]http://ib2.keep4u.ru/b/2013/01/03/7e/7e7f7855e9003be9e780e5b53ea0a1e5.jpg[/img]\nРусланко цука , не путать с этой [url=http://forum.natashaescort.com/viewtopic.php?id=206]Русланой[/url] хотя и обе сисястые )) но тут побольше . Так вот повелся на агроменные сисьманы , это да сисьманы там реально зачетные , незнаю действительно ли седьмой размер , я не лифчиками торгую что б без штангельциркуля такое дело определять , но таки большие . нашел на блядосайте , Фотко конечно старое тут без вариантов потому как телка явно на десяток кило больше , хотя и на фотке не маленькая . В общем созвонился сказала подьезжать на Довженка . По приезду бул впущен на бесценные киевские квадратные метры . Метры оказались вполне достойные , не вип класса конечно но все по божески . \nПредложила кофе , попили покурили . Девка курит если че . Сходил в душ . Тапки чистое полотенце дала . \nНачала с средненького массажа (ее инициатива) , когда руки начали массажировать младшого и он встал , перешли к более активным действиям - миня трах между сисег отстрел туда же .\nОпять не продолжительный перекур , подьем волшебной палочки , и атская епля . Телка невзирая на все свои габариты в процессе довольно активна , епется с огоньком , епсти конечно лучше всего раком , ну или между сисег кто любитель . \nПро анал вроде рабочий но я не пробовал , основное отверстие вмеру раношено . Никаких запахов не наблюдал да и не принюхивался особо . Для тех кого танком не испугаешь, можно рекомендовать . Тут хоть и не 60 тон но тоже не хуй собачий )) \nИТОГ:\nТТХ - 3\nМН - 5 \nКС – 3 (лишний вес мешает таки)  \nШГ - есть\nМИ-  4\nЦВ 400', 0, 1366039992, NULL, NULL, 216, NULL),
