(512, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'Тоже был у этой Карины , то что они на пару с подругой работали полностью подтверждаю , фигурка неполохая у карины . лицо какое то армянское типо , но не страшное а просто типаж такой что ли . По процессу только как по мне девка немного ленивая , незнаю может До_де повезло что она от спячки проснулась , толи на оборот мне НЕПОВЕЗЛО и она еще НЕПРОСНУЛАСЬ . но как было так и говорю - девко ленивое , но разок другой вдуть конечно можно . Сейчас правда вроде с подругой разбежались по какой то причине . \nа про ссылки камрад scruffy незнаю может у До_до свежая и есть , но помоему они их бьют через день , ну или админы мамбовские . Кстати и с телефоном там тоже траблы какие то были , незнаю этот или нет но какой то менялся . Может когда разбежались поделили )))', 0, 1366102179, NULL, NULL, 214, NULL),
(513, 'Бешенный огурец', 338, '46.211.125.208', NULL, '[img=PunBB bbcode test]http://ib2.keep4u.ru/b/2013/03/04/0d/0da5d2af9810124ca761673ac14ae86b.jpg[/img]\nИтаг Таня с Подола , как я понимаю вообще это известная контора , только здесь по этому номеру бьется парочка тем . хоть и с другими телками \n[url]http://forum.natashaescort.com/viewtopic.php?id=206[/url]\n[url]http://forum.natashaescort.com/viewtopic.php?id=181[/url]\nПо приезду собственно обнаружено кроме данной Татьяны еще парочка тел , но я собственно ехал к ней поэтому ее и выбрал . Про сам "притон"- вполне пристойное двух комнатное (вроде) гнездилище разврата с нормальным ремонтом . ванная тоже нормуль . Выдали чистое полотенце отправили в на омовение . Поебочная немного улыбнула , в красных тонах , блять не знаю как у кого а у меня только от одного крастного цвета член не поднимается , может потому что я автолюбитель , для меня красный цвет значит СТОЙ ЦУКО И НЕ РЫПАЙСЯ \nНу ладно по девке подробнее , телка неплохая свеженькая не заюзанная , фигурка такая крепенькая подтянутая , личико симпотичное , сиськи 2.5 походу тоже упругие молодецкие )) \nНачинает с поглаживаний , обцеловывание , обрезинила ртом но помогая руками , сосет неплохо , но окрестности не трогает , в классике подмахивает , прыгает когда сажаешь сверху , смазка своя вроде , ну по крайнее мере при классике я не заметил что бы чем то мазюкала не мой писюн не себя . Когда перешли к аналу то да . ШГ зачетно тугонько все чистенько , правда с жопой на двести гривен дороже но попец там такой что реально трудно устоять и не заехать . Между палками разговорами не грузит , если че спросишь отвечает конечно, но все без напряга . Ну вроде ничего не забыл .\nТТХ - 5 мне понравилась \nМИ - 4 \nМН -4 \nКС -4 \nШГ - 5 \nЦВ - 500 с жопой и 300 без вроде)', 0, 1366104436, NULL, NULL, 217, NULL),
(514, 'Бешенный огурец', 338, '46.211.125.208', NULL, '[img=PunBB bbcode test]http://s017.radikal.ru/i424/1207/e1/f527fc8ead50.jpg[/img]\nКонтора на Староноводницкой . Квартирка в новом доме с нехуевым таким ремонтом , в общем с претензией блядюжник если можно так выразится . Созвонился назвали координаты приехал . Предьявили парочку тел на выбор . Выбрал Машу на фотку впринципе похожа так что очень может быть что она . Девка миниатюрная с такой мелкой сиськой единичкой походу .  Выдали полотенце и одноразовые тапки (таки запечатанные) я аж прихуел от неожиданности , хотя допускаю что первым клиентом в тот день был ) По ванной нехер расписывать собственно краны смесители не текут , ванная читая .\nТеперь по процессу . Телка не айс . Потерлась об меня чуток сиськами , подняла егн  . Обрезинила кое как руками , Минет тоже кое как , мучилась ну или меня мучила пару минут , думаю ну его нах такие мансы - разложил в миссионерке , цуко смазки ноль , писько хоть и не убитая в хлам но епсти практически в сухую это шото с чем то . Озвучка ваше пипец , какое то монотонно порнушное да да не останавливайся , не то что не заводит а вызывает желание придушить подушкой )))\nОтстрелялся первый раз сходил в душ . А да деньги ж сразу отдал при входе . В общем вернулся с душа попытался разговорить девку . Общаюсь и понимаю что она либо реально какая то заторможенная либо дозировку какого лекарства перепутала, ну или что уже совсем фантастический вариант то под какой то дурью . Вот тут бы взять как порядошному джентльмену и свалить нах , а нет хохол же до мозга костей , жаба давит же суко , деньги уплачены . говорю ну его нах ты или ищи какую нибудь смазку или я сбегаю у меня в багажнике пепелаца шприц с салидолом валяется (незнаю правда нах он там) перевозил из гаража всякий хлам и забыл выложить наверное . Ну нашла какой то тюбик с гелем , положил я ее на край кровати и сзади вздрбчил , сзади видон ахренительный ваще , подумалось может взят да в жопу под шумок запердолить , может не заметит если угашенная , но совесть не позволила . Потому как анал вроде не юзаный .\nТТХ  4 \nКС: 3\nМН: 3-\nМи - зачетная хата 5\nШГ: нету вроде \nЦВ: 600 гр', 0, 1366106797, NULL, NULL, 218, NULL),
(515, 'Бешенный огурец', 338, '46.211.125.208', NULL, '[img=PunBB bbcode test]http://pix.am/qk5b.jpg[/img]\nИзяБелла блин . Начну с того что собственно белла не одна в с компанией других Б... Контора в общем . Хата времен застоя , ванна тоже достаточно в плачевном состоянии , тапки хоть и выдали но я как то не рискнул их одевать , потому что мокрые были . Полотенце сухое наговаривать зря не буду . Теперь по самой Изе . Фотка . допускаю что ее , ноооо фотографа который ее делал скорее всего убило тем самым метеоритом что и динозавров . Старое фото кто не понял . \nСиськи впринципе реально большие но уже потеряли свою так сказать привлекательность и серьезно подвисают. Тея опытная конечно против этого не попреш , завести умеет , начала с поглаживаний , прижимашек , обцеловывания , надела през . Сосет неплохо , с окрестностями , в меру глубоко , время от времени вынимает хуй изо рта и гоняет его промеж сиськами . Потом перешли к классике . Пер ее и по собачи и на спине . Основное отверстие - разношено до безобразия , ощущения никакие . Типо шо епеш шо радио слушаешь . Но все же отстрелял как бы то нибыло . Сняла през , дала салфетку . Полежали чуток . Потому опять начала с поглаживаний , я тоже собственно поддержал инициативу ,  помял немного сиськи . Ну и пошли на второй заход. \nВторой раз цуко от классики кончить так и не вышло нехера жотя и потел бля минут двадцать , она видно тоже заепалась уже , сняла през намазала гелем хер и между сисег его между сисег ))) Так и отстрелялся блеать . \nНезнаю рекомендовать не , сам больше конечно не пойду а камрады пусть сами решают . Девка конечно может и не идеальна но в принципе не хамоватая и исполнительная . В общем сами батенька сами ...\nТТХ -3\nМИ -3 \nМН -4\nКС -3 \nШГ - не спросил но думаю да \nЦВ - 400 грн.', 0, 1366113528, NULL, NULL, 219, NULL),
(516, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'ой да я ж ее знаю .... в смысле довелось как то посещать данное заведение , под сильным шафе . Девка шире чем на фото однозначно . Что курит это да . Я сам не балуюсь этим делом , вернее уже не балуюсь . Анал таки  есть . И жопа там такая что мама не горюй в плане габаритов . Вообще если не брать во внимание лишние киллограммы и прокуренность помещения , то сходить можно разок .', 0, 1366114339, NULL, NULL, 216, NULL),
