(518, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'Тоже пересекался с данной особой , пользовал только в классике , доплачивать за жопу четыре сотни жаба задушила . сиськи неплохие , да и в целом мне понравилась барышня . Спокойная вежливая опытная . Конечно с внешностью некоторые траблы наблюдаются , как то подвисающий живот , но хули годы берут свое', 0, 1366114759, NULL, NULL, 213, NULL),
(519, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'Согласен на все сто процентов по поводу этой Даши . Как то подобрали их с корешом , с ней еще одна шмара была, я так понимаю подруга , отвезли в сайну . Ну что сказать молодо зелено , и это молодо единственный плюс . Телка конечно не капризная но ленивая . Лишний раз напрягатся не будет . \nДа в жопу не дает , НОООО в изрядном упитии я ей таки присунул цуко . Снаачала отнекивалась мол не ни в коем разе я не такая бля . Сосет на троечку . Смазки ноль как правильно заметил камрад. Подруга кстати со слов другана такая же . \nДали штуку на двоих , трахали чуть больше часа , так 300 просит но я за жопу накинул чуток сверху .', 0, 1366115354, NULL, NULL, 208, NULL),
(520, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'Мне Анет тоже понравилась , бес пезды . По соотношению цена качество очччень неплохой вариант , старательная вежливая фейкО . Принимает там же , на Саксаганского . Я правда попал не с перого раза . Но по своим так сказать траблам . Созвонился договорился но начальство цука все планы испортило дополнительными "внеклассными занятиями" а вот второй раз все гуд. Да в таком ракурсе невидно живот а он все же немного проблемный . \nПро миню и окрестности при нем , камрад надо было попросить шоб она тебе помидоры облизала , я так и сделал . так что не надо наговаривать . Миня нормальная . \nПо процессу тут конечно ничего из ряда вон выходящего . все как у всех не хуже не лучше . старается не филонит особо . Делаешь что попростит . Анала нет . ЦВ - 300 грн. \nп.с. НЕ ДАЙТЕ ЕЙ СЕБЯ ЗАГОВОРИТЬ ))))', 0, 1366116057, NULL, NULL, 207, NULL),
(521, 'Бешенный огурец', 338, '46.211.125.208', NULL, 'то что лет там реально не девятнадцать подтверждаю , про укуренность ничего не скажу . во время моего посещения данной феи ничего подобного не заметил .\nТелка реально пиздливая , но пиздит не сильно напряжно . Так диетическая вермышель на уши )\nЕбется с огоньком, пока . Почему пока ? потому что думаю скоро заепется и скурвится как большенство . \nПо ТТХ - прикольные небольшие сиськи с хорошо реагирущими на ласки сосками . Фигурка тоже гуд . \nМИ - хата неплохая , ремонт все дела .\nМН - сосет конечно не мега ахуительно но потянет на 4- скажем так .\nШГ - неееее чего нет того нет , пробовал прозондировать пальцем получил по рукам :lol:\nЦВ - пиццот', 0, 1366116578, NULL, NULL, 202, NULL),
(522, 'bunny', 339, '46.211.125.208', NULL, 'комрад ты забыл указать цену данной особи - 300 грн. было дело повелся на неплохую цену для таких ттх ( а ттх там реально неплохие ) сама же телка не фонтант . В плане случки истественно , да и в плане пообщатся , мало того что голос какой то прокуренный что ли хотя не факт , так еще и слова клещами тащить приходится . Хотя теоретически за 300 грнивен конечно трудно ожидать чего нибудь феерического . Незнаю как сейчас (по поводу анала) но я было дело драл ее с тылу в прошлом году .', 0, 1366118509, NULL, NULL, 212, NULL),
