(525, 'bunny', 339, '46.211.125.208', NULL, 'Блеать был я у этой Изабель , незнаю че там в ней нашел позитивного камрад овощ , но там реально тетка потерявшая форму , сиськи когда то были наверное зачетными , но то когда то ооооочень давно сечас они ползут в сторону пупка хоть и медленно как коейские хюндаи которые колесников для евро покупал а теперь дядя Вася своим паровозом их толкает . Но уверенно . Сосет на троечку , а ведь казалось бы наличие опыта должно давать обратные результаты .', 0, 1366119133, NULL, NULL, 219, NULL),
(526, 'bunny', 339, '46.211.125.208', NULL, 'Она по моему уже не в теме . Когда то давно рылся в своей телефонной книге , надыбал ее номерок , вспомнил что зачетная деваха была , сосала знатно , и анал был неплох , да и вообще . Брала конечно сотку бакинских но все равно . так вот созвонился говорю мол как бы нам встретится красавица , дабы слицца в горизонтальном танго ну или ламбаде как получится ;)\nсказала че типо уже никак . ХЗ . может временный заеб а может и все серьезно :rolleyes:', 0, 1366119442, NULL, NULL, 211, NULL),
(527, 'bunny', 339, '46.211.125.208', NULL, 'Помню Таню невысокая такая крепенькая девка . Анал не юзал если честно , а все остальное с полной отдачей , можно еще сходить как нибудь , хотя если брать во внимание что это контора а в конторах как правило снаряд дважды в одну воронку не попадает , ну у меня по крайней мере . не разу еще не удаавалось повторно застать какую нибудь телку , гребанная текучка :|', 0, 1366119739, NULL, NULL, 217, NULL),
(528, 'bunny', 339, '46.211.125.208', NULL, 'Не стоит она сотки зеленых . Хотя внешне и не плохо выглядит конечно . к тому же телка как по мне реально немного с прибабабахом , самомнение чуток раздуто . На мамбе мне на сообщения с одной анкеты вообще нахамила , но может сам конечно виновать . По процессу тут ничего не скажу все вроде неплохо но все равно думаю те 600 грн. на которые сторговаля камрад самое то для нее . Я правда платил 800 просто не умею с феями торговатся .', 0, 1366120054, NULL, NULL, 200, NULL),
