(530, 'bunny', 339, '46.211.126.93', NULL, '[img=PunBB bbcode test]http://imageshack.us/scaled/landing/39/jenechka2002.jpg[/img]\nНашел на Сландо объявление данной особы , созвонился пригласила на Ивана Кудри . \nПодьехал .\n- да я уже на месте куда дальше то (изначальна назвала приблизительные координаты) \n- почему я вас не вижу ( в окно я так понимаю наблюдала :D )\n- я ебу , ну хошь я попрыгаю ))\n- ладно поднимайтесь ...\nВстретила дебелая молодыця такая . Не тольстая а просто крупная . На лицо не страшная , скажем так . Сиськи не большие . В комнате мелькнуло еще одно тело нехуевых таких габаритов . Местоимения вполне сносная хрущевка , Правда раскладной диван вместо траходрома, но то такое . Напоила чаем , отправила сполоснутся и в койку . Начали с минета собственно , погладила поласкала , одела през ртом , сосет нормально , с окрестностями , и по глубине нормально , не то что некоторые сука одну головку облизывают . Дальше перешли к классике . Начал с миссионерки потом . трахал по собачи , в наездницу не сажал , девка крупная сцыкотно стало , я ж сам блять дрыщь по комплекции ))\nНедолгий перерыв и повторный заезд . Ласки-миня . дальше настроился на анал . Достала смазку смазала себе черный ход , вошол впринципе довольно легко но все достаточно тугонько компрессия присутсвует . Минут через пятнадцать отстрелялся . Присутсвовала негромкая озвучка , в подлинности не уверен конечно . Никаких неприятных моментов вроде запаха или говенца на резине не заметил . Расчитался , ушел довольным . Кому интерестно есть получасовой экспрес вариант за 200 грн. А так четыре сотни . \nТТХ - 4- \nМИ - 4\nМН 5 (бывало и лучше но мне все равно понравилось) \nШГ 5 \nКС 4- \nЦВ - 400 (+100 за анал)', 0, 1366190954, NULL, NULL, 220, NULL),
(531, 'Бешенный огурец', 338, '46.211.126.93', NULL, 'несколько раз созванивался с данной феей, но как то все вхолостую \nнаконец все же повезло хотя лучше бы еще раз не повезло , потому как ... \n1) поправилась килограм на 10 по сравнению с фото , кстати фото из личного архива \n[img=PunBB bbcode test]http://s017.radikal.ru/i410/1209/53/d8791a30241f.jpg[/img]\n2) запах курева \n3) какое то раздражение в паху, судя по всему после бритья .\nВ общем ощущения остались самые негативные после посещения . Не знаю может я слишком впечатлителен \nМИ-4\nТТХ –3\nКС – 3\nМН – 2\nШГ - небыло \nЦВ - 200 грн. (за полчаса на большее не хватило меня)', 0, 1366191598, NULL, NULL, 220, NULL),
