(535, 'riko', 341, '46.211.121.123', NULL, 'Очередная попытка нашампурить какую нибудь инди потерпела неудачу поэтому , а давление в яйцах достигло критической отметки , поэтому решено было драть все что имет хоть какие нибудь признаки жизни , две руки , две ноги , и минимум парочку рабочих отверстий а в идеале конечно тройку . Созвонился с данной конторой получил координаты на Московском 3 . Приехал , сказали карапкатся на крышу , они ж суки не в курсе что пингвины НЕЛЕТАЮТ . Ну да хрен с ним взобрался . Обнаружил троих вполне ебабельных тел и еще какое то толстенькое существо . Выбрал Олю - стройную брюнетку блядской наружности и как оказалось впоследствии характера . Фото даной шлюхи к сожалению нет так что не обессудьте.\nУ фейки неплохая грудь тройка , упругое ладное тельце. Правда зубки кривенькие немного , но эт ерунда  . А в общем начало многообещающее . Начала с минета , минет довольно жесткий , неглубокий , с периодическими проскакиваниями зубов , мы пингвины зубов не любим поэтому минет не очень понравился . Девка во всю пыталась навязать свои "правила игры" что тоже не очень проффесионально - должна стелится под клиента , а не указывать ему че и как делать . Короче во избежание всех этих мансов мамзель была поставлена в позу сучки кем она по сути и является и безцеремонно вздрючена . \nДальше был перерыв с явными попытками затянуть время вконце которого было заявлено с серьезной миной , что время закончилось . Посмотрел на часы прошло сорок минут . По правилам хорошего тона надо было извлечь откуда и всегда какое нибудь орудие смертоубийства и разнести весь этот шалман , ну или хотя бы настучать по бестолковке этой двадцатитрехлетней овце , но настроения не было , поэтому плюнув в сердцах , откланялся . \nМИ - 4\nТТХ - 4 \nМН - 2\nКС - 3\nШГ - сомневаюсь что есть хотя вдуть не мешало бы\nОтношение - 2\nЦВ-400 грн.', 0, 1366372192, NULL, NULL, 222, NULL),
(536, 'riko', 341, '46.211.121.123', NULL, '[img=PunBB bbcode test]http://s017.radikal.ru/i440/1207/c1/eed8f0972ad5.jpg[/img]\nСвежий негативный опыт общения с конторскими блядями , я про посещение  [url=http://forum.natashaescort.com/viewtopic.php?id=222]Оли[/url] в шалмане на Московском , так вот хоть столь свежий негативный опыт немного настораживал, но все же решил посетить очередную контору , теша себя надеждой что не все шлюхи реально бляди , а встречаются и вполне адекватные персонажи , ну уж больно дефка с фото зацепила короче . \nСозвон . Есть Николь ? ЕСть . Ок . Еду . А куда ехать ? Пиздуй на Данилевского . Ага понял. \nМестоимения вполне приличная квартирка с нехилым евроремонтом , С девкой тоже не наебали . Соответсвие с фоткой стопроцентное . ну думаю рано радуешся чернобелый, в прошлый раз тоже начало пристойное было . \nНапоили меня чаем отправили в душь , хули нам пингвинам тот душь , там же даже не поныряешь нормально , но людям наверное не плохо . Ну вобщем поплескался немного , пора и к делу переходить . \nНиколь уже ждала в койке . Начала с поглаживаний там всяких , одела през , руками . Была не много скованой как мне показалось . ну хули не каждый же день ее пингвины ипут . А может от природы скромная , ну думаю в этом бизнессе этот изьян быстро выветрится ) минетит нормально , может делать глубокий минет если помогать , ну типо взять за уши руками и хади на кукан хади накукан .... \nВ сексе послушная без выебонов . Анал не практикует . Отстрелялся два раза . В перерыве немного поболтали , Девка не напряжная . Но как я говорил немного скованная , оно конечно не каждый день с тобой пингвин разговаривает ... \nв общем если подитожить \nИтого\nми - 5\nттх - 5\nмн - 5\nшг - нет\nцв-800 грн.', 0, 1366375969, NULL, NULL, 223, NULL),
(537, 'riko', 341, '46.211.121.123', NULL, '[img=PunBB bbcode test]http://s05.radikal.ru/i178/1210/d7/4a6049f70afb.jpg[/img]\nНу так уж и быть еще один отчетик настрочу , правда барышня в этот раз индюшка, мы цуко пингвины индюшек особенно уважаем , хотя конечно и другую живность "топчем" Ну давайте попорядку . Зовут Леной , списалссО на мамбе ссылка на анкету бессмысленна поскольку та ушла в стану проебаных вещей , неактивна в смысле . Места своего нет , я еп в отеле , приехала во время . Выглядит на четыре с плюсом, за собой следит . Сиськи немного подвисающие но тройка по ходу . Талия на месте , без лишних отложений . Хотя у нас в Арктике конечно прослойка жира несомненный плюс , но то в Арктике . Попец опять же не дурственый хотя и не рабочий по утверждению. \nПо самому процессу - минет зачетный , причем возможен МБР , может конечно не для всех , но у мнЫ был . Окрестности тоже не забывает . В сексе в принципе все стандартненько . Позы меняет без проблем . Рачком видос зачетный . Основное отверстие конечно подгулявшее в плане раздолбанности но пойдет . Слил два раза . Время не секла . пробыла почти два часа . В перерыве сделала средненький массаж . Вот как то так .  Можно рекомендовать . Никакого негатива все достойно . Деффко опытная судя по всему , возможно есть опыт работы в какой нибудь конторе .\nИТОГО :  \nТТХ -4 \nМН - 4+ понравилос \nКС - 4- компрессии не хватает \nШГ - непрактикует \nЦВ - 600 грн.\nБЛяТЬ ПРОТУПИЛ , есть уже по ней тема [url]http://forum.natashaescort.com/viewtopic.php?id=187[/url]', 0, 1366379136, 1366379331, 'riko', 224, NULL),
(538, 'riko', 341, '46.211.120.47', NULL, '[img=PunBB bbcode test]http://img840.imageshack.us/img840/4231/milar.jpg[/img]\nЗанесло как то по делам в Днепр . Разгребся с делами поручениями от фирмы вечерок свободный , решил расслабится на чужбине . Хорошо что заранее пробил обстановку . В смысле списался на мамбе с леди [url]http://www.mamba.ru/mb731019791[/url] \nобещала с подругой напару устроить горячее рандеву за стописят бакинских (1200 грн.) Согласился . Назвали координаты , блин хорошо таксист толковый и порядошный попался не стал мне экскурсии по городу устраивать. Встретила девушка , довольно симпотичная , на фото конечно похожа но скорее всего не она . Подружка попроще немного , но тоже не страшная . В общем симпотичные не крупные , с неплохими фигурками девчушки.  Посидели на кухне выпили чайку пообщались, сходил сполоснулся и перешли к процессу . Девченки конечно немного скованы в процессе , как я полагаю опыт продажной любви не велик . Минетят не плохо и не хорошо , на троечку с плюсом ,  по очереди , лижутся между собой . Насколько искренне не знаю , мне показалось что все достаточно натурально а там хер его знает .  Трахал по очереди первая палка одну вторая вторую . Вторая которая попроще понравилась чуть больше . Мокреет сама подмахивает , прогибается . Первая в это время села ей на лицо и начала там елозить закатывая глазенки и издавая стоны . Видок суперский . Пробыл почти два часа , время не засекали по ходу . в шею тоже не выгоняли . неплохо отдохнул в целом . \nПодобьем итоги : \nТТХ: 5 как по мне обеим молодые ладненькие \nМН: 4- или 3+ не хватает практики\nКС: 4\nШГ: эта не практикуют \nОтношение к клиенту: 5', 0, 1366551726, NULL, NULL, 225, NULL),
