(540, 'Alf', 343, '46.211.127.249', NULL, '[img=PunBB bbcode test]http://img.sex-ukraine.net/370x550/4280001.jpg[/img]\nВообще посетил дох№я днепропетровских контор будет время поделюсь опытом с подрастающим поколение более подробно, смакуючи детали и все такое . Ну а сейчас разсскажу про Наташу , трудилась такая слегка полноватая фейка в конторе на Шмидта . Телефон конторы в названии темы . \nПо конторе :\nЧе тут говорить среднестатистический бордель не хуже не лучше других . Присутсвует постоянно несколько тел , иногда попадаются зачетные экземпляры , отмечу разве что засцанный подъезд .\nПо Наташе : \nЕдинственное фото которое смог найти , вроде похожа но на сто процентов не скажу , поэтому словестный портред добавлю - слегка полноватая деваха , но приятная на дотЫк , жир при ебательных движениях не колышется :D\nВстретила правда слегка под градусом , но раз не в хлам значит можно ебать . Да собственно и в хлам можно . телка сама по себе пиздливая , хотя конечно может это алкоголь пиздел а не она . \nПо процессу : \nТрахается активно с отдачей , говориш попрыгай - попрыгает . Говоришь лизать - лизыт ну или лижет (яйца там или еще чего) вобщем послушная и исполнительная телка . Сосет вполне достойно , хоть и не глубоко . В процессе вроде мокреет сама . Озвучка - ой блять ну это конечно наверное тоже порнушным голосом стонал алкоголь , потому что так наиграно шо пипец . Попытался под шумок заехать "с тылу" начала чето бухтеть шо в жопу она ебется и все такое . В перерыве немного подзаипала пиздежом пришлось затыкать рот х%ем . \nИтого :\nТТХ-4\nКС-4\nМН-4\nШГ-нету\nЦВ-300', 0, 1366613789, NULL, NULL, 226, NULL),
