(544, 'ЙОрик', 346, '46.211.123.109', NULL, 'Время от времени пользуюсь услугами данной конторы , и убедился в том что единственная девушка ради которой туда стоит наведатся это Юля . Она вообще похоже одна в этом заведении кто практикует анал , и замечу анал там суперский , хоть и фейка его и практикует но никапельки не раздолбано , все тугонько без посторонних запахов . Правда не уверен что ей нравится сам процесс но терпит без возражений .', 0, 1366618220, NULL, NULL, 226, NULL),
(545, 'Alf', 343, '46.211.127.28', NULL, 'Это да , с этим соглашусь целиком и полностью . Юлька зачетная чикса . И духовка там заебись , а вот сиськи маленькие , да и сама мелкая . Было ка то раз попыталась меня наибать , в процессе аросной жопной ебли незаметно вытащила йух и задницы и втюхала себе в песду обхватив при этом его как то хитро пальцами . В общем просек эту фишку не сразу а практически на финише , она при анале как то прогибается в другую сторону , ну типо жопа вниз получается а не как у всех вверх , и ШГ не видно . Короче теперь бдю )) \nТТХ: 4 \nМН: 5\nШГ: 4 \nКС: 4\nЦВ: КС 300 гр., ШГ 400 гр.', 0, 1366618882, NULL, NULL, 226, NULL),
(546, 'Ден', 345, '46.211.123.134', NULL, '[img=PunBB bbcode test]http://ib3.keep4u.ru/b/2013/01/11/2b/2b96fd5406348ba5043f55ef220d4ab3.png[/img]\nЗдорово други , хочу поделится инфой по одной даме , как эта инфа будет воспринята мне пох . Но у веряю что это не какой не черный пиар или что то в этом роде , потому как дама реально непонравилась , непонравилось ее отношени , подход и многое другое , Одно понравилось цена - было озвучено 350 грн. Хотя в той же [url=http://forum.natashaescort.com/viewtopic.php?id=226]конторе на Шмидта[/url]  просят триста . реально б лучше туда сходил. Но давайте попорядку значит . Обитает Катя на ул. Ленина . Хата не айс , ванная убита . Фотка ее но там видно только лицо , ниже все не так радужно , сисько обвислое , жопа какая то бесформенная чтоли да и в целом девка как то неопрятно что ли выглядит а может это просто ощуцение от жизлплощади наложились . Ну да ладно . Да чуть не забыл , там еще какая то подружка есть вроде , хоть я и не видел , потому как она куда то вышла .\nСходил сполоснулся, потом она сбегала и приступили значит к процессу  , резину одела руками , сосет на троечку , помогает руками , мелькают зубки временами , начинаю мять сиськи в процессе на лице появляется непонятная гримасса типо ну че доебался до них . Дальше классика тоже не впечатлило как то , все так будто одолжение делает , хотя мокрее сама . Посадил в наездницу немного поскакала нехотя , и типо устала , ну хрен с тобой становись раком , перейдем к тому зачем реально пришел , а пришел собственно за аналом . Да забыл вроде сказать с аналом было оговорено типа 450 грн. \nАнал тугой . Вошол с трудом , трахал минут пять цуко чувствую что глядя на эту жопу с прышем на булке врядли получится отсрел произвести , тело начало ныть мол у меня уже жопа болит , закрыл глаза представил шо жарю Холли Бери , на нее у меня чет всегда стоит :rolleyes: и с трудом кончил . \nбуду честным никакой хуеты гавенной на презе не заметил когда вытаскивал . На второй заход не оставался .\nитоги: \nТТХ - 3\nКС - 3\nШГ - 4 поставлю за плотность обхвата и стерильность , а сама жопа на вид не очень \nМН - 3\nЦВ - 450', 0, 1366621596, NULL, NULL, 227, NULL),
(547, 'ЙОрик', 346, '46.211.123.134', NULL, 'Подруга там такая же , так что не растаивайся что не встретился \nПро жопу камрад сказал а вот про живот забыл , как по мне живот там реально проблемный , может после родов конечно . Был когда то давно еще за двести пятьдесят гривен помню сторговались и сотня за анал , как то так . Анал реально компрессия неплохая , но трахается только раком , хотел что в наезднице оседлала бойца анально , сказала что так у нее не получается . ХЗ чему там получатся . В перерыве пыталась сделать массаж , хер его знает его не оченил потому как не любитель , так что массажистка она или нет не скажу . в классике так себе вертелась постоянно что уж на сковородке , миня тоже бывает и лучше \nНезнаю там камрад сказал что типа когда ее лапаешь гримассы стоит недовольные , я ниче такого не щзаметил , хотя и рукам волю давал не по детски :D\nТТХ: 2\nМесто имения: 2\nКС: 3\nМН: 3\nШГ: 4\nЦВ: 350 г.\nСам больше точно не пойду, но и отговаривать никого особо не буду .', 0, 1366622326, NULL, NULL, 227, NULL),
