(549, 'Ден', 345, '46.211.123.134', NULL, 'не ну не то что гримассы корчит, но блин взгляд реально такой как будто я ей должен \nа живот да точно про живот забыл упомянуть :cool:', 0, 1366622993, NULL, NULL, 227, NULL),
(550, 'Ден', 345, '46.211.123.134', NULL, '[img=PunBB bbcode test]http://ib3.keep4u.ru/b/2013/01/30/26/26739aa2f37c3884353d6eabcd331632.jpg[/img]\nБлять признаюсь честно что как последний лохобан повелся на это фото , И понимал ведь что скорее всего туфта , но неабьятные сиськи манили и звали к себе . По приезду открыло дверь невнятное существо со словами драсьте . Сказал драсьте в ответ и спросил а где сиськи , существо видимо бывшее мамкой в этом блядорассаднике ответило - ТАМ и кивнуло в глубь притона . Подумал была не была и переступил порог ...\nСиськи там такие есть чего греха таить , но девки с фото нет . А сиськи есть даже больше чем на данной фотке . Сторговались на пять сотнях без анала . Местоимение описывать особо нечего , запомнилась только поебочная с добротным траходромом и очень узкими подходами к нему . Ну тоесть сама комната узенькая места вокруг койки свободного практически нет , разве что пройти .\nТеперь про саму Аню или как там ее на самом деле величают . Вобщем сиськи там реально огромные . про размер даже не скажу , кроме них есть небольшой животик , но не критично , на лицо тоже не страшная . Волосы светлые . Начали с того что она начала возить по мне своим добром (я про сиськи) потом я это добро немного помял . пока боец будет готов  к одеванию скафанда .  Обрезинила ртом и руками . Начала не спеша сосать . Сосала размеренно не спеша , и по глубине нормально , но хули тот минет в резине - так понты . Перешли к класике . Посадил сверху в наездницу . Видос абалденный я вам скажу . Но с таким грузом долго не поскачешь . Добивал в миссионерке , тоже в принципе ниче , можно помять сисяндры . \nВторой раз по той же схеме . Только попросил кончить между сисег , в чем не было отказано . \nНу че сказать . любителям больших сисек можно рекомендовать , девка в принципе положительная . не вредная , конторе конечно за наеп с фото минус . \nТТХ 4 \nМН 4\nКС 4\nШГ у меня не было, и нет походу \nБИ - есть такая опция по двойному прайсу типа две девки \nЦВ - 500', 0, 1366630535, NULL, NULL, 228, NULL),
(551, 'ЙОрик', 346, '46.211.121.31', NULL, '[url=http://radikal.ru/F/i017.radikal.ru/1304/7a/c2c2a180296f.jpg.html][img]http://i017.radikal.ru/1304/7a/c2c2a180296ft.jpg[/img][/url]  [url=http://radikal.ru/F/s018.radikal.ru/i508/1304/92/7888fd869db0.jpg.html][img]http://s018.radikal.ru/i508/1304/92/7888fd869db0t.jpg[/img][/url]\nНайдена на желтеньком сайте который созвучен с оралом , но не тем на которое мечи перековали, а тем который х*ем в рот ) Обозначен персонаж как Милена , хотя подозреваю что она такая же Милена как я Мила ЙОлович )) Цена за час классической еб*и озвучена 700 гривен . Типо у нас элитные проститутки а не х*й собачий . Нечистый попутал хоть раз в жизни почувствовать себя "белым человеком" и попробовать что же мы простые смертные теряем употребляя ширпотреб вместо элитного продукта . Забегая на перед скажу гавно . Возможно так называемые избранные господа считают нас лохами , но это самообман поскольку лохи они, потому что это им втюхивают китайскую подьепку которой цена двадцать баксов по цене швейцарских часов . Ну это я отвлекся немного . Контора действительно с претензией . особнячек такой нехилый на пересечении Одоевского и Болгарской с сауной и базейном вроде как , телка говорила в перерыве между палками . Кстати саму телку вроде видел раньше в конторе на Карла Маркса . хотя могу ошибатся . Еще чесала какая у них крутая крыша и тому подобное . В общем понты еще те . Теперь по самому процессу - тут честно говоря претензий нет - хотя и не фонтан . Все стандартно механически минет на троечку , классика - что в ведро потыкал , телка пыталась еще и на анал развести , чем немного удивила , хотя когда уже сваливая поинтересовался про цену анала понял почему таки пыталась , х*ли +800 сверху как никак. \nКороче ипал я в рот такие именины , подать мне шляпу и пальто в пойду я в лес гулять ... \nРекомендовать могу только "солидным и успешным" товарищам , нам же плебеям идти туда не зачем ОДНОЗНАЧНО - тамошние бляди стоят гривен триста , а остальные четыреста эта сауна с бассейном и крутая крыша , ОНО ВАМ НАДО ? \nитого : \nМИ 5 \nТТХ 4\nМН 3\nКЛ 3\nШГ есть но не пробовал (+800)', 0, 1366704790, 1366712505, 'ЙОрик', 229, NULL),
(552, 'ЙОрик', 346, '46.211.121.31', NULL, '[url=http://radikal.ru/F/s020.radikal.ru/i710/1304/f4/87afce416f05.jpg.html][img]http://s020.radikal.ru/i710/1304/f4/87afce416f05t.jpg[/img][/url]\nНа укргоу найдено объявление в котором бедному ЙОрику ну и прочим письконосителям обещался королевский минет с заглотом . К коему было прикреплено данное фото . Сразу скажу фото ничего общего с оригиналом не имеет и добавлено просто ШОБ БУЛО . Вообще реальных фоток девок из данной конторы в инете не нашел . А это таки контора как говорят в Одессе , расположена по улице Ленинградской , номер дома и квартиру называть наверное все же не стоит . По приходу были предьявлены несколько тел , довольно сносных параметров , даже скажу парочка была очень даже ничего , одну из них собственно и выбрал . Блондинка с упругой грудью третьего размера акуратненькой жопкой и волосами чуть ниже плеч . Да цена вопроса - 500 гр. классика с миней , за анал еще 300 , есть еще лезби типо за 1000 гр. но ОНО МНЕ НАДО ? \nОтправили в ванную , полотенце выдали нормальное , гели помывочные присутсвовали , ванна нормальная . Помыл причандалы пошел в комнату . Дефка , блин как зовут непомню если честно , как то назвалась но я не запомнил , так вот девка перестелила простыню и сама убежала в душ . Не было минут пять . Вернулась завернутая в полотенце , сбросила его начала меня как то вяленько нехотя целовать . Тело зачетное конечно , боец незамедлил отреагировать . Правда скорее на визуальный раздражитель чем на тактильный . Обрезинила руками , причем как то корявенько неумело что ли , начала сосать . Ну не сосать скажем честно а елозить по стволу губами . Положил в миссионерку перешел к класике, писька тугая за что плюсик , но мокреет слабо а смазку не использовала . Мне то в принципе пох но ей думаю приятного мало . В процессе отворачивала голову в сторону и кривилась время от времени . Поэтому что бы не смотреть на недовольное лицо поставил раком и в таком положении кончил . \nВ между палочьи разговор не склеился полежали немного помял классные сиськи , сиськи там таки классные упругие такие уххх . Спросил про анал , она ответила что это у других девочек она типа в жопу не дает . Ну думаю нет и нет , хер с тобой . Второй подход к снаряду в позе сломанной березки без лишних сентиментов . \nитоги : \nТТХ - 4+\nМи - 4 \nМН - 3-\nКС - 3+ единственный плюс что не раздолбано сильно\nШГ - 0', 0, 1366711536, NULL, NULL, 230, NULL),
