(555, 'Alf', 343, '46.211.121.31', NULL, 'Подпишусь под каждым словом , практически . Тоже имел опыт общения и с данной конторой и с блондой у которой сиськи треха непосредственно - ВЫВОД ЛЕНИВАЯ СУКА больше хер пойду , тоже самое во время секса воротила морду лица , было желание с разгону засандалить ей в жопу да побоялся что еще усрется от неожиданности :cool:', 0, 1366712068, NULL, NULL, 230, NULL),
(556, 'Alf', 343, '46.211.121.31', NULL, 'Контора появилась сравнительно не давно , телки там реально борзые , на фишку с аналом попадал сам . Причем цену сразу не говорят , только потом когда уже присунеш . Попытался сьехать мол вы че сразу то не говорите сколько стоит жопа этой суки , нах она б мне нужна за такие бабки . В итоге пришла охрана и популярно обьяснила что я типо не прав . Пугали какими то серьезными людьми и все такое , короче пришлось сотку баксов накинуть и свалить нахер . Больше естественно я туда не ходок .', 0, 1366712410, 1366712869, 'Alf', 229, NULL);
