(557, 'Alf', 343, '46.211.121.31', NULL, 'Прочитав предыдущий отчет камрада Йорика [url]http://forum.natashaescort.com/viewtopic.php?id=229[/url] в котором он вскользь упомянул контору на Карла Маркса решил я по этому заведению черконуть отчетец фотки не прилогаю потому что реальной все равно нет а там где я надыбал контакты сего заведения , как ни странно надыбал в контакте , так вот те партреты которые там присутсвуют на оригинал не тянут но кому интерестно все же ловите ссылку и сами посмотрите \n[url]http://vk.com/id171475487[/url]\nтак вот надыбав там телефон решил позвонить ,  ( 8(096)688-11-88 и 8(093)822-66-99 ) звонил по первому , но втрой тоже ихний вроде . Итак значит на вопрос с фото ответили честно что не оригинал , и озвучили прайс в 600 гривен . Анал вроде тоже как есть но это еще плюс четыреста . Согласился.\nНазвали адрес возле Беркута который магазин , на ул. Карла Маркса 34 . \nПриехал на место , подъезд в доме конечно жесть . Но не в подъезде ж трахаться , так что решил идти до конца . В конце значит вполне приличной квартире ждало несколько тоже вполне приличных девчат , некоторые хуже некоторые лучше . но сильно страшных не было точно . Выбрана симотичная брунетка , с неплохой крепенькой фигуркой - по моему Кристиной назвалась . проводили в душ выдали полотенце .\nКомната для соития в принципе тоже нормальная , койка не убитая . Девка прибежала из душа довольно быстро и сразу приступила к процессу . Минет добротный такой , глубокий с окрестностями . Может быть конечно излишне нежный , мне нравится более агресивная техника , но то как говорят на любителя . Сосала минут пять . Потом перешли к классике , спросила как будем , говорю лезь на гора , скачки устроим . Оседлала поскакала . Не филонит , темп держит . Мокреет вроде сама неплохо. Озвучка негромкая такая , в искренности не уверен . Потом пару раз поменяли позы . Кончил в миссионерке . Второй подход миня - классика - анал . за анал 400 грн. доплаты . Но все чистенько без сторонних запахов , плотненько (вошел с трудом) . Все . \nОбщие выводы : \nТТХ -4\nМИ -4\nКС -4\nШГ 5 \nМН -4 \nЦВ -600 +400 за шг\nРекомендовать ли . даже не знаю если что бы именно эту девку так легко . Девченка старательноя , услужливая , но это ж контора не факт что подсунут кого нибудь другого , так что решайте сами .', 0, 1366715351, 1366715396, 'Alf', 231, NULL),
