(570, 'Боцман', 348, '46.211.127.177', NULL, 'Фото Лили к сожалению не сохранилось , о чем искренне сожалею , так как фея зачетная и не поделится такой с камрадами употребителями ну просто грех . Нашел на все той же мамбе , ссылка на анкету тоже не активна , но вверху темы прилогаю номер по которому связывался , может кому то повезет . \nПринимала в центре так что в принципе добираться одинаково из любой точки города . Квартирка сносная . хоть и вместо ванной довольно тестная душевая кабинка . Деньги просит вперед . 600 гривен . \nПо процессу \nВместо траходрома матрас на полу , не пугайтесь матрас большой а не односпальный ка в пионерском лагере ))\nНачинает с массажа , массаж неплохой такой, практически профессиональный . Потом это дело переходит в поцелуи облизывание , переворачивание на спину и минет . Хочу заметить что Лиля любит забиратся в позу 69 и смотрится в ней достаточно эффектно , писько акуратненькая , и попец такой симпотичный . Думаю камрады любители по лизать врядли устоят от соблазна , но я как то немного брезгую лизать то по чему пол Одессы х*ями елозило . Миня средненькая , конечно но девка старается , вылизывает окрестности и даже больше )) \nПотом была классика . Тоже все активненько , без возражений с негромкой практически естественной озвучкой . Сделал два полноценных подхода , между которыми барышня слегка проехались по моим ушам , но терпимо ) \nПро анал - пытался развести но было категорически отказано , нез наю может смутил размер носовой пушки ))\nЦВ - 600 грн.\nМИ - 3 \nМН - 4-\nКС - 4-\nШГ - нет', 0, 1366967779, NULL, NULL, 236, NULL),
(571, 'Боцман', 348, '46.211.127.177', NULL, 'Ксюша\n[img=PunBB bbcode test]http://s41.radikal.ru/i093/1304/ac/0142debeaf91.jpg[/img]\nВика\n[img=PunBB bbcode test]http://s017.radikal.ru/i442/1304/04/32ec4518af14.jpg[/img]\nотпишусь и по Чао Яню , был дважды . Первый раз брал Ксюшу , второй Вику . Обе соответсвуют заявленным на ихнем сайте фоткам\nСразу говорю что не начто серьезное надеятся там не стоит - только массаж , и дрочилово гордо именуемое релаксом\nпо Ксюще : \nСимпотная блондинистая девка лет двадцати пяти , работает как и все остальные в этом заведение в трусиках. Начала с массажа довольно мастерски все исполнила . профи одним словом . Потом перешли к эротической фазе . Там все конечно не так как хотелось бы но пойдет . Потерлась немного об меня сиськами , которые кстати можно трогать . симпотичненькая такая полторашка , в руку ложится как родная )) Брал на один релакс так сказать (час по времени получилось) отдал четыре сотни . В завершении полежала немного рядом поглаживая меня по груди . Разговор поддерживает , неглупая впринципе девочка . Душ и досвидания , душ малометражный )) совмещенный с санузлом )) \nпо Вике : \nТоже светленькая с наливной сиськой , не большая но крепенькая такая , прям пЭрсик . Класический массаж не плох но все же у ксюши понравился как то больше . У Вики как то грубее получается что ли , хотя тут у каждого свои вкусы наверное , а вот эротическая часть впечатлила больше , брал на полтора часа , платил 600 грн. за парочку релаксотстрелов (ну вы поняли это типо телка вам подрочит) . Оба раза у Вики это вышло зачетно , старается вобщем . То сверху садится , то начинает сиськами терется вобщем классно все . \nНу вот как то так . Конечно по большому счету все это понты для приезжих . Но в силу того что как то ситуация с блядями в нашем городе ухудшилась , возможно скоро придется полностью переходить на этот суходрочь :(', 0, 1366973838, NULL, NULL, 237, NULL),
(572, 'Ян', 349, '46.211.127.177', NULL, '[img=PunBB bbcode test]http://img213.imageshack.us/img213/9730/341959219huge.jpg[/img]\nКамрадам со здоровыми нервами и устойчивой психикой не то что бы рекомендуется а просто к сведению \nЗовут типо Анжела , все свободное время проводит на мамбе , считает себя невьебно красивой и вообще мечтой любого камрада поэтому абы с кем не епется а типо ищет спонсора или хер ее знает кого она там , там это на мамбе по большому счету , ишет . Ну реально у человека свет на мамбе сошелся клином\nвот ссылка [url]http://www.mamba.ru/manana31[/url]\nНО ПОВТОРЮСЬ это не рекомендации а скорее наоборот , предупреждение . \nНу давайте попорядку , после довольно продолжительной переписки большая часть которой сводилась к рассказам мне какая она пиздатая , все же удалось повернуть разговор в нужное русло , и так сказать садами огородами намеками подобрался к главному , хотя так и подмывало спросить в лоб - почем минет уродливая сука ))) Кароче сторговались на 800 грн. хотя изначально намекала что хочет какие то туфли за потора косаря но я благополучно непонял намек )) \nдоговорились встретися в кафешке , пришла опоздав минут на 45 . Ну да хрен с ним , надо признать фотки ее . \nВыпили кофе , уже на этом этапе продолжила выносить мозг на тему своей пиздатости и про то что разовые встречи ее не интересуют а вот за 3-4 тысячи в месяц она может стать моей любовницей . Но судя по запросам думаю ей придется еще парочку заводить постоянных любовников . Захотелось побыстрее прекратить эту хуету поэтому предложил все же перейти к делу , поскольку была свободна хата коерша и он доброй души чел оставил мне ключи . \nПриехали , душ , койка значит .  В постели ведет себя так же как и вне ее . Позволяет трахать себя королеву с надменным взглядом , плюс ко всему туда руками не лезь , так мне не удобно , туда не хочу . Подумалось что ее не помешало бы просто перегнуть где нибуть и трахнуть в задницу что бы немножко попустилась .\nСам больше не пойду . и другим не советую : \nТТХ 4- \nМН 3\nКС 3 \nШГ - ну я блять даже спросить побоялся )))\nЦВ -800 грн.', 0, 1366981650, NULL, NULL, 238, NULL),
(573, 'Ян', 349, '46.211.127.177', NULL, 'Практически теска ) Ссыль на анкету не прикладываю потому как та что есть не активна . А вообще у нее на мамбе анкет было дофига . Но я так понял анкетами там не она занимается а другая девка , а на поебку ездит Яна . Подкупила бюджетная цена в триста гривен . Решил присунуть . Позвонил , тел. дала практически сразу . так вот позвонил приехала . Не тонконожка ну и не толстая . Вобщем нормальная такая есть за что подержатся брунетка . Правда мне показалась какой то дерганой , такое впечатление что еле себя сдерживает что бы не заглянуть на антресоли , вдруг там група захвата по ее душу прячется , ну или парочка маньяков которые выскочат в самый ответсвенный момент что бы засандалить ей еще в парочку свободных отверстий ))) \nТеперь по процессу . Начали с минета - сосет нормальненько так , может без резинки , вобщем мне понравился минет , старается девка . Потом значит одеваем ОЗК и переходим к классике . В наезднице быстро устает , поэтому трахал в основном раком и миссионерке . Отверстие не сильно разношено , запахов никаких не унюхал стремных . Между палками что то втирала про какого то высокопоставленного ментовского начальника который ей покровительствует , незнаю правда или просто девка таким образом пытается себя хоть как то обезопасить от разных мудаков . \nИТОГИ \nТТХ - 4 \nМН - 5 это мне понравилось \nКС - 4- минус за то что мне пришлось напрягатся \nШГ - нету вроде \nЦВ - 300 грн.', 0, 1366982977, NULL, NULL, 239, NULL),
(574, 'Гадский папа', 350, '46.211.122.148', NULL, '[url]http://www.mamba.ru/julia-fox92[/url] \nНамечалась очередная поездка в Винницу , по работе туда приходится мотатся с завидной регулярностью , поэтому заранее на мамбе зондировалась почва по поводу досуговой программы после решения всех производственных вопросов . Списывались долго надо признатся , девушка на контакт шла весьма не охотно , но в конце концов не устояла перед моим даром убеждения и в итоге мне было предложено лямур де труа за довольно померную сумму в 1000 гривен . Работают типо с подругой - наверное не так стремно . Естественно отказыватся от такого было грешно , договорились что наберу когда освобожусь .\nРазгреб свои заморочки поехал в гостинницу , точнее сьемная квартира посуточно . Постоянно ее снимаю когда бываю в Виннице . Отзвонился девченкам - да сейчас приедем . \nСразу говорю что фото в анкете \n[img=PunBB bbcode test]http://s08.radikal.ru/i181/1304/07/5a1d511a69b7.jpg[/img]\nничего общего с приехавшими девушками не имело , да я собственно себя иллюзией и не тешил если честно. В реальности , две довольно симпотичные девченки , немного полненькие , но не критично в принципе . Одна брюнетка чуть по старше , вторая рыженькая . Начали с минета сначала одна потом передала эстафету второй , минетят обе зачетно , я вообще не люблю сравнивать . Либо хорошо либо нет . А то начинают сосет неплохо но Галя все равно лучше , херня все это . В общем обе сосут классно . В процессе не забывают ласкать друг дружку , и как мне показалось довольно натурально и не наигранно . Так что не исключаю что в по мимо камрадских членов активно пользуют друг дружку в свое удовольствие . Дальше перешли к классике , сначала трахал брюнетку а та рукой теребила письку рыжей , потом поставил раком рыжую и пока ее имел она пальцем и языком имела брунетку . В общем понравился процесс , душевненько так отдохнул , у черненькой вроде как и ШГ рабочее но я правда не попробовал и без него не знал за что хвататся )\nТТХ - 4 у обеих \nМН - 5 \nКС - 4+ \nОтношение - нормальное отношение , сначала немного скованы были конечно \nШГ - не было но вроде у одной есть \nЦВ -1000 гр. без таймлимита', 0, 1367141181, 1367142044, 'Гадский папа', 240, NULL),
(575, 'Гадский папа', 350, '46.211.122.148', NULL, '[img=PunBB bbcode test]http://s018.radikal.ru/i506/1302/a2/3bbdd954de55.jpg[/img]\nСтарый проверенный кадр . Хотя слово старый конечно немного не в цвет , женщина бальзаковского возраста - за тридцать где то . Как зовут вот реально запамятовал . Фото ее . Часто мелькает на мамбе но анкеты как то живут не долго , те что у меня ссылки были удалены . По самой фейке - опытная одним словом , умеет практически все и делает это на совесть . Хотя конечно разношенность агрегатов присутсвует . Я был пару раз , первый раз наверное попал не под настроение , поэтому все было немного холодновато , деловито , расчетливо даже решил что больше не пойду . Но потом в следующий раз девка с которой забивал "стрелку" соскочила и другие варианты не светили , поэтому пришлось идти к ней . Вот второй раз все было заебись . \nДевка реальная профи . И цена не кусается платил 600 грнивен без ограничения по времени , драл во всех позах во все дырки . Минет грамотный , с окрестностями и вылизыванием помидоров . Классика конечно похуже но от того что не хватает компрессии , а все остальное нормалек -  старается , подмахивает , прыгает сколько нужно ,  стонет . \nАнал тоже нормально все , трахал в основное отверстие раком , но увлекся , ну или отвлекся короче ненароком засандалил в ШГ . Возражений не последовало . Так и кончил . Все чисто без запаха говенца и тд. \nобщие оценки : \nттх - 4- возраст берет свое \nмн - 4+\nкс - 4- минус за раздолбанность \nшг - 5 чистенько , не сильно разбито , в общем классно все \nцв - 600\n\nРекомендовать в принципе можно для качественного траха без заморочек с опытной взрослой теткой \nеще один номер 8(096)626-28-31', 0, 1367149062, 1367155899, 'Гадский папа', 241, NULL),
(576, 'Гадский папа', 350, '46.211.122.148', NULL, '[img=PunBB bbcode test]http://s57.radikal.ru/i156/1301/8d/4dacb3e076f7.jpg[/img]\nОксана - была найдена на одном блядосайте , ссылку наверное на сторонний ресурс выкладывать не стоит . Фото не знаю , скорее все все таки просто типажные . Телефон в заголовке темы . Пригласила на какую то сьемную хату , сама сказала что то типо хата сьемная так что если что я не виновата )) \nЦена озвучена была за классику с минетом 500 . Остальное все за доплату . Анал двести , глубокий минет блин 100 короче хрень какая то . Ну я согласился на все допы в общем . Говорю сразу никакого там глубоко минета и рядом не стояло . Обычный отсос , так что на эту замануху не ведетись . \nПро анал . Тут практически та же история , деньги берет , но потом начинает ныть мол у тебя такой член большой бла бла бла . \nНу ладно давайте по порядку . В общем пригласила на съемную хату . Сполоснулись и к делу . Начала с минета сосала минут пять говорю ну давай уже переходи к глубокому минету - она а это мол и есть глубокий .  Ну думаю хрен с тобой . хотя так и чесались руки взять за уши и засандалить по самые гланды что бы поняла что есть глубоко . Но сдержался .\nДальше была классика , положил на спину потрахал немного . Сама не мокреет не грамма , активно использует смазку , озвучка как из галимой порнухи меня чють на ржачку не пробило , говорю ты уж лучше просто молча лежи . Потрахал чуток значит в классике , пару раз сменив позы . Говорю ладно давай анал опробуем . Нехотя но все же повернулась к лесу передом ко мне задом , намастырила себе улик , моего шершня и понеслось . Хотя конечно понеслось это я загнул . После пары минут хуетыкания в жопное отверстие . Оксана начала ныть про атский размер и все такое . Сделал вид что поверил . Дурак конечно . До трахивал в классике . Второй раз честно говоря лезть на нее желания не было . Расчитался и ушел . \nрекомендовать не берусь , а там смотрите сами .\nобщие оценки \nТТХ 3+\nМН 3 \nКС 3\nШГ 3 \nЦВ 500+200 за жопу хотя надо было не давать', 0, 1367155501, NULL, NULL, 242, NULL),
