(579, 'bunny', 339, '46.211.121.176', NULL, '[img=PunBB bbcode test]http://s020.radikal.ru/i703/1305/8a/cd598fd39c27.jpg[/img]\nСоблазнился на фотку Насти на сайте блядоагенства Клеопатра , [url=http://forum.natashaescort.com/viewtopic.php?id=184]контора на Левобережной[/url] . Песдеть не буду с фоткой наепа не было , телка реально заипатая . Практически мадель , но на этом вся идилия заканчивается . Но не буду забегать наперед . Девка молодая заявлено двадцать два года но я бы дал лет двадцать . И ведет себя как какая то сцыкуха со своим деревенским бойфрендом на лавочке , попытки потрогать грудь присекаются , блядь и это у шлюхи то , морду лица воротит , и это еще до того как я ей присунул . Естественно от такого поведения х*й пришел в некоторое недоумение - будет он трахатся или нет . Тело же на полуокрепшего бойца кое как натянуло презерватив и начало его жевать , бля реально это даже миней назвать трудно . Сказал прекращать это безобразие и лезть наверх , села начала лениво двигатся , делая при этом какое то отмороженное лицо , и смотря в пустоту куда то . \nСмотреть на такое чето сразу перехотелось , пришлось загибать в позу сломанной березы и так продолжать . Задок выглядит апетитно , попытка засунуть в него чего нибудь породила чуть ли не дикий визг блять . Так что за аналом не сюда . В общем кончил снял презерватив , вытер прибор салфеткой которую с отвращением но все же протянула коза . И сьебал , забив на законно оплаченную вторую палку . Деньги платил сразу - 300 грн. \n\nТТХ - 5\nМИ - 4\nМН -3-\nКС -3 \nШГ -0\nотношение - ну его нах \nЦВ - 300', 0, 1367494179, 1367494385, 'bunny', 243, NULL),
(580, '87919032020', 357, '31.43.118.67', NULL, 'Всем привет я Сергей \nИзобретатель\nс отдыхом и хобби у меня как то не сложилось, надеюсь в ближайшем будущем что то поменять.\nОпыта общения с феями у меня пока тоже нет, но иногда так хочется надеюсь в ближайшем будущем посетит. Нравятся высокие и худенькие может кто кого посоветует.', 0, 1369936067, NULL, NULL, 128, NULL);
