(581, 'riko', 341, '46.211.183.101', NULL, '[url=http://radikal.ru/F/s017.radikal.ru/i432/1306/f2/b4de8b5da470.jpg.html][img]http://s017.radikal.ru/i432/1306/f2/b4de8b5da470t.jpg[/img][/url]\nВо время мониторинга укргоу было найдено обьявление с данной фотой , логика посказывала что фото не может быть оригинальным в принципе , но как говорится все мы в душе остаемся детьми и продолжаем верить в деда мороза . Вобщем с надеждой что с той стороны провода должно находится нечто хотябы отдаленно напоминающее данный партрет - попиздил на пл Поэзии ) . Предварительно созвонившись естественно. \nПо приезду обнаружилось что действительно ничего страшного там нет , а есть две вполне симпотичные девчужки , которые если мне не изменяет память трудились в конторе на Руставелли . Блондинка и брунетка . Выбрал блонду Настю поскольку когда то уже доводилось ее пользовать и все было весьма неплохо. \nПо квартире , квартира совок одним словом . обстановка такая же , скрипучий диван и все дела . Но есть колонка и соответсвенно горячая вода , это плюс . \nпо Насте - довольно рослая с меня (под метр семьдесят) , немаленькая грудь красивой формы , хоть немного и мягковата , идеальная кожа (на ощупь) \nВ процессе мокреет сама , старается угодить , но без фанатизма , вежлива но дистанцию держит . Позы меняет охотно , ну тоесть без лишних вопросов , типа так мне не нравится и тд. Анал не практикует . \nМожно рекомендовать собственно . Весьма положительная девочка \nМИ - 4-\nТТХ - 5-\nМН - 4\nКС - 5\nШГ - нет\nЦВ - 400. Есть еще экспресс-программа (минет) - 250\nОтношение - 5\nРекомендации - да.', 0, 1370336824, NULL, NULL, 244, NULL),
(582, 'harek', 361, '46.211.183.101', NULL, 'Подтверждаю про Настё , деваха неплохая , и про кожу весьма точно замечено , гладил бы и гладил :D\nа про работу в конторе на руставели ничего не скажу , чето не помню ее там ниразу . хотя и бывал регулярно . Может просто не пересекались ХЗ \nПо этому адресу же был пару раз , один раз с Настей , второй драл брунетистую азиатку . Тоже девка зачетная . трахается с огоньком . и вроде даже с оргазмами :cool: ну озвучка уж точно полный аналог . в жопу как и Насте недает , а жалко . \nв принципе все поставленные выше оценки коллеги (для Насти) можно смело применить и к Фаине (вроде так брунетку кличут)', 0, 1370337956, NULL, NULL, 244, NULL),
(583, 'harek', 361, '46.211.121.249', NULL, 'Контора на Пушкинском съезде (место довольно широко известное) Самому тоже доводилось посещать это заведение , и собственно в предыдущий свой вояж удалось там присунуть азерше Эрике которая оставила весьма положительные впечатления . Поэтому проезжая мимо решил заскочить еще разок на пару палок , и именно к ней . \nЗвоню (причем будучи уже возле двери подъезда) \n- драсьте Эрика есть ? \n- канешн . ждет только вас \nОк . Перекурил пару тройку минут не отходя от кассы . Поднимаюсь . Открывает какая то крашенная чучундра , на вопрос про Эрику нагло заявляет что ее только что забрали . На мое заявление о том что я звонил от подъезда пару минут назад мне сказали что она была и из подъезда никто не выходил . ее что инопланетяне забрали ? Тело равнодушно передернуло плечами предложило выбирать из тех кто есть или не парить мозк и уебывать (без мата конечно но смысл от этого не изменился) \nВобщем решил выбрать некую Тину . Крикливое двадцати с небольшим лет брюнетистое создание . \nДальше все произошедшее было не однозначно - с одной стороны телка что есть силы имитировала страсть (типа трахни меня пожесче . давай не останавливайся и все такое) а с другой что есть силы тянула время , пыталась развести на второй час , мол мы еще то не пробовали а еще я это с тобой хочу сделать . \nНо не взирая на эти мансы тело ленивое сверху скакать не захотела . Минет тоже не важный . трахал в миссионерке и раком . в принципе пойдет конечно . озвучка чуток переигрывает . ШГ вроде нету . \nВ самой конторе гвалт как говорила моя покойная бабка . шлюхи орут друг на друга снуют туда сюда . жесть короче . \nитого : \nМИ - 3- (сама хата ниче но движняк шум ну его нах) \nпо телу (Тине) \nМИ - 4-\nКС - 4 \nШГ - \nотношение - 3 слишком неприкрытое желание развести клиента \nЦВ - 500 грн. \nзвонил по этому номеру 8(093)157-36-96 но есть куча других вроде', 0, 1370350911, NULL, NULL, 245, NULL),
(584, 'Alf', 343, '78.140.172.188', NULL, '[img=проститутки Днепра]http://ib2.keep4u.ru/b/2013/03/28/b9/b97ff895205c3dc5d2d9f515cd808391.jpg[/img]\nИтак Люся . \nФото оригинальное , кстати если я не ошибаюсь то сделанное в альтернативном месте поебки , у них во дворе бусик стоит для этих целей приспособленный . Оригиналы блять . Так вот фото Люси соответсвуют , кроме того фотки остальных девок которые я по приходу встретил тоже были оригинальными , что оооочень порадовало . Сама Контора находится на Челюскина кругом в радиусе "добросить кирпичем" и МВД , и ГСО , и МЧС как говорится на все случаи жизни :D или каждой твари по паре ...\nКонторка сама бюджетная довольно таки берут двестиписят гривен всего что на фоне соседней ветки [url]http://forum.natashaescort.com/viewtopic.php?id=232[/url] где бляди по 1200 выглядит очень даже заманчиво \nВ общем пришел предложили три телки на выбор , обстановка в конторе тоже бюджетная . Вот пришел . предложили , выбрал собственно указанную Люсю. На вид лет 25 с неплохой фигуркой .Телка сразу потребовала деньгу , и отправили в душ . Полотенце куцее , гели бабские . Коекак сполоснулся и ладно .\nТелка начала с массажа , плавно перешла на миню , массаж неплохой . подозреваю что работала в салоне каком нибудь раньше . Сосет херовее , на троечку. хоть и пытается окресности полировать , но все равно как то неуклюже . . Пытался помять сиськи , неплохая такая упругая двойка чето промычала мол нелюблю когда их жмакают , за письку тоже руками не лезь . Вообще вела себя довольно хамовито и вызывающе , хотя расчитывать на что то другое за такие деньги было бы глупо. \nВ процессе в комнату вломилось какое то потеряное тело , со словами я не смотрю взяло что то и сьебнулось . дверь не закрывается . Сделал два подхода . больше наверное не пойду хотя хрен его знает цена перебивает большенство недостатков и хамовитось блядей и бытовые моменты (что в душ нужно пиздовать через всю квартиру под блядское хихикание) \nМИ 3+ (удобное расположение, не в ебенях).\nТТХ 4 (хорошее тело, но простоватое лицо)\nКС 3+\nМН 4\nОТНошение 3 (не душевно)\nЦВ 250 грн\nАнал - нет', 0, 1370510205, NULL, NULL, 246, NULL),
(585, 'Alf', 343, '78.140.172.188', NULL, '8(098)285-86-00 Еще один номер этой конторы .\nРасположена в центре города на ул. Ломовой . Недалеко от магазина "1000 мелочей" .  Обьяву приблизительно такого содержания \n[quote=Релакс для мужчин]\nВсегда большой выбор красивых девушек,приезжаем быстро,а также есть место для встреч.[/quote]\nнашел на сайте со всякой рекламной поебенью ака предложение работы грузчикам и тд. ) Фоток красивых девушек к сожалению не прилогалось . Бордельеро на первом этаже со следами неудавшегося . толи начатого и незавершенного ремонта .\nНа выбор были предложены несколько тел . Пара тонконожек , какой то угрюмый гоблен , и сисястая вполне симпотичная барышня с паро кило лишнего веса , не критично . \nДальше был главный атракцион программы - поход в душь через кухню на которой толпа непонятных личностей аля диспечер охранник и еще какая то хуйня женского полу с синяком под глазом дружно что то обсуждали . но сделав морду кирпичем проследовал в душь и обратно .\nСисястая (как звали не помню) ждала в поебочной . \nНачала с того что потерлась немного сиськами об мнЫ , а когда егн встал зажала его между ними приступила к разминке . Потом поганяв немного между сиськами обрезинила и перешла к мине . Сосет недурственно старается заглатывать , окрестности конечно не шибко трогает но пойдет . Потом переложил ее на спину и вдул . Прогибается обхватывает ногами , подмахивает впринципе нормально все . Так и отстрелялся . в перерыве потрепалась о себе . о том что работает тут периодически , когда нужда в деньгах появляется , как и большинство тамошних телок . Сама же толи стилист толи парикмакерша , запустила руку в волосы и сказала что тебе тут нужно убрать чуток )))) \nПредложил перейти ко второму заходу . Опять елозиние сиськаме , миня и трах . Трахал по собачи . Кончить разрешила между сисег . В принципе неплохая душевная девка , Но врядли второй раз на нее попасть удастся так что на счет рекомендаций именно конторе воздержусь . \nОбщие оценки : \nТТХ - 4- (есть пара кило лишних но сиськи зачетные ) \nМН - (минет) 4 твердая четверка \nМИ - Место имения - 3 \nКС - 4 \nШГ - у нее вроде нету \nЦВ - 400 грн. но где то видел обьявы с этим же номером по 250 , может старые ХЗ', 0, 1370518237, NULL, NULL, 247, NULL),
(586, 'Alf', 343, '78.140.172.188', NULL, '[img=шлюхи Луганска]http://s002.radikal.ru/i197/1212/c8/cae88d19b52f.jpg[/img]\nПланировалась командировка в Луганск , поэтому о досуге решил позаботится заранее , шоб потом не метатся по чужему городу в поисках епабельного мяса , или даже не епабельного а хоть какого нибудь . так вот значит заблаговременно пройдясь по сраной мамбе было выцепленно молодое тельце [url]http://www.mamba.ru/anketa.phtml?oid=981766686&hit=3[/url] назвавшееся Тоней . За пару часов вседозволенности (включая ШГ) была названа сумма в 800 грн. с которой собственно и согласился . Ничего другого увы нарисовать неполучилось .\nНу вот значит приехал в луганск . разгреб свои дела потихоньку а вечерком набираю Тоню . Але - але . мы списывались на мамбе по поводу перепиха . Ответ - да я помню сейчас буду . \nПриехала на таксо минут через сорок писят . Фотке в принципе соответсвует невысокого росту . как по мне правда дофига косметики для такого юного возраста , визуально лет двадцать телке . В душ не пошла сказала что дома приняла .\nРаздел . Сиськи небольшие в районе двойки но упругие и красивой формы . Фигурка тоже неплохая , а вот кожа не идеальна , особенно на спине . Начали с минета . Как мне показалось девчужко чуток стесняется шоле , поэтому все как то напряженно чтоли . Минетит довольно жостко и не глубоко + проскакивают зубки . Возможен МБР кому интерестно . \nНемного поизвращавщись над моим половым куем телка была завалена на спину и добита .\nв перерыве выпили вина на пытался разговорить . Неполучилось . Разговор поддерживает как то вяло и не охотно . Поэтому решено было засандалить ей в ШГ и спровадить нах . \nШо и было сделано . Вошел с трудом , но сделав пару тройку движений член выскочил нафик , а телка начала чето ныть про большой размер и все такое . хотя по правде хвастатся размером мне совесть не позволит )))) Ну пожалел снял през и кончил в рот . Сплюнула в салфетку . получила деньги и потерялась в наступивших сумерках )))\nТТХ - 5 \nМН - 3+ сосать надо подучится \nКС - 4- старается впринципе \nШГ - 3 тоже практики не хватает видать \nШВ - 800 грн. за встречу \nтелефон не сохранился , списывайтесь на мамбе кому приспичит . Рекомендовать для разового слива можно.', 0, 1370523038, NULL, NULL, 248, NULL),
(587, 'Alf', 343, '78.140.172.188', NULL, '[img=проститутки Луганска]http://s60.radikal.ru/i169/1211/e7/b9831eab1626.jpg[/img]\nЕще одна Луганская инди . Найдена как и предыдущая [url=http://forum.natashaescort.com/viewtopic.php?id=248]Тоня[/url] на той же мамбе - [url=http://www.mamba.ru/mb992112047]ссылка на мамбоанкету[/url] сейчас фотки поубирала , но раньше были та что сверху и еще парочка . в целом фотки правдивы . В реале тридцатилетняя телка с подвисшей грудью но вполне неплохой фигурой . Личико так себе но не страшное шоб сильно так уж. договорились на 400 грн. за час . места у нее нет , поэтому драл у себя в гостиннице . Ничем особо не запомнилась собственно . минетит посредственно . Трахается тоже механически . Озвучка цифровая . Грудь немного подвисает как я уже сказал . незнаю может последствия рождения детеныша . \nПо времени разве что пробыла часа два , вдул дважды , между подходами посидели выпили немного вина . Пожаловалась на жизнь . В общем разовый бюджетный вариант . Не уверен рабочий ли ШГ , сам не тестировал . Но шаловливые пальчики блять случайно там оказавшиеся сопротивления не встретили , так что вполне возможно что рабочий . \nНехер больше писать .\nТТХ -4-\nКс - механика 3+\nМИ - 4- \nШГ - небыло \nЦВ - 400 грн. время строго не секла', 0, 1370524906, NULL, NULL, 249, NULL),
(588, 'Мегапихарь', 336, '78.140.172.188', NULL, '[img=PunBB bbcode test]http://ib3.keep4u.ru/b/2013/05/11/ef/efd895b797e25d94fde00fbf0f700795.png[/img]\n[url]http://kiev.ukrgo.com/post_1934625_sladkij_analchik..500_grn..lukjanovka.html[/url]\nНашел обьявление типо сладкий анал Лукьяновка бла бла бла , к нему же крепилось данное фото \nРешил опробовать что там в этой жопе сладкого :lol:\nПринимает таки на Лукьяновке , фото конечно старые , сейчас девка более потрепана жизнью . По типажу тонконожка , на вид года 24 . Сиськи полторашки . \nМИ - убитая гостинка , но замечу что с кондишином . Ванная тоже не айс. \nСполоснулся вхожу - барышня уже лежит голая . Блять как то не то что бы неожиданно , но блин все равно не то . Типо зашел лежит на кровати резиновая баба , вдул без разговоров и свалил . что бы очередь не задерживать  . В общем ощущение конвеера полное , хотя очереди конечно под дверью не видел . \nТелка так же без лишних разговоров начинает сосать , причем без резины . Агрегат поднялся в боевое положение . она надела през так же молча становится раком - мол давай трахай уже че застыл \nНу хрен с тобой очи бачилы шо бралы , тепер йижте хочь повылазьте \nТак по собачи ее и доеп .\nпрез правда сама сняла протянула салфетку . Полежали немного . \nОна - ну что готов ? \nГотов \nПоднимает второй раз бойца кое как .\nГоворю давай смазку доставай будем в шг тебя драть . Ой а смазка закончилась . Ну блять думаю хрен с тобой в песду один хрен что в ведро тыкать разношено все в хлам . На гондоне коекакая смазка была с усилием но присунул ей под хвост . Через пару минут замерил что тело начало кривится и пытатся слезть с куя . Хули без смазки то хотела . Ускорил обороты и произвел отстрел . Тело облегченно вздохнуло напоследок . в процессе вместо озвучки было только непонятное кряхтение . За жопу кстати две сотни сверху . \nТТХ - тонконожко мне такие нравятся так что 4 \nКС - 3 разношено и озвучка никакая \nМИ - 3 гостинка средней убитости \nМН - так себе сосет , может без резины \nШГ - тут в принципе компресия нормальная и посторонних запахов ненаблюдалось так что 4 (бал скину за отсуствие смазки) \nрекомендовать небуду , а там смотрите сами', 0, 1370606329, NULL, NULL, 250, NULL),
(589, 'riddik', 364, '78.140.172.188', NULL, '[img=PunBB bbcode test]http://img100.imageshack.us/img100/2590/7imagerpostphp.png[/img]\nДивчина такі дійсно файна . Шкода лінк на анкету прикласти не можу бо вже сдохли курва тих мамбоадмінів мама була . \nотже здибав на тій самій мамбі адмінів котрой я обклав у попередньому реченні , отримав від панночкі цихверки зазначені в назві теми (номер блядохвона тобто) \nДомовились на вечір бо мав деякі справи . Ввечері приїхала вномера . Зупинився в готелі . Спустився розрахувався за таксі , джентельмен епт . Повів до свого барлогу . \nПо курві - років двадцать з гаком (невеличкім) не страшна , не товста .\nЗбігала в душ , вийшла загорнута в рушник , і до справи .\n\nСмокче добре , старается , звістно можна було пару раз й балабони полирнуть ну то таке ...\nСісько красиві хочь і не дуже великі , такі дівчачі . Посадив її зверху наказав скакати,  добре так скаче , майже як заправскій козарлюга ))) Потім ломали березку , теж гарно виглядае в букві зю . То ж зробив два повноцінних підходи до снаряду . В зад не дає а шкода . Намагався вмовити хуй там . Більш добавити нема чьго , в підсумку маємо таки розклади \n\nТТХ - зачьотні 5 баллів \nМН - минетить теж непогано але на 4 мабуть такі \nКС - їбеться тобре , стараеться догодити і агрегати не дуже зношені ще тож 4 \nШГ - нєєєєєє \nусьо \nаа ЦВ - 350 гривень во', 0, 1370613990, NULL, NULL, 251, NULL),
(590, 'riddik', 364, '78.140.172.188', NULL, '[img=PunBB bbcode test]http://ib3.keep4u.ru/b/2012/07/09/16/16911acab5ba4aa42805991e31205279.jpg[/img]\nГаразд добавлю звіт ще по одній шльондрі трясця її мамі , відкликається на Олену , чи Альону як ті москалі кажуть тьху . Тьотя доросліша ніж попередниця по якій я звіт писав , це я про [url=http://forum.natashaescort.com/viewtopic.php?id=251]Катю [/url] . Цій курві напевно років тридцать з гаком . Здибав так само на мамбі , але анкета на жаль теж прибита долбойпами мамбоадмінами , хоча може ї сама тьотя постаралась , та й байдуже тілифончік маємо . \nгаразд повернемось до суті .\nМестоимения дама не має . тож мусив сам зїомну хату шукать . Прибула без запізнень в блядскому прикіді . Крашена блонда бальзаківського віку . чі возраста по москалькі . \nБабец веселий абсчітельний , з непогано збереженною хвігуркою , стало зрозуміло істествєнно при разоблачєнії )) Хоча якщо вже на чістоту то сісько неайс , невеличькі й втомлені трошкі . \nПочали з міні . Занадто вже лагідного як на мене , хотілось би більш жосткого , ну то кожному свое , у кожного свої таракани . \nВ класиці теж активно підмахує стогне , і все такє , тобто душевний такій трах виходить . В процессі совокуплєнія був прозондований ШГ . Ольона натяк зрозуміла так як треба , дістала змазку . перейшли до аналу . Тут тоже всьО зачьотно . Чісто без сторонніх запахив і встречняків всілякіх . Жопка тугенька гладенька . вобщем класно так поїбався прошу не сприїмати за піар .\nИтого \nТТХ - 4 - за ціцькі а так для її віку непогано \nМН - нормально смокче 4 \nКС - 4+ \nШг - тут 5 без варіантів \nна цьому допобачення', 0, 1370615560, NULL, NULL, 252, NULL),
(591, 'Вася', 365, '78.140.172.188', NULL, '[url=http://radikal.ru/F/s020.radikal.ru/i714/1306/b7/78eff28ec6af.jpg.html][img]http://s020.radikal.ru/i714/1306/b7/78eff28ec6aft.jpg[/img][/url]\nВдохновили камрады своими отчетам , а по городу Ровно смотрю их не так уж много , так что решил и я свою лепту внести . отчет первый поэтому строго прошу не судить . но сразу предупреждаю мне в отличии от этих отчетов \n[url]http://forum.natashaescort.com/viewtopic.php?id=252[/url]\n[url]http://forum.natashaescort.com/viewtopic.php?id=251[/url]\nнапример повезло меньше . ибо хоть и мониторил одну и туже мамбу с камрадом риддиком попался мне маленький бегемотик вот ссылка на анкету  [url]http://www.mamba.ru/mb947870401[/url] блеать молодая девка епт а уже целюлит и прочие прелести . Короче списывались на мамбе была озвучена цена в 300 грн. места своего нет естественно . Студенка типо . \nНу да бог с ним . Созвонился , договорились где подберу . Решил драть в сауне . \nЗабрал привез раздел .... про целюлит я уже говорил , ну и сама не малЭнька скажем так . на лицо пойдет хотя и не красавица шо писец. \nНачали с минетика . без резинки . Сосала довольно долго . Аж начала жаловатся что шея болит , ну болит так болит одели резинку перешли к миссионерке , потрахал немного так , потом ноги себе на плечи закинул . думаю а не вдуть ли мне ее с черного хода , попытка успехом не увенчалась пошла в категорический отказ . Ну хрен с тобой . Поставил в коленно локтевую и "добил" \nМинут пятнадцать перерыв и второй заход . Примерно по той же программе . Разве что со сменой поз . \nВ целом оценки такие : \nТТХ - 3 \nКС - тоже самое , вяло все и не интерестно 3\nМинет - тоже трояк неглубоко без окрестностей . уныло вобщем \nШг - нету \nцв - 300 грн. \nБольше точно не пойду', 0, 1370617812, NULL, NULL, 253, NULL),
