(593, 'Вася', 365, '78.140.172.188', NULL, 'Еще одна опробованная мной фея . Зовут Наташей . возраст лет под сорок наверное . Фото увы нету , и в анкете нету то же . Списываться кого заинтересует наверное лучше всего через мамбу хотя хрен его знает насколько она шифруется . Ссылка на анкету вот [url]http://www.mamba.ru/mb748728613[/url]\nВ общем списались договорились созвонились . Пригласила к себе . Квартирка нормальная чистенько . ремонтик опятьже свежий походу . Сама же если по правде не красавица . Тело тоже не фонтан . Но заднюю включать было поздно . в душ то уже сходил )))) помытся и сьебатся как то не камильфо ))\nПодошла опустилась на колени передо мной и начала делать минет , сначала как то вяло , поэтому пришлось взять инициативу в свои руки , в результате минет превратился в еплю в голову . Наташу по ходу это тоже завело , ну или мне так показалось , но таки потащила меня в койку со словами давай трахни меня посильнее или чето такое , что и не замедлил исполнить . Конечно рабочее отверстие там как черная дыра . Реально было страшно что провалюсь "в неизвестность" с концами , но тем не менее кончил . \nПолежали немного , поглаживаниями обцеловыванеями подняла все же бойца во второй раз . Понимая что с такой компрессией основного калибра у меня кончить вряд ли получится , предложил перейти к запастному аэродрому . на что получил согласие . Поросила что бы не спешил мол давно не практиковала и все такое ... \nБлин ожидания не оправдались Шг тоже расдолбан , вошел со свистом . Кончить удалось через полчаса и то после того как сняв гондон засандалил ей в рот по самые гланды . \nВот как то так . С одной стророны вроде цена 300 гривен , а с другой  все издержки . Так что решайте сами . я больше не пойду . \n\nТТХ - 3 возраст епт \nМИ - местоимение нормальное это да 4\nМН - 4\nКС - 3 \nШГ - 3 \nОтношение - ну это нормально , это 5 \nЦВ - 300 гривасей', 0, 1370619367, NULL, NULL, 254, NULL),
(594, 'yak_40', 347, '78.140.172.188', NULL, '[url=http://radikal.ru/F/s017.radikal.ru/i411/1306/d2/6a47f627ca71.jpg.html][img]http://s017.radikal.ru/i411/1306/d2/6a47f627ca71t.jpg[/img][/url]\n[url]http://www.mamba.ru/mb1114236908[/url]\nЗаявлено двадцать три но думаю там лет двадцать пять точно . Как ни странно телка с фото была в наличии , хотя по сути это контора . На месте было две телки выбрал ту что на фотке , вторая непонравилась вообще хотя и у этой внешность как сами видите не идеальна , низ тяжеловат ноги толстые , лицо на любителя как тут принято говорить что бы тетку не обидеть . Ну да бог с ним . Отдал оговоренные четыреста гривен . В душ дома ходил перед выездом о чем собственно и упомянул .\nПрошли в опочивальню , девка скинула халатик - под ним кружевные труселя и прочие блядские прибамбасы , ниче так . подошла помогла раздется типо и сразу перешла к оральным ласкам , през одела ртом разгладила рукой , дальше механические возвратно поступательные движения головой . Которые пришлось прервать и переходить к более существенным действиям . Незнаю почему но решил драть в позе бобра . ХЗ жопа у нее в таком ракурсе заманчиво смотрится блин . Песда довольно неплохо сохранившаяся для данной профессии я бы сказал , не то что бывает тыкаеш как в тунель метрополетена со страхом что из темноты сейчас поезд заторохтит ))) тут все было практически тугонько . Так что сжимая в руках аппетитные булки кончил довольно быстро . \nСбегал по быренькому сполоснул под краником "бурильщика метростроевца" тело убежало на кухню вернулось с кофе . спросил че на кухне не выпить - ответ там подружка занимается промоушингом сервиса ))) типо операторша с ноутбуком сидит ))\nну выпили кофе , телка спрашивает - продолжим ? \nпродолжим . Поднимает минетом бойца . Одевает резину . Командую прыгать сверху . Прыгала довольно долго , но вижу уставать начинает . Помял немного сиськи (1.5 походу) переложил в миссионерку и минут через пятнадцать разрядился . Собрался и свалил. \nПо факту  , \nТТХ - телка чуть толще чем выглядит на фотке но в принципе терпимо 4- \nМИ - местоимение 3 + \nМН - минет не глубокий хотя обещан был горловой блять так что тоже 3+\nКС - 4 нормально старается \nОтношение - 5 нормальная девка разговор поддерживает , но без груза . старается угодить \nШГ - есть но не пробовал потому что за него просят 800 что для нашего колхоза сумма астрономическая \nЦВ - 400 грн.', 0, 1370693345, NULL, NULL, 255, NULL),
