(600, 'nlke40', 375, '78.140.172.188', NULL, 'Фотографию можете легко найти вбив в поисковик номер телефона, он вам выдаст кучу ее анкет с фото, фото реальные 100%. Выбрал данную девицу так как про нее здесь уже писали (проверенная уже ) да и индивидуалка не салон. Что могу сказать куча разочарований, грудь где-то около 3 размера, не стоячая, мягкая, местоимение убитый дом с убитым диваном, с одной подушкой на который она набросила видавшую виды простынь. Самое интересное, сказала что целовать грудь  и письку нельзя , а то ей щекотно, (да и не собирался я ее целовать там)но что бы грудь нельзя было это для меня новость. После того как лягли на диван, у нее зазвонил телефон и она как ни в чем не бывало начала разговаривать с интересующимся комрадом, наконец то перешли мы к делу.В общем посадил сверху как уже писал yak_40 песда слишком уж свободная у нее, сама медленная или ленивая очень быстро усала, потому продолжил раком, так и отстрелялся. Резинку сняла сама, после чего со словами жарко пошла на кухню промелькнула с бытылкой напитка, мне не предложено было даже воды не то чтобы кофе или чай(хороша индивидуалка ничего не скажешь). По второму разу уже как-то не хотелось, но деньги то уже заплатил  попросила сразу, поэтому решил остаться, тут снова зазвонил ее телефон, и так раза три, инициативы никакой не проявляла, поэтому попросил сделать минетик, согласилась сразу, но через минуты две снова она устала, пэтому поставил опять раком так второй заход и закончил после чего оделся и ушел.            Рекомендовать не стану ни в коем случае. Потому как помоему, если к тебе приехал клиент, то отключи телефон на это время, можно было бы и чаю предложить между палками, как это делают нормальные девки, хата убитая, ттх тоже никуда не годится дырка свободная, сиськи мягкие, сама вялая или скорее всего я думаю ленивая да и живет далеко. А цена вопроса 350грн. это при том что сейчас в салонах можно такую же найти но за 250-300 и ехать так далеко не надо. Обычно индивидуалки делают все что бы клиент вернулся еще раз (это имеются в виду нормальные девки)а эта тупо бабло молотит, все равно ведь кто-то да приедет. зачем напрягаться.', 0, 1372877173, NULL, NULL, 256, NULL),
(601, 'Desdechado@i.ua', 377, '78.140.172.188', NULL, '2.07.13 около 21.40 на Мамбе была удалена анкета Юлии 18 лет...бля. прям милицейска сводка ) \nвообщем только списались, мол то да се - маленкая, хрупкая, принимаю у себя, анал, глотаю...и тут бздык!...её накрыли. ну не облом?...\nда отличительная черта - просила 250 грн предоплаты внести на карточку...тут я начал ломаться и время отведенное для свиданий быстро закончилось и мы не успели обменяться телефонами..бля...ь \nЛюди добрые - может кто узнал о ком речь - дайте телефон...спать не могу....', 0, 1373038586, NULL, NULL, 257, NULL),
(602, 'Desdechado@i.ua', 377, '78.140.172.188', NULL, 'обновите фото пж ... буду ехать во львов, хотелось бы увидеть его со всех сторон )', 0, 1373103897, NULL, NULL, 130, NULL),
(603, 'Desdechado@i.ua', 377, '78.140.172.188', NULL, 'в телефоне не хватает одной цифры....подправьте', 0, 1373128432, NULL, NULL, 35, NULL);
