(2, 514, 218, 2, 352, 1367413490, 'http://vk.com/miha2007 - обещаю подтвердить свою почту с размещением на своей страничке упоминания, о том, что я жалуюсь на незаконное присвоение авторства !', 1367841085, 2),
(3, 514, 218, 2, 352, 1368185077, 'Добрый день! А почему вы опять включили мое фото?', 1370377293, 2),
(4, 514, 218, 2, 352, 1368185254, 'http://my.mail.ru/mail/iotova.v88#page=/mail/iotova.v88/photo? - это ссылка с подтверждением что фото реально мои и прошу вас убрать их, это все не про меня!', 1370377293, 2),
(5, 514, 218, 2, 352, 1368267502, 'Да что это такое! Я вам пишу жалобу а вы без реакции! Так и должно быть? Вообще кто такое написал? Можно как-то узнать?', 1370377293, 2),
(6, 514, 218, 2, 352, 1368267591, 'Я не праститутка!!!! Проверяйте информацию перед тем как ее выставлять! Уберите мое фото!', 1370377293, 2),
(7, 514, 218, 2, 352, 1368294121, 'Мне что, вас упрашивать или лучше обратиться в правоохранительные органы! Так я так и сделаю! Даже ни одного ответа мне на мою жалобу!', 1370377293, 2),
(8, 514, 218, 2, 352, 1368298732, 'Что мне надо сделать, чтобы вы со мной хоть \nпообщались? Вы же улетали это, зачем востановили? Ответьте мне пожалуйста, что бы \nзнать что делать!', 1370377293, 2),
(9, 514, 218, 2, 352, 1368359803, 'http://my.mail.ru/mail/iotova.v88/photo?  - уберите мою фотографию!!!!', 1370377293, 2);
